INSERT INTO `NewsArticle` VALUES (1,'＜医療事故＞遺族の相談窓口　市民団体が設置','soci','　１日にスタートした医療事故調査制度を巡り、医療の安全向上を目指して活動する市民団体が２日、遺族らの相談を受け付ける窓口を設置すると発表した。制度では調査を開始するかの判断は医療機関に任され、開始しない場合に遺族が相談する窓口がないことから、支援を始めることにしたという。　窓口を設けるのは「患者の視点で医療安全を考える連絡協議会」（永井裕之代表）。　協議会は遺族から電子メールなどで相談を受け付け、医療問題に詳しい弁護士や各地の支援団体を紹介する。遺族が希望すれば、調査開始を求めて医療機関と話し合う場に同席する。医療機関側の対応に納得できない内部の関係者からの相談にも応じる。　これまでも協議会は遺族らの相談を受ける窓口を作るよう国に要望してきたが、実現していない。永井代表は「遺族が納得するためには医療機関がきちんと調査することが必要。国が窓口を作るまで、我々が相談を受け付けたい」と話した。　相談は同協議会のホームページで受け付ける。電話の場合は午前９時〜午後８時。遺族や被害者からの相談は０９０・６０１６・８４２３。医療機関の内部関係者からの相談は０９０・１７９５・９４５２。　制度では死亡事故が起きても、医療機関が事故を「予期できた」と判断すれば、調査する必要はない。この判断に対して、遺族が制度の中核である第三者機関に異議の申し立てができないことが、課題と指摘されている。【古関俊樹】'),(2,'＜日比谷野音＞安保反対、脱原発集会に１万５０００人','soci','　安全保障関連法反対や脱原発を訴える集会が２日、東京都千代田区の日比谷野外音楽堂で開かれ、デモ行進と合わせて約１万５０００人（主催者発表）が参加した。参加者らは安保関連法の成立を強行採決だと批判し、「民主主義を取り戻そう」と声を上げた。　集会は、福島第１原発の事故以降に原発ゼロに向け活動している「首都圏反原発連合」などが呼びかけた。集会後は、週末でにぎわう新橋や銀座をデモ行進し、「原発はいらない」「命を守ろう」と訴えた。　集会で登壇した中野晃一・上智大教授は安保関連法や原発再稼働を「国家の暴走によって私たちを屈服させようとする動き」と批判。「私たちの生活や尊い命、人間の尊厳を守る闘いだ」と述べた。　参加した杉並区の無職、山下源一さん（７０）は「原発事故から４年半がたったが、政治家は事故の恐ろしさをずっと心に刻んでほしい」と原発反対を訴えていた。【内橋寿明】'),(3,'記憶遺産登録なら反日宣伝拡大の恐れ　「南京事件」「慰安婦」中国申請２件の可否焦点','soci','　世界記憶遺産への登録を決める国連教育科学文化機関（ユネスコ）の国際諮問委員会の会議は４〜６日まで開かれるが、日本からは大戦後のシベリア抑留の関連資料と国宝「東寺百合文書（ひゃくごうもんじょ）」の２件が審査を受ける。海外案件で注目されるのは中国が申請した日中戦争時の南京事件と慰安婦に関する資料２件。日本側が「政治的利用だ」と抗議、取り下げを要請したが中国側は応じなかった。　日本側が申請したシベリア抑留資料は舞鶴港に引き揚げた人々の手記などで、舞鶴引揚記念館（京都府舞鶴市）が所蔵する５７０点。ヒット曲「岸壁の母」のモデル、端野（はしの）いせさんが息子に宛てた手紙や、抑留者がシラカバの皮に心情をつづった「白樺（しらかば）日誌」も含まれる。　東寺百合文書は、京都市の東寺に伝えられてきた奈良から江戸時代の約２万５０００通に及ぶ寺院運営に関する古文書。足利義満の直筆や織田信長の印が入った文書もある。　一方、中国が登録申請した南京事件と慰安婦の関係資料は、当時の日記や写真、映画フィルム、旧日本軍の戦争犯罪を裁いた南京軍事法廷の記録文書などとされる。　記憶遺産に登録されると、「歴史的に貴重な資料」と公式に認められ、最新技術で保存されたデジタルデータで一般公開されることになる。中国の２件が登録されれば、ユネスコの“お墨付き”を得たとして反日宣伝がさらに強まりかねない。　菅義偉官房長官は２日の記者会見で、中国の登録申請について「過去の一時期の負の遺産をいたずらに強調しようとしていることは極めて遺憾だ」と強い不快感を示した。　登録審査は２年に１度。９月に国内候補として選定された外交官の杉原千畝（ちうね）氏の資料（杉原リスト、所在地・岐阜県）と日本最古の石碑を含む「上野三碑（こうずけさんぴ）」（群馬県）の２件は、２０１７年夏ごろに審査を受ける見通し。'),(4,'祇園暴走事故、遺族が両親と社長らを賠償提訴','soci','　京都・祇園で２０１２年４月、軽ワゴン車が暴走し、通行人７人が死亡、１２人が重軽傷を負った事故で、亡くなった３人の遺族が、車を運転していた呉服店社員の男（死亡、当時３０歳）の両親と同店の女性社長（７３）らに慰謝料など計約４６００万円の損害賠償を求めて京都地裁に提訴したことがわかった。１日付。　原告は、亡くなった京都市の男性（当時４０歳）と女性（同６２歳）、埼玉県蕨市の女性（同６２歳）の遺族計４人。　訴状などによると、男はてんかんの持病があり、医師から運転を止められていたのに、両親は勤務先に伝えず、社長は持病を知りながら配達業務を続けさせ、１２年４月１２日、京都市東山区の祇園にある交差点で、赤信号を無視して歩行者らをはねたとしている。'),(5,'撮り鉄、８８０ｍロープ切って支柱１００本抜く','soci','　福島県白河市のＪＲ東北線の線路内で６月、保安用のロープが切られて支柱が引き抜かれる被害があり、白河署は２日、京都市の男子大学生（１８）を器物損壊容疑で逮捕したと発表した。　大学生は「撮り鉄」と呼ばれる鉄道ファンで、調べに対し「写真をきれいに撮りたかった。一人でやった」と供述しているという。　発表によると、大学生は６月上旬の夜、白河市の白河―久田野駅間の上下線の間に張られた約８８０メートルのロープを切り、ロープを支える鉄製の柱（高さ約０・９メートル）約１００本を引き抜いた疑い。同署が押収した撮影データからは、大学生が支柱を引き抜く動画や、６月６日に同線を走った、電気機関車が旧型客車を牽引（けんいん）する特別列車の画像が見つかったという。'),(6,'「列車を撮るのに邪魔」　線路の柵１００本を抜いた疑い','soci','　福島県白河市のＪＲ東北線白河―久田野駅間で６月、上下線の線路の間に設置された安全柵の鉄の棒約１００本が抜かれロープが切られていた事件で、白河署は２日、京都市の男子大学生（１８）を器物損壊容疑で逮捕し発表した。大学生は当時、列車の撮影目的で現場を訪れており、「列車をきれいに撮るのに（棒とロープが）邪魔だった」と容疑を認めているという。　同署によると大学生は６月４日夕方から８日午前の間、両駅間の約８００メートルの区間に打ち込まれた鉄棒約１００本を抜き取り、棒をつなぐロープを切断した疑いがある。　６月６日には、昭和初期に製造された「ＥＬレトロ栃木・福島号」など珍しい列車が両駅間を通過し、周辺には多くの鉄道愛好家が集まっていた。大学生が所持する写真の中には、犯行現場付近で同列車を撮影したもののほか、暗闇の中で自らロープを切断する様子を撮影したものもあった。大学生は、自分１人でやったと話しているという。　東北線では、泉崎―矢吹駅間でも６月に鉄棒１７本が抜かれロープが切られる被害があり、同署が関連を調べている。'),(7,'〔首都圏鉄道〕夕ラッシュ時間帯にJR各線でダイヤ乱れ相次ぐ(2日20時現在)','soci','2日20:00現在、首都圏のJR各線では人身事故などの影響により、ダイヤ乱れが相次いで発生しています。交通機関の利用にあたっては、最新の情報をご確認ください。■運転見合わせ・横須賀線、湘南新宿ライン　19:11頃、新川崎〜横浜駅間で人身事故■ダイヤ乱れ・中央線(快速)、中央本線(高尾〜甲府)　18:45頃、武蔵小金井駅で人身事故・京浜東北根岸線　19:11頃、横須賀線・新川崎〜横浜駅間で人身事故・埼京線、川越線(大宮〜川越)　18:45頃、板橋駅で架線に付着物■直通運転中止・中央線(快速)←→青梅線(立川〜青梅)・横須賀線←→総武線(快速)・埼京線←→川越線(大宮〜川越)・埼京線←→りんかい線■特急列車運転状況・スーパーあずさ号、あずさ号、かいじ号：遅れ・成田エクスプレス号：遅れ'),(8,'＜ＵＮＨＣＲ親善大使＞「難民は同じ人、チャンスを」','soci','　スーダン内戦（１９８３〜２００５年）を逃れ、避難先以外の国が難民を受け入れる「第三国定住」制度で移り住んだ米国で俳優などとして活動する国連難民高等弁務官事務所（ＵＮＨＣＲ）親善大使、ゲール・ドゥエイニーさん（３６）が１日、毎日新聞の取材に応じ、シリアなどからの難民受け入れで国際社会が揺れていることについて「難民は難民である前にあなたや私と同じ人。市民として同じように社会でチャンスが与えられるべきだ」と指摘した。日本がさらに難民を受け入れるかについては「難民のことを知った上で決めてもらいたい」と述べ、難民問題に関心を持ってほしいと訴えた。【隅俊之、三木幸治】　◇来日のドゥエイニーさん　スーダン南部（現在の南スーダン）出身。内戦では少年兵として従事させられ、徒歩で逃れたエチオピアやケニアの難民キャンプを転々とした。９４年に１６歳で米国に難民として受け入れられ、大学で学ぶ傍ら、コメディー映画「ハッカビーズ」に出演。これを機に俳優やモデルとして活躍の場を広げている。「故郷を追われた難民は多くを失う。溶け込むのは挑戦だった。それでも米国はドアを開けてくれた」と話す。　スーダンから独立後も内戦状態が続く南スーダンでは日本の自衛隊が国連の平和維持活動（ＰＫＯ）に従事している。ドゥエイニーさんは「故郷は国際社会の支援を必要としている」とした上で、治安の安定には「何よりも人々の教育が重要」と指摘。ケニアの難民キャンプで、日本の支援で建設された学校に通う生徒たちから「日本に行ったら感謝の気持ちを伝えてほしい」と頼まれたことを挙げながら、教育分野での支援の継続を訴えた。　ＵＮＨＣＲによると、世界の難民・国内避難民は約６０００万人。ドゥエイニーさんは「このままでは７０００万人、８０００万、９０００万。１億人以上になるかもしれない。だが、私たちはそんな状況を見たいだろうか」と語り、国際社会の取り組みを求めた。　ドゥエイニーさんは東京などで開かれるＵＮＨＣＲの難民映画祭のために来日した。　◇難民映画祭…東京・札幌・仙台で開催　難民映画祭は東京、札幌、仙台の３都市で開催。スーダン難民、シリア難民などを描いたドキュメンタリー映画など１０作品を上映する。１１月１日まで。問い合わせはＵＮＨＣＲ駐日事務所（０３・３４９９・２０１１）。'),(9,'中央線(快速) 武蔵小金井駅で本日2度目の人身事故 運転再開','soci','武蔵小金井駅で発生した人身事故の影響で、中央線(快速)および中央本線・高尾〜甲府駅間は運転を見合わせていましたが、19:54頃、運転を再開しました。なお、ダイヤが乱れています。■ダイヤ乱れ・中央線(快速)、中央本線(高尾〜甲府)・特急スーパーあずさ号、あずさ号、かいじ号■直通運転中止・中央線(快速)←→青梅線'),(10,'ドクター・中松、治療法が追い抜かないと「私は１００パーセント死ぬ」','soci','　現代医療では治療できない「前立腺導管がん」になり、医師から今年末までの余命と宣告を受けている発明家のドクター・中松氏（８７）が２日、東京・有楽町の日本外国特派員協会で会見し「がん治療の１０種の発明」のうち半分まで完成したと明らかにした。　中松氏によれば、今年中に１０種類が完成すれば、晴れて２０１６年の正月を迎えることができるという。「大みそかに向けて、今はがんが先頭を走っている。後ろを走っている治療法が追い抜いて先にゴールのテープを切らなければ私は１００パーセント死ぬ」と断言した。　現在は以下の５種までは、完成しているという。〈１〉２０種類の薬草が入ったお茶「トゥエンティー」〈２〉がん撲滅ソング「Ｅｖｅｎ　Ｃａｎｃｅｒ　Ｆａｃｅ　Ｖｅｒｙ　Ｂａｄ　（がんの顔つき悪くても）」〈３〉がんを撲滅する「ガンガンカレー」〈４〉がん撲滅のためのふりかけ「ガンガンおいしい」〈５〉がんに負けない心の健康法。　年内あと３か月で発明しなくてはいけないのは次の５種だ。〈６〉１４４歳まで生きる健康法「リボディ」〈７〉がんを治す「ガンガンドリンク」〈８〉がんに立ち向かう「ガンガン筋トレ」〈９〉がんを退治する水を使った「アクア治療法」〈１０〉がんを退治する「ガンガンロボット」。　中松氏によれば、がんの進行は日々進んでおり、この日は車いすに乗って登場。先月１７日に米国のハーバード大で行われたイグノーベル賞授賞式の様子をビデオで紹介した後は、自身が発明したという給油ポンプを握りしめながら高らかに「がん撲滅ソング」を歌った。　会見の終わりには、英国の教育専門誌の世界大学ランキングで、母校の東大が、アジアの首位から転落したことを嘆き「東大に代わって首位になれる大学を死ぬ前に私が作る」と宣言をして締めくくった。'),(11,'佐野氏ロゴ、使用断念…市民から批判で方針転換','soci','　アートディレクターの佐野研二郎氏がデザインした群馬県太田市の文化施設「おおたＢＩＴＯ　太田市美術館・図書館」（建設中）のロゴについて、清水聖義市長は２日、使用を断念したと明らかにした。　市は今後、新たなデザインを公募するか、ロゴ自体の作成を取りやめるかを検討する。　灰色の丸と直線で「ＢＩＴＯ」を表現した佐野氏のロゴは、米国人デザイナーの作品との類似性が指摘されていた。清水市長は「似ていない」として問題視しない考えを示していたが、市民から使用に批判的な意見が上がったことを受け、方針を転換。取材に「世界の絵本を集め、子供に夢を与える施設を造るのに、反対意見を押し切ってまで使う必要はない」と述べた。'),(12,'「他人の金で難民しよう」と書かれたイラスト　差別表現だとして「SEALDs」奥田氏が強く批判','soci','　「他人の金で。そうだ難民しよう！」。こんなキャッチフレーズを載せた「難民」のイラストがフェイスブックに投稿され、波紋を広げている。　イラストが載ったのは、30代の女性が描く政治的な漫画を紹介するフェイスブックのコミュニティページだ。■「先に母子家庭を装って難民申請→定住GETし、後からパパを呼び寄せる手筈」　2015年9月10日にアップされ、女性のフェイスブックにも載った。中東とみられる田園と住宅地の写真の上に、上目使いの「女性難民」の漫画が描かれている。　そして、イラストの上に、「安全に暮らしたい清潔な暮らしを送りたい美味しいものが食べたい」「何の苦労もなく生きたいように生きていきたい」などと白字であり、前出のキャッチフレーズが大きな白字で強調されていた。　コミュニティページには、イラストの紹介文が書き込まれており、「シリア難民？ほとんど『移民』だろw」とあった。続いて、その1週間前にトルコの海岸で水死体となって見つかり、大きな話題となったアイラン・クルディちゃんについて、根拠不明の内容がつづられた。　「自称シリア難民のお子さん一家」として、「トルコ政府から無償援助を受け取っていた」「先に母子家庭を装って難民申請→定住GETし、後からパパを呼び寄せる手筈だったのではないか、との疑い」などと書いている。　その後、安保法案への反対運動をした学生団体「SEALDs」代表の奥田愛基さんが、30日になって、ツイッターでこのイラスト画像をアップして取り上げた。　難民の話としてフェイスブックでシェアされていたと紹介し、「あり得ないでしょ」と強く批判した。そして、もしイラストを見つけたら、フェイスブックに通報するよう促している。　奥田さんはメディアで一躍脚光を浴びただけに、このツイートは大きな反響を呼び、2000以上もリツイートされた。　その後、ネットユーザーが、フェイスブック運営側に通報した結果をツイッター上で報告した。ユーザーは、差別発言は削除するとしたコミュニティ規定に抵触すると指摘したが、フェイスブックの運営側からは、規定違反にはならないとの回答が来たとした。　この問題は、ネット署名サイト「change.org」で、イラストはレイシズムでフェイスブックはそれを認めるよう求める署名活動に発展し、10月2日夕現在で4000人ほどの賛同者を集めている。　イラストを投稿した30代女性は、そのフェイスブックなどを見ると、慰安婦問題で韓国を攻撃したり、SEALDsを揶揄したりする書き込みなどをしていた。ほかのイラストも、こうした内容のものが多い。「女性難民」については、ネット上のある写真に酷似していたため、これをトレースして描いたのではないかとの指摘も出ていた。　フェイスブックの日本の広報担当者に、イラストのことを取材したが、2日夕現在でまだ回答が来ていない。　イラストの内容について、ネット上では、様々な意見が出ている。　非難する向きとしては、「シリア難民支援を妨害する卑劣な差別煽動」「弱者を愚弄している様に見える」という声があった。一方で、「便乗して紛れ込んでる奴らも相当いると思うけど」「難民を批判することすら許されないのか」「表現の自由を封殺するな！」と一定の理解を示す意見も多かった。'),(13,'小学教諭を書類送検＝集団強姦事件―大阪府警','soci','　大阪府警の警察官らが集団強姦（ごうかん）したとして逮捕された事件で、府警捜査1課は2日、同府吹田市立小学校の男性教諭（32）を集団強姦と監禁容疑で書類送検した。　容疑を認めているという。　事件では、大阪府警箕面署の元巡査部長（36）＝懲戒免職＝ら4人が逮捕されたが、いずれも処分保留で釈放されている。　送検容疑は元巡査部長らと共謀し、昨年12月、大阪市内のホテルで20代の女性を集団で乱暴するなどした疑い。　梶谷尚義・吹田市教育委員会教育長は「事実関係が明らかになり次第、厳正に対処する」とコメントした。　'),(14,'親のがん、子どもに伝える取り組み　不安和らげ家族一丸','soci','　がんの親をもつ子どもを支える取り組みが、各地の病院に少しずつ広まっている。がんや治療について正しい情報を伝え、子どもの不安を和らげて、家族で治療に向き合えるようにしようという試みだ。【写真】マンモグラフィーで撮影した乳がんの乳房の画像をみる子どもたち＝鹿児島市の相良病院■気づいていた娘「やっと言ってくれた」　娘を思えばこそ、自分ががんだと告げることはできなかった。でも、ごまかしている間はどこか、家族の間に距離があった。「今は課題を共有した同志のような感覚です」。愛媛県の女性（４６）は、中学１年の娘との関係をそう話す。　１０年前、乳がんと告知され、摘出手術を受けた。当時２歳だった娘は小学校にあがるころになって、お風呂で「お母さんの胸、どうしたの」と聞いてきた。「悪いものができたからチョッキンしてもらったんだよ」。がんという言葉は使わなかった。「病名を知ればショックを受ける。伝えない方がいい」と考えたからだった。　その後も通院の理由などを聞かれるたび、「ごまかし、ごまかし、やってきた」。モヤモヤはあったが、どう告げていいのかも分からなかった。　しかし、２年前、通院先の四国がんセンターが開くがん患者の子ども向けセミナーのチラシで、子に事実を告げないことが逆に子を傷つけることもあると知る。臨床心理士の井上実穂さんにすぐ相談し、娘に向き合った。ドキドキして何も言えなくなり、夫が代わりに話してくれた。しかし、娘はすでに母親の病気に気付いていた。「分かってたよ。やっと言ってくれたね」。娘はそれまで、母親が自分を信頼してくれていないのかも、と感じていたという。女性は病気を告げたことで、「家族の中にあった小さな距離や遠慮がなくなった」と話す。　女性は昨年、がんが再び発症したが、娘には何も隠さず、検査結果を医師から聞く時も同席させた。娘は同センターの夏休みのセミナーにも毎年参加している。女性は「正しく知って正しく恐れる。それが一番大事だと思う」と話す。（渡辺純子、山下知子）　　　　　◇■病院、正しい情報を伝えて後押し　「がん細胞はどんどん増えるから、抗がん剤は細胞が増えるのを邪魔します。だから髪とか、細胞が増えている所がダメージを受けやすいんです」。薬剤師が女子中学生６人に語りかけた。松山市の四国がんセンターが８月、親ががんの治療中の中学生向けに開いたセミナー。６人は、がんについて医師らの話を聞き、がん細胞を顕微鏡で見たり、リハビリを体験したりした。母が乳がん治療中の中１女子は「同じ立場の子と話せて心も楽になった」と笑った。'),(15,'＜盲学校弁論大会＞４７歳渡辺健さんが優勝','soci','　第８４回全国盲学校弁論大会全国大会（全国盲学校長会・毎日新聞社点字毎日・毎日新聞社会事業団主催、住友グループ広報委員会・公文教育研究会特別協賛）が２日、浜松市中区のクリエート浜松で開かれた。全国７地区の予選を勝ち抜いた９人が出場し、「光り輝くあの月へ」と題して発表した福島県立盲学校高等部専攻科理療科１年、渡辺健さん（４７）が優勝した。　渡辺さんは９人の中で最年長。小中学校の教員だったが目が見えづらくなり、「いらだちと葛藤の日々」を過ごしていたある日、娘から「目が見えなくてもパパはパパ」と励まされたことをきっかけに、新たな出会いを求めて盲学校に入学。そこでの体験を「暗闇の私をやさしく照らす穏やかな月の光だった」と語り、前向きに生きることの大切さを訴えた。【沢田均】　他の入賞者は次の通り。（敬称略）　＜準優勝＞大阪府立視覚支援学校高等部普通科３年、和唐衿香　＜３位＞筑波大学付属視覚特別支援学校高等部普通科２年、松岡琴乃　＜特別賞＞茨城県立盲学校高等部普通科２年、関達哉　＜優秀賞＞北海道札幌視覚支援学校高等部普通科３年、平川麻衣▽石川県立盲学校高等部普通科３年、東祥平▽静岡県立浜松視覚特別支援学校高等部普通科２年、高松裕太▽愛媛県立松山盲学校中学部２年、三好里奈▽長崎県立盲学校高等部普通科１年、北野魁斗'),(16,'＜監禁傷害容疑＞京大熊野寮を家宅捜索　中核派全学連逮捕で','soci','　中核派の拠点「前進社」（東京都江戸川区）に元活動家の男性を監禁し重傷を負わせたとして、中核派全学連の活動家が逮捕された事件で、警視庁公安部は２日、関係先として京都大学の学生寮「熊野寮」（京都市左京区）を監禁傷害容疑で家宅捜索した。　公安部によると、熊野寮は中核派の活動拠点とされ、逮捕された活動家４人の出入りも確認されているという。４人は５月、２０代の元活動家の男性を前進社内に監禁し、逃げようとした際に屋上から転落し重傷を負わせた監禁傷害容疑で逮捕された。公安部は１日にも東北大と広島大のキャンパス内にある全学連の関係先を家宅捜索している。　一方、中核派と同派全学連は２日、都内で記者会見し、内部情報を漏らしたとして男性を追及していたことは認めたが、監禁については「事実無根で不当逮捕だ」などと話した。【堀智行】'),(17,'【動画解説】ダブル台風発生　来週に列島へ影響か','soci','　ダブル台風、22号と23号が発生しました。来週には日本列島に影響が出るおそれがあり、今後の動きに十分な注意が必要です。　金曜日に二つの台風が発生しました。22号は今後、中国大陸の方へ進む見込みなので日本への影響は無さそうです。ただ、大型の台風23号は日本列島に影響を及ぼすおそれがあります。　台風23号は、先の予報円が大きく、まだ進路が定まっていません。進路を決めるのは、日本の南海上にある高気圧の勢力次第となります。日本の南東海上で高気圧が強まった場合は、台風23号は西寄りのコースをとるでしょう。　一方でその高気圧がそれほど強まらなかった場合には、台風23号は北寄りの進路を取ることになりそうです。　現段階でのコンピューターによる雨と気圧の予想では、台風23号は発達しながら日本列島へ向かい北上するような傾向が見られます。　来週には日本へ何かしらの影響を及ぼしそうなので、台風23号の最新情報を確認するようにして下さい。（気象予報士・國本未華）'),(18,'立ち食いそばファンにとって気になる本、発売','soci','　立ち食いそばファンにとっては、ちょっと気になる本が発売される。学研プラスが10月3日に、「立ち食いそば手帳名店120首都圏編」（学研ムック）を発売するのだ。価格は690円（税別）。【その他の画像】　本ムックでは、「立ち食いそば」の名店を約120軒紹介。160ページのフルカラーで、各店の人気メニューを2つずつ、約240杯をピックアップ。さらに、一軒一軒に対して、めんの種類（冷凍／ゆで／生）やつゆの味わい（甘め／中庸／辛め）、そばの量（少なめ／普通／多め）がひと目でわかるチェックシートも掲載している。「本書を読めば、初めての店でも何を注文すればよいかまるわかり」（学研プラス）だという。　本書を開いて、お気に入りの立ち食いそば店が掲載されているかどうかをチェックしてみるのもいいし、気になる店を発見するのもいいかも。'),(19,'発砲で死亡の中国人、遺族の請求棄却が確定　最高裁','soci','　栃木県西方町（現・栃木市）で平成１８年、職務質問した同県警の警察官に抵抗して拳銃で撃たれ死亡した中国人男性の遺族が県に損害賠償を求めた訴訟で、最高裁第２小法廷（山本庸幸裁判長）は遺族側の上告を退ける決定をした。遺族側敗訴とした東京高裁の差し戻し控訴審判決が確定した。決定は９月３０日付。　「男性が石灯籠を右手で持って殴りかかった」とする警察官証言の信用性が争点。１審宇都宮地裁は信用性を認めて遺族側の請求を棄却したが、２審東京高裁が「石の重さや形状を考えれば片手で持つのは困難」として、威嚇射撃のない発砲を違法と認定。県に約１０００万円の支払いを命じた。　県の上告に最高裁は昨年１月、「警察官の証言は一貫しており矛盾する証拠はない。２審判決は合理性を欠く」として２審判決を破棄し審理を差し戻した。高裁は差し戻し控訴審で遺族側の訴えを棄却した。'),(20,'ＪＲ横須賀線、人身事故で上下線運転見合わせ','soci','　２日午後７時１１分頃、ＪＲ横須賀線の新川崎―横浜駅間で人身事故が発生した。　この影響で、同線は東京―久里浜駅間の上下線で運転を見合わせている。'),(21,'都知事「新国立の轍踏まぬ」…五輪施設チェック','soci','　東京都は２日、都が建設する２０２０年東京五輪・パラリンピックの競技施設について、整備費や設備面の妥当性をチェックする外部の専門家の諮問会議を設置すると正式に発表した。　舛添要一都知事は定例記者会見で、「（計画が白紙撤回された）新国立競技場と同じ轍（てつ）をふまないことが原則。専門家のチェックを受け、みんなが納得できる施設にする」と述べた。　諮問会議は、水泳やバレーボールなど７施設の基本設計、実施設計を点検し、工法や資材価格の適切さなどを確認する。建築など各分野の専門家７人で構成し、スポーツ分野から元マラソン選手の増田明美さんが参加する。　９日に開く初会合では、いずれも整備費が４００億円を超える水泳会場「オリンピックアクアティクスセンター」、バレーボール会場「有明アリーナ」、ボートなどの会場「海の森水上競技場」の３施設について諮問する。'),(22,'捜査で知り得た情報悪用、強盗殺人警官を懲戒免','soci','　埼玉県朝霞市で無職寺尾俊治さん（当時５８歳）が絞殺された事件で、さいたま地検は２日、殺人などの容疑で県警に逮捕された浦和署地域課巡査部長、中野翔太容疑者（３１）を強盗殺人と住居侵入の罪でさいたま地裁に起訴した。　県警は同日、中野容疑者を懲戒免職処分とした。　起訴状では、中野容疑者は９月３日午後２時５分頃、金を盗む目的で朝霞市根岸台の寺尾さん宅１階洋室の掃き出し窓から侵入、寺尾さんが室内にいたため、首をロープのようなもので絞めて窒息死させ、現金約１２１万円と記念硬貨１２３枚（計約６４万円相当）を奪ったとしている。　中野容疑者は朝霞署刑事課に勤務していた昨年１０月、職務で寺尾さん宅を訪問した際、金庫の場所などを確認していた。県警は懲戒免職について、捜査で知り得た情報を悪用した点なども重視したとしている。'),(23,'＜ＪＲ西＞兵庫県内の新駅名「摩耶」「東姫路」に','soci','　ＪＲ西日本は２日、兵庫県内の東海道線・山陽線（神戸線）で建設中の二つの新駅名を発表した。灘−六甲道駅間の新駅は「摩耶（まや）」（神戸市灘区灘南通５）に、姫路−御着（ごちゃく）駅間の新駅は「東姫路」（姫路市市之郷）とした。ともに２０１６年春に開業予定で、両駅とも普通電車が停車する。　摩耶駅は、灘駅の東０.９キロに建設。周辺のマンション建設で人口が増加しており、１日１万６０００人の利用を見込む。橋上駅舎で、ホームは上下線共通の島式１面。電車の減速時に発生する電気を駅舎で利用するため「直流電力変換装置」をＪＲ西で初導入し、屋根には太陽光パネルを設置する。同規模の駅に比べて５０％以上節電できるという。駅名は市内の摩耶山を参考にした。　姫路駅から東１.９キロの東姫路駅の周辺は、再開発で官公庁や商業施設が増えており、１日６０００人の利用を想定する。地平駅舎でホームは対面式の２面。白い膜状の屋根を設け、近くを流れる市川から飛び立つシラサギの姿をイメージした。【久野洋】'),(24,'＜大阪中１遺棄＞平田さん殺害で起訴　大阪地検','soci','　大阪府寝屋川市の中学１年の男女が遺体で見つかった事件で、平田奈津美さん（１３）の死体遺棄と殺人の疑いで逮捕された契約社員の山田浩二容疑者（４５）について、大阪地検は２日、殺人の罪で起訴した。山田被告は黙秘を続けているという。刑事処分を保留している死体遺棄容疑についても一括して起訴することを検討したが、さらに裏付けが必要として捜査を継続する。　起訴状によると、山田被告は事件当日の８月１３日午後７時ごろ〜午後１１時１０分ごろの間、大阪府内か周辺で平田さんを殺害したとしている。'),(25,'菅直人元首相は本当に大丈夫なのか　「太陽光発電の電気は音がいい」の「珍説」披露','soci','　東日本大震災のきっかけに脱原発と再生可能エネルギーへの転換を主張している菅直人元首相が、「独自の戦い」を活発化させている。　安全保障関連法の廃止を目指して野党で統一候補を立てる必要性を強調したと思ったら、太陽光発電で発電した電気は「送電線で送られて来た電気を使うより、音質がいい」らしいという「珍説」を披露も披露。もはや「何でもあり」の様相だ。■首相辞任から4年が経った今でも意気軒昂　首相辞任から4年が経った今でも、菅氏は意気軒昂だ。2015年9月10日に日本外国特派員協会で開いた会見では、自分が首相在任時に原発再稼働の条件を厳しくしたことで　　「そうした再稼働ができなくなる段階から、私に対して電力業界、あるいは経産省から、『総理を菅が続けていると原発が動かない』ということで、政治的にそれを引きずり下ろす動きが激化した」などと「原子力村」への恨み節をぶつけた。次に矛先を向けたのは安倍晋三首相だ。安倍氏は野党時代の11年5月、メールマガジンやウェブサイトで、　　「やっと始まった海水注入を止めたのは、何と菅総理その人だったのです」と、11年3月12日に菅氏が原子炉への海水注入停止を指示したことが「間違った判断」だと非難していた。　菅氏は、この記述が事実無根で名誉棄損にあたるとして13年7月に記事の削除や謝罪を求めて提訴。元首相が現職首相を訴えるという異例の事態に発展していた。　ブログも2日に1回以上のハイペースで更新が続いている。内容は再生可能エネルギーと政局に関するものがほとんどだ。　中には、トンデモ」に近い記述もある。9月27日には、「太陽光から生まれた電気でロックする」という触れ込みのイベント「THESOLARBUDOKAN2015」を訪れた時の様子を書いている。その中で、　　「太陽エネルギーの可能性をアピールする意味の有る企画だ」とイベントの意義を強調した。そして、　　「太陽光発電でその場で発電した電気の方が送電線で送られて来た電気を使うより、音質がいいそうだ。電気も地産地消の方が新鮮ということのようだ」などと、「珍説」も唱えていた。　電気のどこをとらえて、「新鮮」と判断するのか、まったく意味不明発言だ。「音質がいいそうだ」にいたっては何の科学的根拠もなさそうだ。'),(26,'世界最速？２４０キロのバッティングマシン、挑んだ猛者','soci','ズドーン。バットが空を切るたび、捕手代わりのマットが大きな音をたてる。「世界最速」にこだわり続ける三萩野バッティングセンター（北九州市小倉北区三萩野２丁目）のマシンは時速２４０キロの豪速球で約１年間、本塁打を狙う挑戦者を退けてきた。９月の連休中も全国の猛者たちが打席に立った。その対戦の結末は――。昨年８月、センターは２３０キロから最速スピードを１０キロ上げた。２００５年の１６２キロを皮切りに常連客らの求めに応じて店主の末松一英（いちえい）さん（４８）が改良や補強を重ね、球速を上げてきた。２４０キロの豪速球は、球を投げるアームに反発力を伝えて速度を出す４本のバネを４ミリほど厚くして、強度を１・６倍に上げて生み出した。球を打ち返して、約３０メートル先の１８メートルの高さにあるボード（８０センチ角）に当てればホームラン。制球を保つため、球をウレタン製からゴム製に変えて飛びにくくなったこともあり、２４０キロのマシンでは本塁打ゼロが続いた。ホームランボードのかなり下にあるヒットのボードにすら当てたのは３人だけ。これまで２４０キロに挑んだ客は、約２００人になるという。フリーライターで「バッティングセンター研究家」を自任する吉岡雅史さん（５１）＝大阪府＝は、自身が把握している全国１千軒弱のバッティングセンターのうち、９１２軒（２１日現在）を踏破。米国やカナダにも渡ったが、「２４０キロは世界最速で間違いない。その速さは『ナンセンス』ですよ」とマシンへの敬意を込めて語る。'),(27,'S×Lの酒井啓太、恋愛小説のPVが1000で連載打ち切り寸前に','soci','いま、目の前で余裕の笑みを浮かべているのは、人力舎のお笑い芸人・S×Lの酒井啓太。現在、『週刊女性PRIME』で恋愛小説を執筆中の男だ。今回も引き続き、前作（【酒井啓太恋愛小説vol.3】生真面目クンと王様ゲーム）が獲得したPV（ページビュー）数を知らせると……酒井：前回のvol.2は7000PVでしたね。vol.1の3500PVから倍になっているわけですから、今回は14000PVくらいですかね？編集：1000です。ツイッタ―とかの反響もありません。酒井：ん？1000？編集：そう、1000だよ。さすがにこれじゃあ、上司にも報告できないよ（笑い）。酒井：うわ〜、これ、原因は完全にあれっすね。編集：え、原因？酒井：登場人物のモデルになっている人の話なんですけど、１話のヨウイチ（『巨匠』の岡野陽一がモデル）はキングオブコント決勝いっていますし、２話のタカヒロ（『ドリーマーズ』の坂本崇裕）はめちゃくちゃ人気があるんですよ。今回の３話に出てきたショウヘイは僕の相方がモデルなんすけど、ガチで人気ないんですよね。。いや〜すみません。相方のせいで本当に。俺からもすみません。編集：う〜ん、内容じゃないかな？酒井：そういえば、福山さん結婚されたじゃないですか。もしかしたら、半分もってかれたところもあるんじゃないかな。編集：内容だよ。福山さんの記事が1000PVなわけないでしょ。酒井：安保法案、くそ〜。アレも話題性ありましたからね!!編集：だから内容だって。こちらも編集部の視線が厳しくなっているから、なんとかこの状況を打開したいと思っています。酒井：まぁ編集さん、落ち着いて。この1000PVが、眠れる獅子をついに起こしてしまったんですよ。正直、前にも言っていたようにスランプに陥っていました。いわゆる、生みの苦しみと戦っていたんです。でも、あの苦しい時間があったからこそ、「作家」として成長できた部分があると思っています。ちょっと次回作は、いままでの酒井啓太を壊していくものになると思いますよ。編集：PV1000だぞ。いっちょまえに語るなよ笑'),(28,'NHKの受信料制度は民法違反である --- 池田 信夫','soci','毎日新聞（http://mainichi.jp/select/news/20150924k0000e010241000c.html）がまた誤報をしている。この記事は「自民党情報通信戦略調査会放送法の改正に関する小委員会は24日、NHKや総務省に対し、NHKの受信契約の有無に関わらず受信料を徴収する『支払い義務化』を求める提言をまとめた」と書いているが、この提言（http://jimin.ncss.nifty.com/pdf/news/policy/130594_01.pdf）にはこう書かれている。“NHKの受信料支払い義務化については、総務省として具体的な制度設計を行なうとともに、強制徴収や罰則、マイナンバーの活用など、支払い率の向上に資する制度・仕組みについても併せて検討すること。”これが全文である。どこにも「受信契約の有無に関わらず」などとは書いてない。これは前に私がブログ（http://ikedanobuo.livedoor.biz/archives/51880308.html）で指摘して、誤報サイト（http://archive.gohoo.org/alerts/131208/）に＜注意報＞を出されたのに、また同じ間違いをくり返している。この支払い義務化は、これまで10回ぐらい出ては消えた。それはヤブヘビになるからだ。罰則を課すことになると、「私はNHKを見ていないのに罰則とは何だ」という反発が出てくる。そもそも松戸簡裁（http://jbpress.ismedia.jp/articles/-/43706）が判決を出したように、視聴者が同意していなくても受信契約を義務づける受信料制度は、契約自由の原則という民法の大原則に違反しているのだ。しかも罰則なんか必要ない。スカパーと同じような有料放送にして、視聴料を払っていないテレビには、B-CASでスクランブルをかければいいのだ。しかしそうすると「公共放送」でやる意味がなくなり、民営化しろという声が出てくるから、今回も――いつもと同じように――NHKは逃げるだろう。'),(29,'企業はマイナンバー時代の副業ルールを見直すべき --- 川嶋 英明','soci','ついに(社労士にとって)運命の10月が来ましたが、マイナンバー届いた人、いますかね？　あっ、でも、確か、マイナンバーの通知カードは「10月より交付」のはずだから、最速でも今日発送なのかもしれませんね。さて、そのマイナンバーですが、よくマイナンバーにより社員の副業がバレるという話がスポーツ新聞や週刊誌に載っていますね。アゴラでも社会問題化するのでは（http://agora-web.jp/archives/1656101.html）という趣旨の記事が上がっていますが、どういう経路でバレるかまできちんとわかっている人は多くないと思うので少し説明しておくと、まず代表的なのが住民税の支払い方が会社天引きの特別徴収だと、税額が給与に比べて不自然に増えるので会社に気づかれます。(なので、普通徴収だと会社はわからない)。また、社会保険料の場合、2つ以上の会社で社会保険に入ると、それぞれの会社の給与を合算し、額に応じて社会保険料を按分する必要があるので、副業先で社会保険に入るとこれまた会社にバレます。他にもバレる経路はありますがこれぐらいにしておいて、当然、このような取り扱いはマイナンバー前からずっとそうであり、上記のような経路でバレる可能性はあったのですが、人手や手間やコストがかかりすぎるなどの事情もあり手が回ってなかっただけ。よって、「マイナンバーによって副業がバレる」というのは厳密には正しくなく、マイナンバーによって手続が簡略化されると様々な法違反をしにくくなるので、結果として副業がバレるだけで、言うなれば本来のあるべき姿になるだけなのです。そもそも夜の街から人がいなくなるって言っている人たちは、夜の街の人達が払うべき税金や社会保険料を支払ってないことについてはそれを良しとしているのでしょうか？　わたしに言わせれば、今までがおかしかっただけで、何でもかんでもマイナンバーのせいにするんじゃない、という話です。'),(30,'日本が原子炉を建設するトルコに核兵器開発疑惑が浮上。米外交専門誌が報じる','soci','　7月にイランと欧米6か国による核協議が合意されたことを受けて、トルコが秘密裏に核兵器の開発に動いているのではないかという懸念が再燃している。米国の外交専門誌『TheNationalInterest』が9月22日付でそれを取り上げたのだ。　トルコでは、最近の経済成長から電力消費が伸びており、更なる電力の需要に応える為に、原子力発電所を増やすことを計画している。まず、トルコは2011年にロシアの国営原子力企業ロスアトムと契約を交した。2016年からアッユク地区で原子炉が建設され、2020年から嫁働することになっている。その次に契約したのが、2013年に三菱重工、伊藤忠、フランスのGDFスエズとでシノプ地区に2023年の稼働を目指しす原子炉の建設である。更に2014年にはウエスティングハウスと中国テクノロジーコーポレーション（SNPTC）が3番目の原子炉を建設することに決まった。因みに、ウエステイングハウスの親会社は東芝である。◆エルドアン大統領がウラン濃縮設備建設を指示!?　問題視されているのは、日本とトルコの間の原子力協定で、トルコ国内でウランの濃縮と再処理が可能という条文が入っていることなのである。もちろん、条文では日本が了承しなければトルコが濃縮や再処理をすることは出来ないとされているし、トルコでウラン濃縮や再処理が出来る設備は今の処存在しない。即ち、核兵器の生産に繋がる可能性はないと判断できる。　しかし、『TheNationalInterest』とは対極の存在とも言えるロシア紙『R.T.』が報じた情報は決して安心できないことを表している。同紙によれば、〈昨年9月にドイツの諜報機関（BND）がドイツ国内で知らせるべき人物を制限して伝えた情報〉によれば、〈エルドアン大統領（当時首相）が2010年にウラン濃縮の為の設備の建設を指示した〉ということだ。それに関連したデーターから、〈トルコはパキスタンから入手したと思われる遠心分離機を相当数保有している〉というのだ。　そして、トルコが核兵器開発を視野に入れていると懸念される要素のもう一つに、トルコがミサイルを開発していることが挙げられる。前出の『TheNationalInterest』にて言及されているように、〈トルコは150kmの有効射程距離のミサイルを当初保有していた〉が、エルドアン大統領の開発要望をもとに、〈2012年には射程距離1500kmのミサイルの開発に成功している。そして今年中に射程距離2500kmのミサイルの開発をする予定になっている〉というのだ。　こうした「限りなくグレー」な事実の上に、使用済みの核燃料棒や燃料を供給国に返還せずに、自国で再処理しようという動きがあることが不審を抱かせる原因になっているのだ。それは言うまでもなく、再処理の過程で将来的にはプルトニウム爆弾をトルコ国内で生産出来る可能性があるということに他ならない。◆パキスタンの「核兵器の父」とされる密売人の「第四の顧客」　『TheNationalInterest』誌は〈トルコはマフィアの介入でコソボ、ボスニア、ヘルツェゴビナの密売ルートから旧ソ連の濃縮ウランを保有している〉と言及している。しかも〈トルコはパキスタンの核密売業者アブドゥル・カディール・カーンの活動にこれまで関与して来た〉と指摘している。〈1987-2002年の間にイラン、北朝鮮、リビアに数千台の遠心分離機を売り〉その為の〈電子部品などはトルコ経由で運ばれた〉という。そして、当初パキスタンが公式には手に入れることの出来ない部品をトルコ経由で手に入れていたのだ。　このような背景をもっているトルコであるが故に「ウラン濃縮に必要な遠心分離機を現在所有しているのか？」という質問については、これまでの諜報機関の公開した情報によってその回答は既にされているように思える。　同誌によれば、〈2003年にリビア向けにマレーシアからドバイ経由でトリポリに送った10,000台の遠心分離機とその関連部品の多くが途中で紛失した事件があった〉ことに触れ、〈多くの専門家はこれをミステリーな「第4の顧客」〉と呼んでいる〉と報じている。「第4の顧客」、それは、アブドゥル・カデイール・カーンが販売したイラン、北朝鮮そしてリビアの次の存在に紛失されたとされる物資が渡っているという意味だ。しかもこの「第4の顧客」はアブドゥル・カデイール・カーンから〈紛失されたとする物資よりも更に多くの物資を手に入れている〉という。そして結論として〈トルコがその「第4の顧客」だ〉と同誌は指摘しているのだ。　アブドゥル・カデイール・カーンは〈「第4の顧客」に核兵器をデザインするブループリントも提供している〉という。しかも、〈現在もトルコはパキスタンとは核開発におけるパートナーシップの関係を維持している〉という。イスラエルのネタニャフ首相はトルコのこの動きを素早く掴んでいたようで、〈2010年3月15日にギリシアの当時のパパンドレウ首相に「トルコがいずれ核兵器を所有するようになる」〉と伝えたとこともなども同誌は言及している。　もちろん、米国の国益を論じる『TheNationalInterest』は、この推測記事にも何らかの思惑があるだろうし確定した事実ではない。ただ、中東におけるトルコはイランと同様に長い歴史文化をもっている国で、しかもオスマントルコは中東を支配した歴史もある。その意味ではイランと同様に発展出来るノウハウを培った組織構造を社会的に備えている国だ。米誌の懸念もあながち荒唐無稽な話ではないのかもしれない。＜文／白石和幸＞しらいしかずゆき●スペイン在住の貿易コンサルタント。1973年にスペイン・バレンシアに留学以来、長くスペインで会社経営する生活。バレンシアには領事館がないため、緊急時などはバルセロナの日本総領事館の代理業務もこなす。'),(31,'「日本はシリア難民を年間1000人受け入れることができる」難民問題の専門家が会見','soci','中東・シリアの難民が国際的に大きな問題となっていることを受け、難民を支援しているNPOと弁護士が10月2日、東京・有楽町の外国特派員協会で会見し、海外メディアの記者たちに日本の難民受け入れの現状と、日本が果たすべき役割を説明した。会見を開いたのは、NPO法人「難民を助ける会」の長有紀枝理事長と全国難民弁護団連絡会議代表の渡邉彰悟弁護士。渡邉弁護士は、シリア難民について、日本が1000人単位で受け入れることも可能だという見解を示した。一方、長氏は「日本には、ヨーロッパの諸国とは違う、重要な役割が求められている」と指摘。資金援助のほか、高度な医療ケアやリハビリなどが必要な障害者、けが人などを国内に受け入れることで、大きな貢献ができると主張した。●昨年の日本政府の難民認定は「11人」日本では昨年、難民申請が5000人あったが、政府に難民と認定されたのは、わずか11人だった。この点について、渡邉弁護士は「日本政府の難民認定のハードルはあらゆる面で高すぎる」と指摘した。「日本の認定基準は、UNHCR（国連難民高等弁務官事務所）のガイドラインからもかけ離れている。日本は、人権・人道問題に正面から向き合い、積極的に難民を受け入れるべきだ。シリア難民を受け入れることは、日本の安全保障にとっても重要な意味がある」と述べた。昨年の難民認定率は0.2％だが、渡邉弁護士は「国際的な基準で判断すれば、毎年10％以上が認定されてもおかしくない」という。●過去には「インドシナ難民」を1万人受け入れた実績ありそれでは、「シリア難民」について、日本は年間どれぐらいの人数を受け入れるべきなのだろうか——。弁護士ドットコムニュースの記者がそう質問すると、長氏は次のように答えた。「人道的に、特別な配慮が必要なけが人や病人の受け入れは、たとえば数十人でも大きなことだと思います。100人程度の目標を設定することがいいのではないか。一つの病院に集中させるのではなく、日本全国の病院に少しずつ散らばるような形での受け入れは、可能性があるのではないか」一方、渡邉弁護士は、1970年代以降、ベトナム・ラオス・カンボジアなどで発生したインドシナ難民を、日本が累計で1万人受け入れた実績を強調。「日本は1981年の1年間で1200人のインドシナ難民を受け入れている。日本がシリア難民を年間1000人単位で受け入れても、全く不思議ではない。政治家がそう決意して、市民社会に訴えれば、受け入れは可能だ」と話した。なお、ニュージーランド政府は年間850人のシリア難民受け入れを表明しているという。●「シリア難民を受け入れれば、中東の状況を知ることができる」もし1000人単位のシリア難民を受け入れた場合、日本社会にはどんな影響があるだろうか。受け入れる体制は整っているのだろうか。渡邉弁護士は「シリア難民を受け入れれば、シリア・中東の状況をより詳しく知ることができるうえ、難民を支援する日本の姿勢を世界に発信できる。日本の労働市場で、難民が日本人と大きく競合することはない。むしろ、難民が働ける環境をどうつくるか考えることのほうが必要だろう」と話した。長氏も「日本に来た難民が直面する課題は、世代によっても変わる。私たち『難民を助ける会』は、学生世代の若い難民については、受験勉強を手伝ったりもする。インドシナ難民を1万人受け入れた実績があるので、1000人単位の受け入れは、それほど非現実的な数字ではない」と話していた。'),(32,'統括調査官を減給処分＝虚偽報告書の作成指示―大阪国税局','soci','　税務調査で担当調査官にうその報告書を作成させたとして、大阪国税局は2日、大阪府内にある税務署の統括国税調査官だった男性職員（54）を減給1カ月の懲戒処分にしたと発表した。　国税庁監察官は、虚偽有印公文書作成・同行使の疑いで男性職員と担当調査官の2人を大阪地検に書類送検した。　同国税局によると、男性職員は2011年、税務調査の際、対象法人の顧問を務める国税OBの税理士の求めで担当調査官に指示し、虚偽の報告書などを作成させた疑いが持たれている。OB税理士と男性職員は面識があったという。　大阪国税局の馬場則行広報広聴室長は「国民の信頼を著しく損ない、深くおわびする。職員の綱紀の厳正な保持に一層の徹底を図りたい」とコメントした。　'),(33,'＜全日空＞エンジントラブルで離陸取りやめ　大阪空港','soci','　２日午前１１時４０分ごろ、大阪（伊丹）空港のＢ滑走路で、新千歳行き全日空７７３便（エアバスＡ３２０−２００型、乗客乗員１５５人）が離陸滑走中、エンジンで異音がしたため離陸を取りやめた。けが人はなかった。２本ある滑走路のうち１本を約２時間半閉鎖した。滑走路に金属片が散乱したため、全日空が機体を調べると、エンジン２基のうち右側エンジンのタービンブレードが破損していた。同社が原因を調べている。【内橋寿明】'),(34,'ＪＲ中央線、東京―高尾で一時運転見合わせ','soci','　【ＪＲ東日本発表】２日午後６時４５分ごろから、中央線の東京―高尾間の上下線で運転を見合わせた。武蔵小金井駅であった人身事故の影響。午後７時５４分ごろ再開した。'),(35,'＜書の甲子園＞審査会始まる　国内外から１万６８００点','soci','　「書の甲子園」として知られ、国内外の高校生らが腕前を競う「第２４回国際高校生選抜書展」（毎日新聞社、毎日書道会主催）の審査会が２日、大阪市北区の毎日新聞大阪本社で始まった。４日まで。　今回は国内外で計１９の国・地域から１万６８００点の応募があった。審査員２２人が、筆遣いや全体のバランスなどをチェック。「ひたむきに書に向き合った作品が多い。書は線が命。書いている姿や思いが伝わる作品がいい」などと評価する声が上がっていた。　結果は１１月下旬、毎日新聞紙上で発表する予定。入賞・入選作計約２０００点は来年２月２〜７日、大阪市天王寺区の市立美術館で展示される。【大沢瑞季】'),(36,'【動画】北日本　低気圧で大荒れ続く（2日19時更新）','soci','　急速に発達した低気圧は北海道の北で動きが遅くなる見込みです。北日本では引き続き、暴風や高波に厳重な警戒が必要です。　発達した低気圧の影響で金曜日は広い範囲で荒れた天気となりましたが、低気圧の雲の渦はまだ北海道付近に見られます。発達した低気圧は土曜日にかけても北海道の北に停滞するため、北日本では大荒れの天気が続きそうです。予想される最大瞬間風速は北海道で40メートルとなっています。北日本は引き続き暴風や高波に厳重な警戒をして下さい。　一方、上空には寒気が流れ込むため、北日本は大気の状態が不安定で雨の降る所があるでしょう。北海道は午前中、東北は日中にかけてにわか雨や雷雨がありそうです。新潟も午後はにわか雨があるかもしれません。　関東から西の地域は晴れて、気温はこの時期にしては高くなり汗ばむ陽気となりそうです。（気象予報士・國本未華）'),(37,'川内原発２号機、再稼働は１５日に　２基目、１１月中旬に営業運転へ','soci','　九州電力は２日、川内（せんだい）原発２号機（鹿児島県薩摩川内市）について、１５日に原子炉を起動し、再稼働する方針を固めた。新規制基準に基づく原発の再稼働は、川内１号機に続き２基目で、営業運転への移行は１１月中旬の見通し。　九電によると、１４日に核分裂を抑える制御棒を動かす装置が正常に作動するかの検査を行う。検査は再稼働前の最後の工程で、問題なければ翌日にも制御棒を引き抜き、原子炉を起動する。　ただ、検査の進捗（しんちょく）次第で日程がずれこむ可能性もある。川内１号機では、８月１１日に再稼働し、９月１０日に営業運転に移行した。　川内２号機は、炉内に燃料を挿入する装荷作業を９月１３日に完了。規制委による再稼働前の検査を経て、今月１日から４日間の日程で重大事故を想定した訓練を実施している。'),(38,'横須賀線 新川崎〜横浜駅間で人身事故 運転見合わせ','soci','19:11頃、新川崎〜横浜駅間で発生した人身事故の影響で、横須賀線と湘南新宿ラインは運転を見合わせています。なお、振替輸送を行っています。■運転見合わせ・横須賀線、湘南新宿ライン■直通運転中止・横須賀線←→総武線(快速)'),(39,'＜だまされませんべい＞袋にシール　詐欺注意促す　青森','soci','　詐欺にだまされませんべい−−。青森県警三戸署が今月から、管内の煎餅店１４店と協力し、名産の「南部煎餅」の袋に詐欺への注意を促すシールを張った「だまされませんべい作戦」を展開している。　管内では昨年、計約２５００万円の特殊詐欺被害が発生した。今年は現段階で被害はなく、この作戦でさらに住民らの意識を高めることで「被害ゼロの地域にしたい」と小島憲夫署長は意気込む。　煎餅のお供といえばお茶。購入者には煎茶「だまされませーん茶」をおまけに付ける。不審な電話があっても「まずは煎餅食べて、煎茶を飲んで、落ち着いて対処して」。【佐藤裕太】'),(40,'登記官を懲戒免職＝神戸地方法務局','soci','　神戸地方法務局は2日、知人宅に侵入しキャッシュカードなどを盗んだとして逮捕、起訴された同局西宮支局登記官の奥野剛被告（47）を同日付で国家公務員法による懲戒免職処分にした。　　同被告は2013年12月、神戸市灘区の同市職員（45）宅に侵入し、現金15万円とキャッシュカードなどを盗み、計300万円を引き出したなどとして、住居侵入や窃盗などの罪で起訴され公判中。　神戸地方法務局は「決して許されることではなく誠に遺憾。綱紀の粛正についてさらなる徹底を図る」とのコメントを出した。　'),(41,'エボラなど1類感染症死者、どう火葬する？−厚労省がガイドライン作成','soci','　エボラ出血熱など1類感染症で死亡した患者の遺体について、厚生労働省は火葬の取り扱いをまとめたガイドラインを作成し、都道府県に通知した。搬送や火葬をする際には遺体を密封し、「患者に対応してきた保健所の職員が立ち会うことが望ましい」としている。【新井哉】　エボラ出血熱をめぐっては、死亡した患者の遺体に触れ、二次感染したとみられるケースが多数報告された。日本国内でも昨年12月、西アフリカ滞在歴があり、帰国後に発熱の症状が出て感染が疑われた男性のケースでも、「埋葬に立ち会い、遺体が入った袋に触れた」と厚労省が指摘していた。　ガイドラインでは、遺体を24時間以内に火葬にすることや、都道府県が搬送事業者や火葬場を市町村と連携してあらかじめ決めておくことを要望。また、感染症指定医療機関の医療関係者に対しては、遺体を密封し、「遺体から出た体液を一定の時間、内部に留めることができる非透過性納体袋に収容し、袋の外側を消毒した上で、棺に納める」としている。　遺体の血液や分泌物、排泄物などが火葬作業に従事する人の身体に飛散する可能性がある場合についても、手袋や不織布製マスク、フェイスシールド、エプロンなどを使用することも求めている。'),(42,'風を感じて京都観光を　屋根なし観光バスが運行開始','soci','　京都市内で、２階建ての屋根なし定期観光バス「スカイバス京都」が運行を始めた。風に当たりながら、いつもより高い場所から京都の街を見て楽しめる。代表的な観光名所を車窓から眺められる約１時間のコースと、金閣寺と清水寺で下車する約３時間半のコースがある。定員は４６人。乗車には予約が必要だが、空席があれば乗ることもできる。来年３月１８日まで。問い合わせは京都定期観光バス予約センター（０７５・６７２・２１００）へ。（戸村登）【写真】寺院から伸びる木々の枝をくぐり抜ける「スカイバス京都」＝１日、京都市東山区、戸村登撮影'),(43,'自民党府連が知事候補に栗原府議','soci','　１１月に行われる大阪府知事、市長のダブル選挙、これまで決まっていなかった自民党側の知事候補が絞り込まれました。　自民党府議団の栗原貴子政調会長です。　「大阪の成長に必要ですよね？」(松井一郎大阪府知事)　「大阪の成長のために、一番何が必要なのかということをまず話し合おうと」(栗原貴子政調会長)　激しく松井知事に迫る女性府議。　自民党府議団の栗原貴子政調会長です。　自民党大阪府連幹部によりますと２日までに栗原府議が知事候補に絞り込まれたということです。　これまで自民党は俳優の辰巳琢郎さんら著名人に打診するも断られ女性か府議会議員を軸に候補の選定を進めていました。　そしてそのどちらにも当てはまる栗原府議に白羽の矢が立ちました。　既に自民党本部にも報告しているということです。　ただ栗原府議はＭＢＳの取材に対し「女性や府議会議員が候補に上がっていることは知っているが自分は何も聞いていない」と出馬を否定しています。　自民党府連は栗原府議を軸に今月１２日の府連大会までに候補を決定する方針です。'),(44,'伊丹空港で部品脱落か　滑走路一時閉鎖','soci','伊丹空港で、離陸滑走中の全日空機から煙と火花と共にエンジンの部品が飛び散り、滑走路が一時閉鎖されました。　離陸に向けて時速約１３０キロで滑走する飛行機。　ところが突如、後部から煙と火花が噴き出します。２日午前１１時半すぎ、大阪発新千歳行きの全日空７７３便エアバスＡ３２０型機が離陸に向けて滑走中、異常な音を確認し飛行を取りやめました。　乗客乗員１５５人にはケガはありませんでした。　国土交通省などによりますと、異常な音とともに右エンジンのトラブルを示す表示がでたということで、その後滑走路にはエンジンの部品が複数落ちているのがみつかりました。　この事故により滑走路は一時閉鎖されましたが約２時間後に再開されています。'),(45,'療養病床の在り方、「少し長い目で検討を」−厚労省・神田医政局長','soci','　厚生労働省医政局の神田裕二局長は2日、東京都内で講演し、今後の療養病床の在り方について「2025年を見通して、(慢性期の入院受療率の)地域差を解消していく中で、新しい医療介護サービスの提供の在り方としてどういうものがあるのか、少し長い目で見た提供の在り方を検討していけたらと思っている」と述べた。【敦賀陽平】　療養病床をめぐっては、17年度末に介護療養病床の廃止期限が迫っており、厚労省は今年7月に検討会を設置。年内にも報告書をまとめることになっている。介護保険制度の立ち上げに携わった神田局長は、「介護保険の施行の時から一貫して見ると、その時々で新しい類型をつくって、行ったり来たりがあったというのが正直な実感だ」とも語った。■ビジョン、「次期改定時に半分もできていない」　この日はまた、厚労省保険局の宮嵜雅則・医療課長も講演した。この中で宮嵜課長は、今年4月に都道府県が策定作業に着手した地域医療構想(ビジョン)について、「16年4月改定の時には、全国で半分も地域医療構想はできていないのではないかと思っている」との私見を述べた。　その上で、診療報酬改定とビジョンとの関係については、「報酬が見えないと話が進まないというご指摘をする人もいるが、あくまで構想(ビジョン)を見て、自主的に協議して進める。報酬を見て進めるわけではないので、16年4月の段階でどうするかというのは、あまりにも時期尚早の話ではないか」と語った。'),(46,'台風並み暴風で被害相次ぐ＝屋根から転落の1人死亡―北海道','soci','　台風並みに発達した低気圧の影響で暴風に見舞われた北海道では2日、屋根から転落した男性が死亡するなど、被害が相次いだ。　　道警によると、清水町清水の牧場で午後2時35分ごろ、搾乳する施設の屋根を補修していた男性4人が、約10メートル下の地面に転落。病院に搬送されたが、帯広市の男性（60）が死亡した。道警新得署は、4人が風にあおられたとみて詳しく調べている。　北見市高栄西町では午前11時10分ごろ、50代の郵便局員の男性が配達中、飛んできたトタン屋根の下敷きとなり、重傷を負った。　'),(47,'中央線(快速) 武蔵小金井駅で本日2度目の人身事故 運転見合わせ(2日19時45分現在)','soci','18:45頃、武蔵小金井駅で発生した人身事故の影響で、中央線(快速)および中央本線・高尾〜甲府駅間は運転を見合わせています。なお、武蔵小金井駅では、本日11:20頃にも人身事故が発生しており、中央線(快速)は12:15頃まで運転を見合わせました。■運転見合わせ・中央線(快速)、中央本線(高尾〜甲府)■ダイヤ乱れ・特急スーパーあずさ号、あずさ号、かいじ号■直通運転中止・中央線(快速)←→青梅線'),(48,'＜亀有香取神社＞「キャプテン翼」の絵馬　キャラ３種類登場','soci','　「足腰健康の神様」や「勝負・開運厄除の神様」として知られる葛飾区亀有３の亀有香取神社に、人気サッカー漫画「キャプテン翼」の登場人物が描かれた絵馬が登場した。　作者の高橋陽一さんが後援会長を務める同区のサッカーチーム「南葛ＳＣ」をＰＲしようと、同神社と地元のプロモーション会社などで作る制作委員会が考案した。絵馬は、主人公の大空翼が描かれた丸形、五角形の２種類と、ライバルの日向小次郎が描かれた丸形の計３種類。それぞれ「蹴勝」、「健脚」と書かれている。　南葛ＳＣの選手らが今年１月に同神社を参拝したところ、９月２７日までに９連勝を挙げて所属する社会人３部リーグで優勝し、２部リーグへの昇格を果たした。絵馬制作委員会の担当者は「縁起のいい香取神社と併せて、地元のサッカーチームを多くの人に知ってもらいたい」と話している。【川畑さおり】'),(49,'自宅から刃物持ち出し、未明に夫婦宅へ…孫供述','soci','　山梨県富士河口湖町で８０歳代の夫婦が自宅で殺害された事件で、県警が殺人容疑で逮捕した孫で高校３年の少年（１８）が調べに対し、２本の刃物を自分の家から持ち出し、９月２７日未明に夫婦宅に向かったと供述していることがわかった。　県警は就寝中の夫婦を狙ったとみている。　夫婦は２７日午前１０時１０分頃、刺殺体で見つかった。捜査関係者によると、２７日未明には、少年とみられる人物が夫婦宅に自転車で向かっている姿が、道路沿いの防犯カメラにも映っていた。　少年は夫婦を刺したと供述しており、県警は持参した２本の刃物で殺害したとみて、少年の自宅から押収した刃物の鑑定を進めている。押収した刃物の中には、付着した血痕を消そうとした痕跡のあるものもあった。'),(50,'品川駅線路にアルミのテーブル　10万人に影響','soci','　２日午前８時７分ごろ、ＪＲ東海道線の品川−川崎駅間の下り線路上にアルミ製のテーブルが落ちていたため、同線などが一時運転を停止した。【写真】Ｆカップ亜里沙が一日署長で制服に大喜び　電車は２４分後の８時３１分に全線で運転を再開したが、ＪＲ東日本東京支社広報課によると、乗客約９万９０００人に影響が出たという。　遅延などの影響が出たのはＪＲ東海道線、同京浜東北線、同山手線で、テーブルを発見した同東海道線上り車両の車掌による緊急停止無線によって一時停車していた。　同社広報課によると、テーブルは折り畳み式のアルミ製で、９０センチ四方の天板に足が立った状態で横向きに倒れて線路内に落ちていたという。　現場は東京都品川区北品川の御殿山道路橋の北側付近で、ＪＲ東海やＪＲ東日本の線路計１０本が通っている地点。テーブルはちょうど真ん中付近にあたるＪＲ東海道線下り線路上にあった。橋からは１０〜２０メートルほど離れた場所に落ちており、橋のフェンスは約２メートルほどあった。　１日夜から２日にかけては急速に発達した低気圧の影響で都内では強風も吹いていた。テーブルは片手で持ち上げられるほどの重さだといい、同課は「何者かが線路内に置いたのか、風で飛ばされてきたものかはわからない」としている。周辺に防犯カメラはなく、目撃情報もないという。　同課によると、２日は強風の影響で始発から上野東京ラインで直通運転を中止するなど、ダイヤに乱れが生じていた。その中で今回の事案が発生し、都内の各ターミナル駅の混雑具合がさらに悪化したとしている。　先月３０日にもＪＲ横浜線内で架線にひっかかっているアルミ製の風船が発見されており、同線では運転を見合わせるなどしていた。今回の件との関連について同課は「偶然だと考えている」とした。'),(51,'＜１８歳選挙権＞都立高校で模擬選挙　生徒「投票行きたい」','soci','　選挙権年齢が１８歳以上に引き下げられるのを受け、東京都立小石川中等教育学校（文京区）で２日、模擬選挙の授業「小石川区長を決めよう！」が行われた。３年生１５９人を対象に、区選挙管理委員会や若者の投票率向上に取り組む「学生団体ｉｖｏｔｅ」などが実施した。　まずｉｖｏｔｅの大学生メンバー３人が区長候補にふんし、立会演説会。「大規模マンションを建て、子育て世代を呼び込む」と政策を訴える候補に対し、次の候補は「ショッピングモールを造り、住民の利便性を向上させる」と主張。３人目は「憩いの場として公園を設け、防災にも活用を」と呼びかけた。誰に投票するか、生徒たちはメモを取りながら熱心に聞いていた。　区選管に実際の選挙と同じ投票箱と記載台を借りて、一人ひとり投票。違反のない選挙を目指す区明るい選挙推進協議会のボランティアが投票立会人を務めた。その後、集計までの開票作業を体験。投票用紙を数える計数機の速さに驚きの声が上がった。開票の結果は、ショッピングモール建設の候補が過半数を獲得し、勝利した。　生徒たちからは「実際の選挙ではどういう疑問票が出るのか」「白票は多いのか」など、区選管職員への質問が相次いだ。想像より簡単だったという女子生徒（１５）は「投票に行って自分の意見を反映したい。演説を聞くと候補者の人柄が分かると思ったので、実際の選挙も直接話を聞いて決めたい」と話していた。【五十嵐英美】'),(52,'「濃い牛乳を出し続けるんだよ」　女子高生を胸が大きい「乳牛」に見立てたAGFのCM動画に賛否','soci','　AGF（味の素ゼネラルフーズ）が主力ブランド「ブレンディ」の商品プロモーションとして公開していたウェブ限定ムービーが、インターネット上で賛否を巻き起こしている。ブレンディWEB限定ムービーの他の場面画像はこちら　動画は、特濃牛乳を100％使用したカフェオレの魅力を「擬人化した牛たちの進路発表会」というユニークな設定で表現したもの。公開は1年ほど前だったが、2015年10月に入ってから注目を集め、波紋を広げた。突然の騒動に、同社は戸惑っているようだ。■外国人ライター「日本で気味の悪いCMが作られている」　動画の舞台は、牛の学園の「卒牛式」。鼻輪を付けた制服姿の生徒たちは、自分の番号が呼ばれると立ち上がり、校長からそれぞれの進路が書かれた「卒牛証書」を受け取る。行き先は動物園、闘牛場などさまざまだが、皆が望み通りの道に進めるとは限らず、食肉になることが決定して泣き崩れる生徒もいた。　そうした中、主人公「ウシ子」の進路発表の瞬間がやってきた。ウシ子はこれまで「特別な存在」となるために、たゆまぬ努力を重ねてきたのだった。校長から告げられた行き先は「ブレンディ」。その瞬間、会場からは大きな拍手が沸き起こった。　　「濃い牛乳を出し続けるんだよ」という校長の言葉を受け、ウシ子は感極まりながらお辞儀する。そんなラストシーンとともに「ブレンディミルク広がる挽きたてカフェオレ　特濃牛乳を100％使用しています」との商品PRのナレーションが流れ、2分半の作品は終了する。　動画が公開されたのは2014年11月と、1年ほど前のことなのだが、9月に開催された広告祭「スパイクスアジア2015」でブロンズ賞を受賞したことで、再び日の目をみることとなった。すると9月下旬には、ある人物によって英語字幕付きの同動画がYouTubeに投稿された。　これを日本在住の外国人ライターが発見し、10月1日、ツイッターで「日本で気味の悪いCMが作られている。意味が分からない...」と批判的なコメントを添えて紹介した。このツイートなどがきっかけとなり、動画は大きな注目を集めることとなった。'),(53,'母親自殺の巻き添えか？８歳の男児重傷　本人は重体','soci','　親の自殺に子供が巻き添えになったのか−。　２日午前４時半ごろ、東京都日野市新町の住宅２階寝室で、小学２年の男児（８）が腹や胸など数十カ所を刺されて倒れているのを、父親（５３）が見つけた。男児は重傷。　そばで男児の母親（４６）も腹を負傷して倒れており、意識不明の重体。警視庁日野署は、母親が男児を刺して自殺を図ったとみて調べている。　近隣住民によると、この一家は１０年ほど前に現住所に引っ越してきたという。夫婦は１人息子をかわいがっていたが、母親はものすごい勢いで男児を怒鳴りつけることがあったという。６３歳主婦は「１〜２カ月に１回ぐらいは、すごい怒り方をしているのを聞いた。小学校からの下校時には迎えに行って、周りの子供と遊ばせないとか、神経質な人だった」と振り返った。　母親は周辺の雑音に敏感で、テレビや風呂場の音、飼い犬の鳴き声がうるさいと、その度に苦情を訴える手紙を近所の郵便受けに入れていたという。父親は穏やかな性格で、男児と一緒に車を掃除したり、プールに泳ぎに行ったりしていたという。　近隣に住む６２歳主婦は「昨日（１日）の夜、娘が仕事からの帰宅途中、子供が『やだ！　やだ！』と大声でわめくのが聞こえたと言っていた。もしかしたら事件の前兆だったのかもしれない」と話した。'),(54,'東電新旧経営陣32人書類送検＝汚染水流出で市民団体告発―福島県警','soci','　東京電力福島第1原発の放射能汚染水が海に流出した問題で、福島県警生活環境課は2日、公害犯罪処罰法違反容疑で、東電の広瀬直己社長や勝俣恒久元会長、武藤栄元副社長ら新旧経営陣32人と、法人としての東電を書類送検した。　県警は、送検に付した意見の内容や認否について明らかにしていない。　送検容疑は、汚染水貯蔵タンクの監視や漏えい防止措置を怠った結果、2013年7月までに約300トンの汚染水を漏えいさせたほか、11年6月に政府から地下水の建屋流入抑止策の検討を求められていたにもかかわらず、経営上の理由から先送りにし、1日当たり300〜400トンの汚染水を海へ流出させた疑い。　'),(55,'〔爆弾低気圧〕空の便：北海道・東北方面発着便に影響続く(2日18時現在)','soci','急速に発達した低気圧の影響で、北海道地方を中心に非常に強い風が吹いています。この影響により、北海道・東北方面を発着する便に影響が見込まれており、一部路線では欠航便も出ています。このため、航空各社では、利用者に最新の運航情報に注意するとともに、旅程の変更などを呼びかけています。■運航への影響＜2日＞【ANA】全便欠航　：稚内、紋別発着便欠航あり　：札幌(新千歳)、旭川、庄内、八丈島発着便影響可能性：女満別、中標津、釧路、帯広、函館、秋田発着便【JALグループ】欠航あり　：札幌(新千歳)、女満別、青森、花巻発着便影響可能性：旭川、釧路、帯広、函館発着便【スカイマーク】影響可能性：札幌(新千歳)、仙台、神戸発着便【北海道エアシステム】全便欠航　：利尻、奥尻発着便影響可能性：釧路、函館、三沢発着便【AIRDO】欠航あり　：旭川発着便影響可能性：札幌(新千歳)、女満別、釧路、帯広、函館発着便【フジドリームエアラインズ】影響可能性：札幌(新千歳)、青森、花巻発着便＜3日＞【ANA】影響可能性：稚内、紋別、女満別、中標津発着便■無手数料変更(振替)および払戻対応【ANA】1日午後〜2日最終便：神戸発着便1日始発便〜2日最終便：仙台、八丈島、鳥取、米子、石見、徳島、対馬、福江発着便1日始発便〜3日最終便：稚内、紋別、女満別、中標津、釧路発着便2日全便：札幌(新千歳)、大館能代、秋田、庄内、福島、大島、新潟、富山、小松、能登発着便2日始発便〜3日最終便：函館発着便2日午前：東京(羽田)発着便【JALグループ】2日全便：札幌(新千歳・丘珠)、旭川、女満別、釧路、帯広、函館、青森、三沢、秋田発着便【スカイマーク】1日始発便〜2日最終便：仙台、神戸発着便2日全便：札幌(新千歳)発着便【フジドリームエアラインズ】2日全便：札幌(新千歳)、青森、花巻発着便'),(56,'ラーメンショーで「東池袋大勝軒」「支那そばや」のコラボラーメンを発表','soci','　２３日から開幕する世界最大級のラーメンイベント「東京ラーメンショー」（東京・駒沢オリンピック公園）の記者会見が２日、都内で行われた。スポーツ報知既報通り、今年４月になくなった山岸一雄さん（享年８０）が創業した「東池袋大勝軒」（東京豊島区）と故・佐野実さん（享年６３）が創業した「支那そばや」（横浜市戸塚区）によるコラボラーメン「絆をつむぐ醤油らぁ麺」を、初日から６日間販売することが発表された。　ラーメンの神様こと山岸さんと鬼の異名を取った佐野さんの初競演は、今回の目玉だ。当日現場で指揮する「大勝軒」二代目店主・飯野敏彦氏（４７）は、「恥のかかないラーメンを精一杯作る」と力強く宣言。佐野さんの妻・しおりさん（５４）は「お世話になった２人のファンに食べていただきたい」と話した。　今年で７回目となるラーメンショーは、過去最長の１２日間行われ、全国の「ご当地ラーメン」約１００店が出店。２７日午後６時から、男女５０００人による「ラーメン婚活」イベントを初めて実施する。参加費は１０００円で、すでに３００人の応募があるという。'),(57,'いす投げ、生徒けが　大阪市立中教諭に停職処分　「手元狂った」　過去にも２度体罰で懲戒','soci','　生徒指導中に椅子を投げ、生徒の頭にけがをさせたとして、大阪市教委は２日、市立中学校の男性教諭（３３）を停職３カ月の懲戒処分とした。この教諭は平成２２、２５年度にも生徒に体罰を加え、それぞれ懲戒処分を受けたという。　市教委によると、教諭は５月２７日午後３時ごろ、指導中の中学１年の男子生徒が教室から逃げだそうとしたのを止めるために、椅子を投げた。生徒はよけようとしてしゃがんだが、後頭部に椅子の脚が当たり、全治１０日間の打撲を負った。　教諭は「生徒と出入り口の間の壁を狙って投げたが手元が狂った。軽率だった」と話しているという。　この教諭は２２年度、野球部の部活中に話を聞かなかった１年の男子生徒を蹴り、平手でほおをたたいて鼓膜を損傷させたなどとして停職２０日の処分を受けた。２５年度には、同級生を窓から投げるまねごとをした２年の男子生徒３人の顔を平手でたたき、うち１人の鼓膜を損傷させたなどとして、停職２カ月の処分を受けた。'),(58,'精神保健指定医資格不正で23人を行政処分−厚労省、医業停止1―2カ月','soci','　厚生労働省は、医師や歯科医師の行政処分を発表した。精神保健指定医の資格不正問題に関連した23人の医師が医業停止1―2カ月となったほか、刑事事件で有罪が確定するなどした医師と歯科医計24人が免許取り消しなどの処分となった。【新井哉】　30日に開かれた医道審議会医道分科会の答申を受けたもので、医業停止1年以上の処分は、免許取り消しが1人、医業停止3年が4人、同1年6カ月が1人、同1年が2人。　精神保健指定医の資格不正問題に関しては、医業停止2カ月が12人、同1カ月が11人。処分は今月15日に発効する。'),(59,'ウェーク島近海で台風23号＝22号は中国大陸へ','soci','　気象庁は2日午後、ウェーク島近海で熱帯低気圧が大型の台風23号に変わったと発表した。　5〜7日に南鳥島近海に進む見込み。　一方、フィリピン・ルソン島付近で2日未明に発生した台風22号は、南シナ海を進んで4日夜に中国大陸に上陸すると予想される。　'),(60,'遺族の敗訴確定＝栃木警官発砲で死亡―最高裁','soci','　栃木県で2006年、警察官が職務質問した中国人男性＝当時（38）＝に抵抗され、拳銃を発砲して死亡させたのは過剰防衛だとして、遺族が県に約5000万円の損害賠償を求めた訴訟で、最高裁第2小法廷（山本庸幸裁判長）は9月30日付で、遺族側の上告を退ける決定をした。　遺族敗訴の差し戻し控訴審判決が確定した。　一審宇都宮地裁は請求を棄却したが、二審東京高裁は「男性が襲いかかってきた」とする警察官の証言は信用できないとして約1000万円の賠償を命じた。　しかし、最高裁は高裁判断に誤りがあるとして審理を差し戻し、高裁は警察官の証言の信用性を認め、「発砲はやむを得なかった」として遺族側控訴を棄却した。　警察官は特別公務員暴行陵虐致死罪に問われたが、無罪が確定している。　'),(61,'北海道中心、暴風・高波・落雷など注意…気象庁','soci','　気象庁は２日夕、北海道地方を中心に３日にかけて、非常に強い風が吹き、海上はおおしけになるとして、暴風や高波・高潮、落雷、突風に注意するよう気象情報を発表した。　サハリン付近の発達した低気圧が北東へ進んでいるためで、最大風速は北海道地方で２８メートル、東北地方で２３メートルが予想される。予想最大瞬間風速は北海道地方で４０メートル、東北地方で３５メートル。　また、北海道地方では３日明け方にかけて、強い寒気が入り、大気の状態が非常に不安定になる見込み。同庁は積乱雲が近づく際には、建物内に移動するよう呼びかけている。'),(62,'日歯連、民主支部を実質管理…迂回献金隠しか','soci','　日本歯科医師連盟（日歯連）の政治資金規正法違反事件で、２０１０年参院選での迂回（うかい）献金に利用された民主党支部を日歯連が実質的に管理していたことが、関係者の話でわかった。　支部の要職を日歯連幹部が占め、会計も担当していたという。東京地検特捜部は、日歯連に政党支部を利用することで迂回献金を目立たなくする狙いがあったとみて調べている。　この支部は、日歯連が１０年参院選で支援した西村正美参院議員（民主）が代表を務める「民主党参議院比例区第８０総支部」。　特捜部の発表などによると、日歯連は同年３〜５月、８０総支部を経由する形で「西村まさみ中央後援会」に５０００万円を寄付。日歯連は別途、西村後援会に５０００万円を直接寄付しており、日歯連から西村後援会への資金移動は、政治団体間の寄付の法定上限（年５０００万円）を超える計１億円に上った。'),(63,'住んでくれたら特急通勤の料金補助　そんな自治体各地に','soci','　住んでくれたら、通勤で使う特急料金を補助します。そんな自治体が各地に現れ始めた。狙いは人口増。都心からは少し遠い街だけど、「特急を使えば快適」と誘う。【写真】特急通勤の補助がある主な自治体　太平洋に面した房総半島の千葉県いすみ市。海水浴と漁港で知られるこの街は、市内に転居した人にＪＲ外房線の特急料金を補助している。東京都内や千葉市などへ定期券で通勤する人が対象で、１人あたり最大月１万円が出る。　いすみ市にある大原駅から東京駅へは特急で約７０分、千葉市の蘇我駅へは約４０分で、普通列車の半分の時間で着く。混雑とは無縁の快適なシートに揺られて通勤できるのも魅力だ。一般的な企業では通勤手当で特急料金は出ない。定期券の特急料金は２万１６００円（１カ月）で、その半分近くを市が補助する。　市の人口は約４万人で、１０年間で３千人減った。東京からは約８０キロ。海や山など豊かな自然に囲まれ、都心から観光で訪れる人も多い。だが、住むとなると「遠い」と敬遠されがちだ。市企画政策課の市原正一さんは「特急なら東京も通勤圏。この施策で人口を増やしたい」と言い、観光客が集まる漁港の朝市などでＰＲしている。　九州の佐賀市も今年度から特急通勤を補助している。特急ならＪＲ佐賀駅から福岡市の博多駅まで約４０分。市は月額料金とほぼ同額の１万５千円を出す。対象は大学を出て就職する若者などで、市内に残ったまま福岡まで通ってもらおうという狙いだ。佐賀市は「経済的な負担が軽くなれば、慣れ親しんだ佐賀に残ろうという若者も増えるのでは」と期待する。'),(64,'北海道、3日にかけ警戒＝低気圧の影響で暴風高波―気象庁','soci','　気象庁は2日夕、発達した低気圧がサハリン付近を北東へ進んでいるため、北海道では3日にかけて非常に強い風が吹き、海上は大しけになるとして、暴風や高波、高潮に厳重に警戒するよう呼び掛けた。　雷を伴い、激しい雨が降る恐れもある。　東北地方も日本海側の北部海上で大しけが続く見込み。　3日にかけての最大瞬間風速は北海道40メートル、東北35メートル、波の高さは北海道9メートル、東北6メートルと予想される。　'),(65,'【鉄道ファン必見】大学“鉄研”オシャレに変身　流行は「見せる」「分かち合う」…５大学“連結”３日から「船場鉄道フェス」','soci','　大学の鉄道系サークルの活動が変化している。定期的に子供向けイベントを企画するなど、鉄道の醍醐（だいご）味を内輪だけでなく、子供やファンと交流し、“見せる”“分かち合う”傾向が強まっている。３、４日に大阪市内で開催される「船場鉄道フェスティバル」には、関西の５大学が参加。珍しいペーパークラフトの鉄道模型や、１５年にわたって継ぎ足し続けたジオラマを披露する。学生は「個人で楽しむのと違い、来場者からもらえる反応がうれしい」と話している。（芦田彩）■理系ならでは「紙でも精密」「１００円」　９月２８日、大阪産業大（大阪府大東市）で、ユニークな鉄道模型のテスト走行が行われた。４両編成の近鉄電車で、窓には優先座席を示す黄緑のシールがあり、リアリティーたっぷり。上部には立体的なクーラーやパンタグラフなどが取り付けられ、完成度の高さがうかがえる。ここまでは従来の鉄道模型と同じだが、よく見ると“紙”でできているのだ。　制作したのは同大の文化会鉄道研究部のメンバー。モーターとタイヤは市販品を使用。制作費は４両編成で約３千円程度だ。大喜多隼（はやと）部長（２１）は、「ペーパークラフトなら製品化されていない車両を作って走らせることもできる」と説明する。昨年開かれた展示会などではＡ４サイズに印刷したものを１枚１００円で販売。大喜多さんは「１５０〜２００枚が売れる人気ぶりで驚いた」と語る。■まるで「秘伝のタレ」！？　ジオラマ継ぎ足し続け１５年　大阪市立大（大阪市住吉区）の鉄道同好会は、１５年前のＯＢの時代から作り上げてきたジオラマを継ぎ足しながら“増殖”し続けている。当初は大学の最寄り駅をモチーフに作っていたが、１５年たった今、車庫や新幹線の路線まで作られている。「個人でやると自己満足になるが、子供が見て喜んでもらうことで、やりがいを感じる」と大浦公督（こうすけ）会長（２２）。　関西学院大（兵庫県西宮市）の鉄道研究会では、都市部と郊外のジオラマを西宮市と三田市の両キャンパスでそれぞれ制作、会場でつなぎ合わせたジオラマを披露する予定。小守敦尚（あつひさ）副会長（２１）は「来場した子供が楽しむ姿を見ると、制作して良かったと感じる。鉄道に興味のない人にも見てもらいたい」と語る。　同志社大（京都市上京区）の鉄道同好会は、子供を中心とした来場者を対象に、鉄道模型をリモコンで操作する体験運転を行う。昨年の同フェスティバルでは１００人以上が参加し、行列ができる人気だった。志沢恒一郎さん（２１）によると、現在は月に１回程度、イベントに参加して子供向けの運転体験を主に実施。「子供たちの笑顔を見るのが楽しい」と志沢さん。関西大（吹田市）の鉄道研究会も新しいジオラマや写真を披露する予定だ。■３世代？“鉄っちゃん”は日本の象徴　大学の鉄道系のサークルの多くは高度経済成長期前後に設立。鉄道図書館（大阪市福島区）のふじたかずひこ館長（６０）は、理由の一つとして「昭和３９（１９６４）年の新幹線開通を機に鉄道ブームが起き、鉄道という趣味が大衆化した」と指摘する。　現在活動する関西の大学の鉄道系サークルの多くが、企業や自治体、鉄道会社が行うイベントに年間３〜５回ほど参加している。　ふじた館長は「最近は、内向きだった大学の鉄道系サークルが、外に目を向ける傾向にあり、学生がイベントで自分たちの作品などを発信する流れも生まれている」と説明する。　「船場鉄道フェスティバル」は、午前１０時から午後５時まで、大阪市中央区の船場センタービル６号館で開催。入場無料。問い合わせは船場まつり推進協議会（（電）０６・６２６１・８０００）。　　　　　◇　「船場まつり」のサイトは下記ＵＲＬhttp://www.sembamatsuri.com/'),(66,'バイク窃盗容疑で中3誤認逮捕＝少女がうその被害届―滋賀県警','soci','　滋賀県警守山署は2日、原付きバイクを盗んだとして窃盗容疑で同県守山市の中学3年の男子生徒（14）を誤って逮捕し、釈放したと発表した。　バイクは知人の少女（17）から借りたが、少女が無免許の男子生徒に貸したことを隠すため、うその被害届を出していた。　同署は9月30日深夜、守山市内の路上でバイクに乗っていた男子生徒を職務質問。男子生徒が「無断でバイクを持ち出した」と話し、少女が被害届を出したため、同署は10月1日朝、男子生徒を逮捕した。　その後の調べで、男子生徒が「バイクは借りていた」と話し、少女もこれを認めたため、釈放したという。同署は今後、男子生徒らを道交法違反（無免許）や軽犯罪法違反（虚偽申告）などの疑いで調べる。　同署の西村和彦副署長の話　供述の信用性をより慎重に吟味し、裏付け捜査を徹底するなどして適正捜査に努めたい。　'),(67,'現職警官逮捕　別の男性死亡現場ではキャッシュカード持ち去る　中野容疑者を懲戒免職　埼玉県警','soci','　埼玉県朝霞市根岸台の無職、寺尾俊治さん（５８）が自宅で絞殺された事件で、埼玉県警は２日、殺人の疑いで逮捕した県警浦和署地域課の巡査部長、中野翔太容疑者（３１）を懲戒免職処分とした。　県警は処分の理由に殺人のほか、寺尾さん殺害に職務上知り得た情報を利用したこと▽職務で知り合った女性と不適切な交際を続けていたこと▽今年７月にさいたま市南区で死亡した男性（８４）方に臨場した際、男性のキャッシュカードなどを持ち帰ったこと−の３点を加えた。　また、さいたま地検は同日、中野容疑者を強盗殺人と住居侵入の罪でさいたま地裁に起訴した。　起訴状によると、中野容疑者は９月３日午後、無施錠の掃き出し窓から寺尾さん方に侵入。現金を盗もうとしたが、寺尾さんが在宅していたため、首を縄のようなもので締め窒息死させ、現金約１２１万６０００円と記念硬貨１２３枚（６４万７５００円相当）を奪ったとしている。'),(68,'ホワイトタイガー双子赤ちゃん、もうすぐ会えるよ　群馬','soci','　みなさん、こんにちは。私たちは群馬サファリパーク（富岡市）で９月１日に生まれたホワイトタイガーの双子の女の子、アルとルナです。５日からみなさんと記念撮影ができるので楽しみにしています――。【動画】１０月５日から公開されるホワイトタイガーの赤ちゃん＝金井信義撮影　名前は飼育員の杉崎碧（みどり）さん（２２）がアニメのキャラクターから名づけたという。いずれも生育は順調で、アルは体重５・２キロ、ルナは５・５キロと、この１カ月で２倍以上に増えた。２頭とも最近、目が見えるようになり足取りもしっかりしてきたといい、２頭でじゃれ合うなどしている。　記念撮影は５日午前１０時から毎日あり、２頭のどちらかを抱いて撮れる。１枚（８００円）に５人まで写ることができる。１日の受付人数を制限し、２頭の様子を見ながら時間を調整するという。　原則、水曜休園。ほかに駐車料３００円、入園料高校生以上２７００円、３歳〜中学生１４００円などが必要。問い合わせは群馬サファリパーク（０２７４・６４・２１１１）へ。'),(69,'琵琶湖の虹、発生予報始めます　民間気象会社が全国初','soci','　琵琶湖の虹をＰＲしようと滋賀県の外郭団体「びわこビジターズビューロー」が虹の発生予報を始める。気象庁によると、全国初の試み。９日から。　委託した民間気象会社によると、山に囲まれた琵琶湖周辺はにわか雨が多く、空間が広いため発生頻度が高いといい、団体がサイトへの掲載を企画した。　にわか雨後の日差しの具合などを分析し、虹が見られる可能性を８段階で表示する。関係者は「観光客と滋賀の新たな架け橋に」と期待する。'),(70,'中国人「爆来」でバス足りない　学校行事に影響も','soci','　中国で国慶節（建国記念日）の大型連休を迎えた１日、多くの中国人観光客が来日した。博多港に下り立った人は商業施設へ。「爆買い」への期待は高まるばかりだ。だが、あまりの急増に迎える態勢が追いつかず、思わぬ余波も生まれている。【写真】クルーズ船（奥）を下り、バスに乗り込む中国人観光客たち＝１日午前８時２６分、福岡市、岩田誠司撮影　１日朝、歓迎の和太鼓の演奏が福岡市の博多港に響いた。中国・上海発のクルーズ船「コスタセレナ」（約３１００人乗船）が到着。下り立った観光客は、ずらりと並ぶ７０台以上のバスに足早に乗り込んだ。別のふ頭には約２千人が乗った船が着いた。　外国人観光客に人気のキャナルシティ博多（同市博多区）。同日昼ごろには、家電や衣料品が詰まった紙袋を持った客であふれた。中国・大連から家族で訪れた会社員の女性（３４）は「旅の目的はショッピング。もう子供服を買った」と満足そうだ。　中国人観光客をターゲットにした商戦は熱い。同市の２０の商業施設は今年、国慶節に合わせたキャンペーンを初展開。外国人向けの特典を用意したり、お勧め商品を中国語で紹介した冊子を配ったりしている。　各自治体によると、今年、博多港に入る予定の客船は２７３隻と前年（１１５隻）の倍以上。うち２５０隻が中国からだ。長崎港でも今年は約１３０隻（前年は７５隻）と過去最高の予定。下関港でも過去最高を見込む。鹿児島港では昨年を上回る５１隻が入る予定だ。　とりわけ活況なのがバス業界だ。福岡県内に観光バス２８台を保有する福岡市内の会社は、多い日で１日２０台をクルーズ客にあてるという。九州運輸局によると、同県に登録された貸し切りバス事業者１３７社（計１７２７台）で対応できない日がある。「他県からバスを回して埋め合わせている」と担当者。国も昨年、他県の事業者が参入しやすいよう規制緩和している。　ただ、駐車スペースの問題がある。キャナルシティ博多には、多い日で１００台以上のバスが立ち寄るが、６月末まで駐車場は大型バス９台分だけだった。キャナルシティ博多を管理する福岡地所は７月、新たにバス１０台分の駐車場を近くに確保し、福岡市も舞鶴公園（中央区）に１５台分を確保した。　それでも、駐車場を待つバスの列がしばしば周辺にできる。今後も市中心部に家電量販店や免税店の出店が予定され、さらなる駐車場不足や渋滞が懸念されている。　福岡県朝倉市の観光バス会社の５０代の男性運転手は「（駐車場の空きを路上で待っているとき）いつ警察に駐車違反だと指摘されるか心配だ。本音を言うと、クルーズ船の客を乗せたバスは運転したくない」と話す。（田中翔人、柴田秀並）'),(71,'北日本は大荒れ続く　暴風・高波に警戒を','soci','　1日から2日かけて、日本海を北上した低気圧は急速に発達し、2日正午には中心気圧が946ヘクトパスカルまで低下した。この低気圧の影響で、北日本では3日にかけても大荒れの天気が続く見込みだ。　2日は、北海道の9地点で観測史上1位の10分平均風速を観測するなど(午後4時まで)、北海道や東北では暴風となっている。北海道や東北では、3日にかけても暴風や高波が続き、海上は大しけとなる。■3日にかけて予想される最大瞬間風速　北海道　40メートル　東北　　35メートル■3日にかけて予想される波の高さ　北海道　9メートル　東北　　6メートル　北海道では、2日夜にかけて、低気圧の影響で潮位が高くなる。海岸や河口付近の低地では、高潮による浸水や冠水に警戒が必要だ。　北海道は、上空の強い寒気の影響で、2日夜から3日明け方にかけて、大気の状態が非常に不安定となる。落雷や竜巻などの激しい突風に注意が必要だ。'),(72,'迂回寄付、06年から常態化＝47都道府県の連盟経由―日歯連規正法違反・東京地検','soci','　政治団体「日本歯科医師連盟」（日歯連）をめぐる政治資金規正法違反事件で、2007年参院選前の06年にも、日歯連が47都道府県の歯科医師連盟を迂回（うかい）する形で、石井みどり参院議員（自民）の関連政治団体「石井みどり中央後援会」に計4700万円を寄付していたことが2日、関係者への取材で分かった。　　既に政治資金規正法の公訴時効が成立しているが、当時も前副理事長の村田憙信容疑者（70）が会計を担当していたことから、特捜部は迂回寄付が同容疑者の主導の下、06年から常態化していたとみて詳しく調べているもようだ。　関係者によると、日歯連は06年、石井氏の後援会に直接寄付した5000万円とは別に、47都道府県の歯科医師連盟を経由して、100万円ずつ計4700万円を同後援会に寄付した。　この寄付をめぐり、日歯連は下部組織である都道府県の歯科医師連盟に、石井氏の後援会へ50万円寄付するよう依頼する文書を、2度にわたり配布。各連盟には事前に助成金として数百万円を寄付し、うち手数料を差し引いた100万円を後援会に寄付するよう手配していた。　04年に発覚した日歯連による自民・旧橋本派への1億円ヤミ献金事件を契機に、05年には政治団体間の寄付の上限が年間5000万円に改正されていた。村田容疑者はこの改正を受け、上限を超えた寄付の方法を考え出したとみられる。　同容疑者はヤミ献金事件で有罪となった会計責任者の後を受け、日歯連の会計を担当するようになった。07年参院選は担当後、初めての選挙だった。　'),(73,'集団強姦容疑で３２歳小学教諭を書類送検　大阪府警警察官らと共謀、ホテルで','soci','　大阪府警の警察官らが女性を集団で乱暴したとされる事件で、府警捜査１課は２日、新たに事件に関与したとして、監禁と集団強姦容疑で、同府吹田市立小の男性教諭（３２）＝茨木市＝を書類送検した。容疑を認めているという。吹田市教委によると、教諭は９月２９日から自宅謹慎中。　書類送検容疑は元四條畷署巡査長（３２）や元箕面署巡査部長（３６）＝懲戒免職＝らと共謀し、昨年１２月、２０代女性を大阪市天王寺区のホテルの一室に監禁、集団で乱暴したとしている。　事件では元巡査長ら男４人が逮捕されたが、いずれも大阪地検が処分保留としている。教諭を含む５人以外に関与した男はいないとみられる。'),(74,'監禁男性が転落・重傷事件、京大熊野寮を捜索','soci','　過激派・中核派の拠点「前進社」（東京都江戸川区）で監禁された男性が転落して重傷を負った事件で、警視庁公安部は２日午後、同派系全学連の拠点がある京都大学学生寮「熊野寮」（京都市左京区）に監禁致傷容疑で捜索に入った。　同庁幹部によると、監禁致傷容疑ですでに逮捕されている４人はいずれも全学連の活動家で、熊野寮は全学連の拠点となっている。公安部は１日に東北大と広島大の関連先も捜索しており、組織の実態解明を進めている。'),(75,'“ムサコマダム”も困惑の落下物騒動　「住みたい街」人気急上昇の武蔵小杉','soci','　高級タワーマンションが林立し、「住みたい街」として人気急上昇中の武蔵小杉（川崎市中原区）。その街の住人「ムサコマダム」がアフタヌーンティーを楽しむ昼下がりに事件は起きた。突然、牛乳瓶が空から降ってきたのだ。実はこの武蔵小杉、ここ数日、不審な落下物事件が相次いでいる。ニューセレブスポットに何が起きているのか。　渋谷駅から電車で１５分。ＪＲと東急電鉄が乗り入れる武蔵小杉駅。そこから徒歩２分という好立地にある高級タワーマンション（４８階建て）。９月２８日午後、このマンションの隣にあるスーパーの前で、歩道に牛乳瓶の破片らしきガラスが散乱、辺りは悲鳴に包まれた。前日２７日にも通行人が「ペットボトルが３本落ちてきた」と１１０番し、２４日には男性が、皿が落ちてくるのを目撃している。　牛乳瓶などは人に当たれば死亡する恐れもあり、現在、神奈川県警が軽犯罪法違反の疑いで調べを進めているが、近所に住む女性（７２）は「５月の午後１時ごろ、孫を幼稚園に迎えに行くと、マンションのあたりで食べかけのパンが落ちてきました。風もなかったから、飛んできたわけでもなかったと思いますが」と振り返る。何者かがマンションの上から物を落とし、徐々にエスカレートしていった可能性がある。　武蔵小杉といえば、リクルート住まいカンパニーが行うアンケート「みんなが選んだ住みたい街ランキング　関東版」の２０１５年版で、前年の９位から５位に躍進を遂げた。ここ１０年ほどの再開発によって億ションを含む高層マンションが立ち、ショッピング施設も充実。子育て世代に人気で、マンションのエントランスには幼稚園の送迎バスを待つ「ママ友」が優雅に談笑する姿がそこかしこで見受けられる。　ママたちのそのハイソな生活ぶりから「ムサコマダム」との呼び名も生まれ、事件について話を聞こうと別の女性に問いかけると、「あら、ごめんなさい。これからお稽古ごとがあって」と断るにしてもこんな具合だ。　夕刊フジで「本当は教えたくない　マンションの秘密」を連載する住宅ジャーナリストの榊淳司氏は、「世田谷などのタワーマンションには手が届かない一部の層が、新興の武蔵小杉に移り住んできている。東京湾近辺などのマンションはお金持ちが相続税対策や賃貸目的で購入する傾向があるのに対し、武蔵小杉はエリートサラリーマンが住まいに使っている」と話す。　そんなハイソなエリアには、ややそぐわない粗暴な事件。多摩川をはさんで向かい側には、古くから政財界人も居を構えた田園調布（東京都大田区）、二子玉川（東京都世田谷区）の高級住宅街が広がる。真のセレブスポットになるには、もう少し時間が必要か。'),(76,'橋下氏、維新残留組を“守銭奴”呼ばわり　政界復帰の可能性もにじませ','soci','　大阪市の橋下徹市長（４６）が、離党した維新の党に対し、痛烈な批判を炸裂させた。維新の党を「偽物の維新になった」と罵倒し、松野頼久代表らが、政党交付金を分配する「分党」を拒否していることについて、「金にガメつい人は、じき消滅しますよ！」などと“守銭奴”呼ばわりしたのだ。　注目の記者会見は１日夜、大阪市内のホテルで開かれた。　橋下氏はまず、今月中に、新党「おおさか維新の会」を結成すると正式表明した。東京の一極集中を是正するため、大阪を「副首都」とする構想を明らかにし、「地方分権の国に変える」と新党結成の意義を語った。５月に頓挫した「大阪都構想」への再挑戦も掲げ、１１月２２日投開票の大阪府知事選、大阪市長選のダブル選での勝利を目指すという。　このあたりから、橋下氏のボルテージが上がってきた。　松野氏らが、新党側が求める「維新」の名称の返上や、分党を拒んでいることについて、「名前からお金から全部ガメるんだったら、そんな人たちに改革なんてできるわけない。そんな人たちに任せようなんて、有権者は思わない！」と切り捨て、「（自分たちは）目の前のお金なんか一切こだわらない。お金、名前、全部くれてやったらいいんです」と言い切ったのだ。　酷評された松野氏らは、どう対応するのか？　政界屈指の突破力を誇る橋下氏はこの日も、市長任期が満了する１２月に政界を引退することを明言した。ただ、引退後について「私人なので自由にさせてもらう」といい、将来の政界復帰の可能性をにじませた。'),(77,'就職強い大学ベスト３０　１位は一橋大　採用ルール変更にも影響なし','soci','　２０１６年卒の大学生らに対する主要企業の採用内定が１日、正式に解禁され、各社で内定式が開かれた。就職活動（就活）日程繰り下げの見直し論が強まる中、注目されるのは各大学の就職格差だが、受験関連の情報分析に定評のある「大学通信」の「有名４００社就職率」最新ランキングによると、１位は一橋大、２位は東京工業大、３位は豊田工業大と続いた。ベスト３０には意外な大学もランクインし、その動向は見逃せない。採用ルールにも左右されない、本当に就職に強い大学はどこなのか。　三井住友銀行は１日午前、東京都内と神戸市の計２会場で内定式を開催し、内定者計約１８００人が出席。東京会場では、国部毅頭取があいさつした。バンダイナムコグループの１５社は、都内の東京ドームシティで合同内定式を実施し、ＪＲ西日本は大阪市の本社で、内定式を開いた。　大学生の就活をめぐっては、経団連は１６年卒業生から企業が面接などの選考を始める時期を従来の４月から８月に遅らせた。だが、外資系企業や経団連に加盟していない大手企業は通常通り４月から採用を始めるところも少なくなく、就活期間がかえって長引き混乱を招いたと批判が上がった。　このため、経団連の榊原定征会長は先月の定例会見で、「１０月以降に会員企業にヒアリングし、対応を協議する。（元に戻すことも）選択肢だ」と述べるなど「４カ月繰り下げ」が見直される可能性も出ている。　制度変更などへの不安が残る中、受験生や大学生にとって大きな指針となりそうなのは、就職に強い大学ランクだ。大学通信は１５年卒業生を対象に各大学の「有名４００社就職率」を調査。大学通信の安田賢治ゼネラルマネジャーは、「上位の大学は、経団連の採用ルール変更などに影響を受けることは少ないだろう」と指摘する。　有名４００社は、日経平均株価採用企業２２５社に加えて、大学通信が規模や知名度、大学生の人気を基に選んだ。業種は建築・住宅、食品、化学、商社、銀行、広告、サービスなど多岐にわたる。ランクはその４００社への就職者数を、卒業生から大学院進学者数を引いた数で割り、順位付けしたものだ。　トップ３０をみると、一橋大が５７・９％で１位に。続いて２位が東京工業大の５３・９％、３位は豊田工業大の５０・５％となった。５割を上回ったのはこの３大学だけで、２人に１人が有名企業に就職していることになる。　安田氏は「昨年は僅差で１位東工大、２位一橋大だったが、順位が逆転した。この２大学は圧倒的に強い」と話す。就職先をみると、一橋大は三菱東京ＵＦＪ銀行３４人、三井住友銀行２２人、丸紅１８人、三菱商事１７人など大学生に人気のメガバンク、商社に相当数が就職した。　東工大はメーカーなどに強く、トヨタ自動車に２５人、利益水増し問題で揺れる東芝に２３人、日立製作所に２２人、富士通に２１人…と技術職の高い需要が浮き彫りとなった。両大学の人気は今後も一層高まりそうだ。　３位の豊田工業大はトヨタが１９８１年に設立した名古屋の私立大学で、トヨタの関連企業などへの就職に強い。好調とされる名古屋経済を反映するように、名古屋勢はほかにも、１３位に名古屋大、１６位に名古屋工業大がランクインした。　４位はブランド力のある慶応大が入り、５位は秋田市の国際教養大で、２００４年の開学から１１年がたった今も快進撃が続いている。　「国際教養大は１年間の留学が必須となっていて海外生活で日本のメーカーの進出に影響を受け、就職先はメーカーが人気。他にも東京外国語大（９位）や国際基督教大（１７位）など、グローバル教育を徹底している大学は軒並み就職に強い」（安田氏）　女子大のトップは１２位の学習院女子大だ。学習院大も１９位に入り、学習院の持つブランド力が光った。「学習院女子大はメガバンクに多く就職している。（偏差値が同等の）ＧＭＡＲＣＨ（学習院、明治、青山学院、立教、中央、法政）の中では、学習院の強さが際立っている」と安田氏は話す。　女子大は学習院女子大のほか、１８位に東京女子大、２０位に聖心女子大、２１位に日本女子大、２５位に津田塾大、２７位にお茶の水女子大−とベスト３０に６大学が入った。「短大の人気が低迷した分、どうしても女性を取りたい企業が女子大に求人を出している」（安田氏）という。　偏差値でははかれない大学の魅力。大学入試の準備が本格化する秋を迎え、大学選びの参考になりそうだ。'),(78,'中韓など新興国企業の借金２千兆円　米利上げで破綻ラッシュの恐れ　ＩＭＦ警告','soci','　中国やトルコ、チリ、韓国など主要な新興国の企業の借金が、１０年間で４・５倍にまでふくれあがっていることが国際通貨基金（ＩＭＦ）のリポートで明らかになった。米国が利上げに踏み切れば借金を返せず破綻ラッシュとなる恐れがあるとＩＭＦは警告している。　ＩＭＦが発表した世界金融安定報告によると、主要な新興４０カ国の金融機関を除く企業の借金は２０１４年時点で約１８兆ドル（２１６０兆円）で、１０年前の約４兆ドル（４８０兆円）の４・５倍に急増した。　国内総生産（ＧＤＰ）に占める借金の比率も約４８％から７４％台と２６ポイント急騰している。　０８年のリーマン・ショック後、米連邦準備制度理事会（ＦＲＢ）や日銀、欧州中央銀行が相次いでゼロ金利や量的緩和などの金融政策を打ち出したことで、高いリターンを求める先進国の投資家は新興国に資金を流入させ、新興国の企業はお金が借りやすくなったと分析した。　国別でみると、対ＧＤＰ比で最も企業の借金が増えたのが中国で、リーマン・ショック前の０７年から約２５％増となった。トルコとチリが２０％台の増加で、ブラジル、インド、ペルー、タイが１０％台、そしてメキシコと韓国も１０％近く増加している。　巨額の借金を抱える企業のとどめとなりかねないのが、米国の利上げだ。米国が事実上のゼロ金利を解除すれば、新興国に流入していた資金が米国に還流し、ドル高が加速する半面、新興国通貨が暴落する公算が大きい。　ＩＭＦは「新興国通貨の下落によって、外貨建ての借金が相対的に膨らみ、返済がますます難しくなる」と指摘したうえで、新興国の当局者に、企業の経営悪化や破綻に備えておくよう要請。「必要ならば破綻処理の制度を改革すべきだ」と訴えている。　中国経済が失速するなか、新興国企業の状況は厳しさを増している。震源地の中国では、８月の中国の工業部門の企業利益は前年同月比８・８％減と、１１年の調査開始以来最大の落ち込みとなった。　対中依存度の高い韓国でも、米格付け大手のスタンダード・アンド・プアーズ（Ｓ＆Ｐ）が、韓国主要企業３８社の格付けの平均値を「ジャンク（紙クズ）」と呼ばれる投資不適格級一歩手前の「トリプルＢマイナス」まで引き下げたと報じられた。　こうしたなか、イエレンＦＲＢ議長は中国経済の減速を理由の一つとして９月の利上げを見送ったが、年内の利上げに踏み切る可能性は残っている。米国の利上げをきっかけに中国や韓国など新興国からの資金流出がさらなる波乱を引き起こしかねない。'),(79,'「安保関連法の風が変わった」「外交問題は安倍政権でなければ解決できない」　平沢勝栄氏インタビュー','soci','　安全保障関連法の成立を受け、安倍晋三首相が、今後の最優先課題として「経済再生」を打ち出した。来年夏の参院選をにらんで安定した支持率の確保を図り、政権の看板である外交などに力を注ぐ構えだ。こうしたなか、当選７回の自民党ベテラン、平沢勝栄衆院議員は夕刊フジのインタビューに応じ、安倍政権の「次のステージ」の展望を語った。　──先の国会で安保関連法が成立した　「今後、具体的な運用方針策定などの作業が待ち構えている。法律の必要性を国民に理解してもらうための説明にも、引き続き取り組んでいかなければならない。これからが本当の正念場だ」　「残念だったのは、野党が『反対ありき』の硬直的な姿勢を示し、最後に物理的な抵抗にも打って出たことだ。特に、津田弥太郎参院議員（民主党）による、大沼瑞穂参院議員（自民党）への暴行はひどかった。国会の外であれば、即、事件化される案件だ。外国にも映像が流れたが、恥ずかしい限りだ。国民の目には『国会は世間の常識が通用しない』と映っただろう」　──有権者の安保関連法への受け止め方は　「成立後の連休中、地元（東京都葛飾区、江戸川区）で多くの人と話したが、賛同や理解の声が大半だった。採決前には『もっと慎重に』という意見も頂いたが、成立を境に風が変わったように感じた。国民の安全を守り、戦争を回避するための法律であるという理解が徐々に浸透したからだろう。国会周辺でのデモのような根強い反対論は、あくまでも世論の一部だと実感する。今後も丁寧に説明を続けていけば、賛同は広がると確信している」　──安倍首相が「経済再生」を掲げた　「景気が回復しないことには国民の幅広い支持は得られない。高い支持率こそが改革を進める地盤となる。『１内閣１仕事』という竹下登元首相の言葉があるが、安倍首相は、憲法改正国民投票法や特定秘密保護法の成立などすでに数多くの仕事を成し遂げている。これからも多くの仕事に取り組んでいく決意をしておられるのでないか」　──どのような仕事に取り組んでいくのか　「まずは外交だ。日本は国益を踏まえた毅然とした対中、対韓外交に力を入れなければならない。北方領土問題の解決に風穴を開けることも急務だ。もちろん一気に解決することは困難だが、道筋は早急につけるべきだ。北方領土が戻らないことには日本の戦後は終わらない。北朝鮮による拉致問題の解決も喫緊の課題だ。これらはいずれも強力なリーダーシップを有し、安定した支持基盤を持つ安倍政権の時でなければ解決できないだろう」　──憲法改正は　「平和安全法が成立したことで『憲法改正が遠のいた』とみる識者もいるが、遠のかせてはならない。憲法改正はしっかりした日本を創る上で避けて通れない問題だ。改正は自民党の党是でもある。これまでの内閣が先送りしてきた問題だからこそ真正面から取り組むべきだ」'),(80,'日本に逃れ３年、難民認定求め続けて…シリア人一家の今','soci','　激しい戦闘が続くシリアから、欧州へ多くの難民が押し寄せている。これまでに、日本にも約６０人がたどり着いて難民申請をしているが、認められる例はごく少ない。何のつてもなく来日し、難民認定を求めているシリア人一家を訪ねた。【写真】ジュディ・ユセフさん（左）と妻子＝さいたま市、早坂元興撮影　さいたま市の古い民家の１階を借りて、クルド民族のジュディ・ユセフさん（３１）は、妻ファルハさん（２９）、長女（５）、長男（３）と暮らす。２０１２年に逃れてきて以来、日本政府に難民と認めてくれるよう求め続けている。　今年１月に母国から呼び寄せた妻と子どもは日本語が出来ず、自宅からほとんど出ない日々を送っている。母国で近所の人たちとおしゃべりするのが大好きだった妻は、笑うことが少なくなり、ふさぎ込むようになった。子どもたちはいまも、夫婦の会話で「警察」や「軍隊」という言葉を耳にすると、小さな肩をビクッとさせる。　一家は、トルコ国境に近い町カミシリに住んでいた。１１年、民主化運動「アラブの春」がシリアにも広がりデモが起きると、アサド政権が弾圧。混乱は内戦に拡大した。ジュディさんは「もっと良い社会になるように」と信じて友人らを誘ってデモに繰り出すうち、デモの中心的存在になっていったという。　だがシリアは徴兵制の国だ。このままでは「市民を殺すことになってしまう」と思ったジュディさんは、政府軍の一員にされる前に、ブローカーに１万５千米ドルを支払い、国を出た。　先に出国した弟が難民として暮らす英国に行くつもりだったのに、最終的にたどり着いたのはフランスだった。ブローカーは経由地の空港で逃げてしまった。「ここに来るはずじゃなかった」と入国を拒むと、直前に経由した日本の成田空港に送り返されたという。　日本で難民申請をしたが、数カ月の審査を経て不認定に。「デモへの参加を呼びかけたり参加したりした程度にとどまり、クルド人であることのみをもって迫害を受ける恐れがあるとは認められない」（法務省）のが理由だった。　ジュディさんに対して日本政府は、難民としては認めないものの「人道的な配慮」を理由に在留許可を出した。１年ごとに更新される限り日本に住み続けることはできる。しかし、難民と認められれば受けられる日本語学習や職業訓練などの定住支援は受けられない。'),(81,'＜津波タワー＞80人収容可能　八戸に完成','soci','　青森県八戸市市川町の多賀地区に、高さ約20メートルの津波避難タワーが完成した。居室型避難スペースを備え、災害時に80人を収容できる。東日本大震災による津波では同地区が市内最大の被害を受けたのを教訓に、市が整備した。【忘れないあの日】カメラが捉えた3．11　タワーは屋上部分を除き鉄骨の5層構造。5層目の避難スペースは約80平方メートル。地上から床まで13メートルの高さがあり、想定される最大9メートルの津波に対し4メートルの余裕を持つ。発電機や食料を備蓄し、簡易トイレもある。総事業費2億円は復興交付金などを活用した。　市北部沿岸の多賀地区は震災で津波が海と五戸川から押し寄せ、約200棟の建物が全半壊した。現在は1000世帯が暮らす。タワー建設地は海から約1キロ、川から700メートル離れた場所が選ばれた。　災害時は高台避難を原則とし、タワー利用は逃げ遅れた場合に限る。普段は立ち入り禁止で、利用する場合は避難階段入り口のドアを蹴破るなどして入る。地元では11月22日にタワーを使った防災訓練を行う。　9月30日の完成式で、多賀連合町内会の音喜多市助会長（67）は「高齢者はすぐに階段を上れないように感じた。訓練で課題を見つけて解決したい」と話した。　多賀地区では来年秋、五戸川を挟んだ対岸にも避難施設を備えた多目的運動場が完成する。式に出席した小林真市長は「タワーは安全対策の柱。避難施設も含めて地域の安全安心を強化したい」と語った。'),(82,'＜伊方原発３号機＞地元町議会特別委が再稼働求める陳情採択','soci','　四国電力伊方原発３号機が立地する愛媛県伊方町議会の原子力発電対策特別委員会は２日、再稼働を求める陳情を全会一致で採択した。６日の本会議に諮られるが、同特別委は全１６議員のうち、オブザーバー参加の正副議長を除く１４人で構成（２日は１人欠席）されているため、実質的に議会としての「地元同意」が示された形になる。「地元」を代表する伊方町長と同町議会、県知事と県議会のうち、伊方３号機の再稼働を巡り「同意」を示したのは同町議会特別委が初めて。【渕脇直樹、伝田賢史】'),(83,'日本版改良基準、12月にも＝竜巻の強さ「藤田スケール」―気象庁','soci','　竜巻や突風の強さを被害状況から推定する国際基準「藤田スケール」について、気象庁は日本に多い木造家屋や自動販売機などを被害の指標に取り入れた日本版改良案をまとめ、2日開いた検討会で示した。　早ければ12月下旬の次回会合で策定し、職員研修を経て来年度から竜巻の現地調査に使う。近年多発する竜巻の強さを早く、より正確に推定し対策に役立てる。　藤田スケールは1971年、米シカゴ大の藤田哲也教授（98年死去）が住宅や自動車など9種類を指標とし、被害の程度から風速をF0〜F5の6段階で推定する方法を考案。国際基準となった。　しかし、指標の種類が少なく、時代を経て建物などの強度も変わったため、米国やカナダが改良版を策定。気象庁も、12年に茨城県つくば市などで発生した竜巻（最大F3）の被害を受け、日本版の検討会を発足させた。　改良案では、木造住宅・店舗や自販機のほか、鉄骨の工場・倉庫、大小の自動車、電柱、樹木など38種類を指標とし、被害程度と対応する風速を決定。その上で、過去の竜巻被害の風速を改めて推定し、従来の藤田スケールによる推定と整合性が取れるよう配慮して6段階の風速を決めた。　その結果、新たなF0の風速（3秒平均）は25〜38メートル、F1は39〜51メートル、F2は52〜63メートル、F3は64〜76メートル、F4は77〜89メートル、F5は90メートル以上とされた。F3〜5の風速は従来の藤田スケールより小さい。　国内で過去最大だったF3は、改良案では木造住宅の上部構造の倒壊、大型トラック・バスの横転、コンクリート電柱の折損などが目安となる。検討会長の田村幸雄東京工芸大名誉教授は「将来、気候変動でF4、F5が出て来る可能性がある。その場合は（専門家の）委員会を設置して評価する必要があるかもしれない」と指摘した。　'),(84,'＜汚染水流出＞東電社長ら３２人公害犯罪処罰法違反書類送検','soci','　東京電力福島第１原発事故の収束作業に伴い放射性物質を含んだ汚染水が外洋に流出した問題で、福島県警は２日、東電と同社の社長ら幹部３２人を公害犯罪処罰法違反容疑で福島地検に書類送検した。【写真で見る】送検されたのは、この人たち　容疑は、汚染水の適切な対応を怠りタンクから大量に漏水させ、地下水についても政府から事故後に遮水壁を設置するよう検討を求められても費用などを理由に対策を先送りし、汚染地下水を外洋に流出させたとしている。　東電幹部らを業務上過失致死傷容疑で検察当局に告訴・告発した団体の代表らが１３年９月、公害犯罪処罰法違反容疑で同社や幹部３２人を県警に告発していた。【土江洋範】'),(85,'手足口病、東北5県で警報基準値下回る−一部地域で流行継続も','soci','　手足口病の患者報告数が宮城を除く東北5県で警報基準値を下回ったことが2日、各県がまとめた9月21日から27日までの週の患者報告で分かった。ただ、一部の保健所管内では流行が続いていることから、患者の報告が多い自治体では引き続き手洗いなど感染予防の徹底を求めている。【新井哉】　21日から27日までの週の小児科定点医療機関当たりの患者報告数は、山形県で前週比63%減の4.38人、岩手県で60%減の3.4人、秋田県で同57%減の2.46人、福島県で同52%減の2.74人、宮城県で同39%減の7.54人、青森県で同37%減の3.98人となった。　秋田県は「全ての保健所で減少」と説明。福島県も県内の8保健所のうち7保健所管内で患者が減少した。ただ、宮城県の仙南(12.2人)や石巻(9.6人)などの保健所管内で警報基準値を超過し、山形県の最上保健所(7.67人)でも警報基準値を上回った。　手足口病は、水疱性の発疹を主な症状とした急性ウイルス性感染症で、乳幼児を中心に夏季に流行することが多い。主な病原ウイルスはコクサッキーA16、エンテロウイルス71で、感染から3―5日の潜伏期間後、口腔粘膜や手のひら、足底などの四肢の末端に2―3ミリの水疱性発疹が現れる。飛沫や接触によって感染する。'),(86,'伊方原発再稼働求める陳情採択　地元の伊方町議会特別委','soci','　四国電力伊方原発３号機がある愛媛県伊方町の町議会原子力発電対策特別委員会は２日、町商工会などから出されていた再稼働を求める陳情を採択した。同時に提出されていた再稼働に反対する陳情は不採択とした。６日に開かれる町議会本会議でも採択される見通し。伊方原発の再稼働に向けた「地元同意」の手続きが動き出した。　この日の特別委では、継続審査分も含め、７件の陳情を審査。早期再稼働を求める３件の陳情を採択した。住民有志から出されていた、再稼働に反対する４件の陳情は不採択とした。　原子力規制委員会は今年７月、伊方原発３号機の安全対策が、東京電力福島第一原発事故を受けてつくられた新規制基準を満たしているとする審査書を決定。現在、工事計画や保安規定変更の認可を得るための審査が続いている。'),(87,'川内2号機、再稼働14日以降＝規制委に報告―九電','soci','　九州電力は2日、川内原発2号機（鹿児島県）の再稼働が今月14日以降になると原子力規制委員会に報告した。　2号機では重大事故を想定した訓練が4日まで行われており、最終的に再稼働の日程が決まるのは今月中旬という。　九電によると、2号機で核分裂反応を抑える制御棒が設計通り動くか確認する検査を14日に予定している。問題がなければ、再稼働前の主な検査は終了し、制御棒を引き抜く起動作業の準備に入る。　'),(88,'ANA機、エンジン破損で離陸中止＝滑走路に部品落下、一時閉鎖―伊丹空港','soci','　2日午前11時40分ごろ、大阪（伊丹）発新千歳行きの全日空エアバスA320―200型機が離陸滑走中、異音がしたため離陸を取りやめた。　同機は自力で駐機場に引き返し、乗客乗員155人にけがはなかった。このトラブルで、滑走路2本のうち1本が2時間余り閉鎖された。　空港関係者が滑走路を点検したところ、金属片が数百メートルにわたって散乱しているのを発見。全日空が機体を調べたところ、2基のエンジンのうち右側エンジンのタービン翼が破損していた。同社が詳しい状況や原因を調べている。　'),(89,'大型の台風23号発生　来週後半、日本列島に影響か','soci','2日午後3時頃、ウェーク島近海で大型の台風23号が発生した。中心気圧は996ヘクトパスカル、中心付近の最大風速は18メートルで、ゆっくりと西北西に進んでいる。　台風は今後、発達しながら西へ向かい、4日には南鳥島近海へ進む見込み。　なお、2日午前3時には台風22号も発生したが、1月から10月にかけて毎月台風が発生するのは1965年以来、50年ぶりのこと。'),(90,'奥田さん脅迫「許されない」＝学者の会が抗議声明','soci','　安全保障関連法に反対する学生団体「SEALDs（シールズ）」中心メンバーの奥田愛基さんの殺害を予告する脅迫文書が在籍する大学に送付されたことを受け、「安全保障関連法に反対する学者の会」の佐藤学学習院大教授らが2日、「脅迫と暴力は断じて許されない」とする抗議声明を発表した。　　声明は「言論・表現の自由を脅迫と暴力で封じ込めようとすることは、民主主義社会に対する重大な挑戦で断じて許されない」としている。同会には、9月28日時点で1万4268人の学者らが賛意を表明している。　'),(91,'黄金色の秋たわわ　福岡のイチョウ並木','soci','　秋が深まるなか、福岡市中央区のイチョウ並木で、たわわに実ったギンナンが、色づき始めている。　同区白金と大宮の間を流れる幅２メートル程の小川沿いには、約７８０メートルにわたってイチョウ並木が続く。黄金色に熟したギンナンは、重さで枝を引っ張るように垂れ下がり、時折吹く風で、ポトンポトンと落果していた。（長沢幹城）'),(92,'架空請求で3800万円詐取容疑＝光学機器会社元社員ら2人逮捕―警視庁','soci','　勤務先会社の子会社に架空の請求書を提出し、現金約3800万円をだまし取ったとして、警視庁捜査2課は2日、詐欺容疑で、光学機器輸入販売会社「カールツァイス」元社員、森田政和容疑者（63）＝千葉県船橋市習志野台＝ら男2人を逮捕した。　同課によると、いずれも容疑を認めている。　逮捕容疑は2009年2〜9月、十数回にわたり、カールツァイス子会社2社が業務用車両の修理業務を架空の会社に委託したように装い、虚偽の請求書を子会社宛てに提出するなどし、計約3800万円を自らが管理する口座に送金させ、詐取した疑い。　同課によると、2人は社用車の管理業務を担当していた。詐取金はキャバクラなど遊興費や借金返済に充てられていたとみられる。同課は2人が同様の手口でほかにも1000万円以上を詐取していたとみて調べている。　同社の社内調査で10年春に発覚した。　'),(93,'介護士ら研修受けず医療行為か　大阪・羽曳野の老人施設','soci','　介護士が必要な研修を受けないまま入所者に栄養剤注入などの医療行為を施したとして大阪府警は２日、大阪府羽曳野市の介護付き有料老人ホーム「グランパ羽曳野」の元施設長（４３）ら計２２人を医師法違反などの疑い、運営法人を社会福祉士及び介護福祉士法違反の疑いで書類送検した。府警への取材でわかった。　羽曳野署によると、元施設長のほかに書類送検されたのは介護計画の作成担当者（６６）と看護師１人、介護士１９人。２０１３年１月〜１４年９月、介護士が法的義務がある研修を受けないまま、入所者２人に対し、鼻に管を入れて栄養剤を注入する「経管栄養」を計６５９回実施し、別の入所者２人に計１３６５回、糖尿病のインスリン注射をした疑いがある。　厚生労働省福祉基盤課によると、経管栄養の実施は医師や看護師らに限られていたが、１２年の社会福祉士及び介護福祉士法改正で、専門の研修を受ければ介護職員らも可能になった。現場のニーズが高く、介護施設側から「職員でもできないと現場が回らない」と強い要望があったという。インスリン注射は研修の有無にかかわらず、医療行為として介護職員らが行えば違法行為にあたる。'),(94,'学校事故・事件で名ばかりの第三者委員会','soci','　福島県教育委員会は先週末の26日、県立高校の女子生徒が部活トラブルが原因と思われる自殺をしていたことを公表し、詳細を調査するために第三者委員会を設置すると発表した。　こうした学校事故・事件に関しての第三者委員会が設置されるようになったのは、2012年に起きた大津市でのいじめ自殺事件がきっかけだが、こうした事件の関係者からは「大津市以外はまともに第三者委員会が機能していない」という声が多く聴かれる。大体において、責任をあいまいにする「第三者委員会」になってしまうというのだ。　東日本大震災で多くの児童が津波の犠牲となった石巻市立大川小学校。やはり、第三者委員会となる「検証委員会」では、遺族抜きで教育行政サイドの学者や民間業者などが中心になって組織された。　「津波が来るから（高台である）山へ逃げよう」と訴えた児童がいて、その要望に応え「山へ避難しよう」と指示した同校教諭の指導があった。だが、「子供の記憶は変わるもの」などとして、適切な避難指示を出した教諭の行動を認めないという態度を石巻市の調査委員会は採った。　当時小学校6年生の同校児童である次女を亡くし、現役公立中学校教諭でもあった佐藤敏郎氏によると、「山へ逃げよう」という避難指示は地域性などから現場教師が行うのは自然なことだという。しかし、調査委員会がこうした事実を認めようとしないのは、津波を予想して行動した人がいると、「津波が大川小学校にまで到達することは想定外だった」として、適切な避難指示をしなかった責任回避をする目論見が崩れてしまうからと遺族は受け止めている。　大津市いじめ事件で第三者委員を経験した「尾木ママ」こと尾木直樹氏は、大川小学校での第三者委員会設置に際して、「第三者委員会はすぐにつくらないとダメですね。しかも、教育委員会でやるのではなくて、市長部局でやらなければいけません」（池上正樹・加藤順子著『石巻市立大川小学校「事故検証委員会」を検証する』ポプラ社刊・54ページ）と遺族らにアドバイスしている。　何故、市長部局でやらなければいけないかというと、教育委員会に任せると教育委員ではなく実権を持っている事務局主導で事が進められてしまう。教育委員会事務局には指導主事と呼ばれる教員籍の職員がいる。彼らは学校長・教頭経験者、あるいは候補生となる人々だ。　当然、日頃から指導主事は学校長らとは「ツーカー」の仲である。それどころか、指導主事経験は「先輩」という学校長もいて、現職の指導主事では、逆らえない力を持っている。　事実、大阪市立桜ノ宮高校で起きた自殺の調査でもそれが露見している。バスケットボール部の主将の少年が自殺した問題では、体罰があるという通報が大阪市教委事務局に事件以前に寄せられ、指導主事が学校現場に確認に赴いたものの、指導主事経験のある学校長から体罰に関する情報調査を協力してもらえず、自殺を防げなかった。指導主事が「指導」を諦めたことが原因の一つとなっていたことは、記者も大阪市教委事務局の担当者から直接確認している。　だが、尾木氏の言うように「市長部局」即ち自治体首長主導で第三者委員会が設置されても第三者委員会が疑惑隠しになる懸念は残る。一例を挙げると愛知県刈谷工業高校の部活トラブル（主に体罰）が原因で高校生が自殺しているケースがある。　次男・恭平君（当時16歳）を自殺で亡くしたという山田優美子さんによると、「事件に関する調査委員会が二回発足しました。一度目は県教委が立ち上げ、委員が全て匿名で，医師・弁護士・臨床心理士とだけ自称しました。これに抗議して、二回目は大村知事に直接陳情した結果、知事部局が新たな調査委員会を立ち上げ、委員も公表されました。しかし、報告内容は部室でトランプをしていた生徒を殴る蹴るをしたというのと、試合中にエラーをした生徒を正座させた。という2件のみ。実際には常態化していた教師の暴力は明らかになりませんでした」と話す。　2度も調査しながら機能しない「第三者委員会」。極論すれば、委員会は形骸化し、ケースによっては、「第三者委員会」は教育行政サイドが不祥事を覆い隠すために利用されているようにすらみえる。　福島県教育委員会の先週末のすばやい対応は歓迎すべきことだ。しかし、事件は、教師や監督者による体罰があった可能性が濃い。教育委員会という、いわば教師の身内によって作られた第三者委員会が真実を隠してしまわないことを祈りたい。'),(95,'強姦罪の下限引き上げなど、９日の法制審に諮問　性犯罪の厳罰化へ上川法相','soci','　性犯罪に関する法務省の有識者検討会の８月の報告書を受けて、上川陽子法相は２日の記者会見で、強姦罪の法定刑の下限引き上げや「親告罪」規定の撤廃など厳罰化に向けた刑法改正が必要として、９日の法制審議会に諮問すると明らかにした。　諮問は、法定刑の下限（３年）の引き上げや、被害者の泣き寝入りの温床とされてきた「親告罪」規定を撤廃し、被害者からの告訴がなくても強姦罪を問えるようにするとの内容。また、親子関係などを利用した性行為について、暴行や脅迫がない場合でも罪が問えるよう、法改正を目指す。　上川法相は改正に向けたスケジュールについては「現時点では答えられない」とした。'),(96,'（ニュースＱ３）マチュピチュと福島の「大いなる田舎」、なぜ友好提携？','soci','　「空中都市」として有名な世界遺産があるペルーのマチュピチュ村。友好都市にならないかという世界中からのラブコールを断り続け、初めて提携の相手に選んだのが福島県の大玉村（おおたまむら）だった。一体なぜ？　■観光地の礎、移民がつくる　大玉村は福島県のほぼ真ん中、安達太良山（あだたらやま）の裾野に広がる人口８５００人の村。農業が盛んで、「小さくても輝く　大いなる田舎」をキャッチフレーズに掲げる。住民に言わせれば「ちょっと地味な村」だ。　９月、マチュピチュ村との友好都市提携を発表する記者会見が大玉村の役場で開かれた。……本文：1,306文字この記事の続きをお読みいただくには、朝日新聞デジタルselectonYahoo!ニュースの購入が必要です。'),(97,'（Ｒｅ：お答えします）「障害者」と「障がい者」の違いは？','soci','　「障害者」と「障がい者」。紙面で二つの表記が混在していました。なぜでしょうか。（大阪市　男性　６３歳）　■引用元や取材相手からの要望を反映　パラリンピック選手の支援や育成など、国内の障害者スポーツの振興に当たる公益財団法人「日本障がい者スポーツ協会」は２０１４年３月、協会名の「害」を平仮名に変更しました。　「害」の持つ否定的なイメージを不快に思う人に配慮したからです。障害者に健常者よりマイナスがあるような印象も取り除きたかったといいます。　東京都大田区は０９年の地域保健福祉計画で、法令用語などは漢字で、それ以外の場合は平仮名で表記することとしました。……本文：773文字この記事の続きをお読みいただくには、朝日新聞デジタルselectonYahoo!ニュースの購入が必要です。'),(98,'（いちからわかる！）阿蘇山で噴火速報が出たね','soci','　■登山者（とざんしゃ）ら向けに４７火山で出す。スマホでも受け取れるよ　コブク郎　９月中旬の阿蘇山（あそさん）（熊本県〈くまもとけん〉）の噴火（ふんか）で初の「噴火速報（そくほう）」が出たね。　Ａ　気象庁（きしょうちょう）が今年８月から、２４時間態勢で観測（かんそく）する全国４７の火山を対象（たいしょう）に始めた。噴火していなかった火山では初めての噴火の時、阿蘇山のようにふだんから噴火を繰（く）り返している火山なら、規模（きぼ）の大きい時に速報するんだ。　コ　なぜ、始めたの？　Ａ　昨年９月の御嶽山（おんたけさん）（長野〈ながの〉・岐阜県境〈ぎふけんきょう〉）の噴火では、多くの登山者（とざんしゃ）が犠牲（ぎせい）になった。……本文：980文字この記事の続きをお読みいただくには、朝日新聞デジタルselectonYahoo!ニュースの購入が必要です。'),(99,'クラゲとカボチャのお化け、ゆらゆら水中競演','soci','　今月末のハロウィーンに合わせ、「エプソン　アクアパーク品川」（東京都港区）でクラゲとカボチャのお化けが“競演”している。　展示室では、円柱の水槽の中を漂うクラゲがオレンジや紫色など様々な色のＬＥＤライトで照らされ、カボチャのお化けのシルエットとともに壁や天井の鏡に映し出された。来場者は、ゆらゆら動くシルエットに楽しげな歓声をあげていた。３１日まで。'),(100,'〔JR西日本〕JR神戸線で平成28年春開業予定の2駅の駅名決まる','soci','JR西日本は2日、JR神戸線で平成28年春に開業を予定している2駅の駅名を決定したと発表しました。概要は以下のとおりです。■六甲道〜灘駅間に開業予定の新駅・駅名：摩耶(まや)・決定理由：「摩耶」は「摩耶山」に由来し、「摩耶埠頭」「摩耶インター(阪神高速)」など、近隣施設の名称に広く使用されており、なじみやすいため・設置場所：兵庫県神戸市灘区灘南通5丁目5番　六甲道駅から1.4km、灘駅から0.9kmの地点に設置■御着〜姫路駅間に開業予定の新駅・駅名：東姫路(ひがしひめじ)・決定理由：　全国的知名度がある「姫路駅」との位置関係を名称とすることで、場所がイメージしやすく、わかりやすい名称であるため・設置場所：兵庫県姫路市市之郷字高田1046-26　御着駅から2.4km、姫路駅から1.9kmの地点に設置'),(101,'報道への圧力発言問題、木原衆院議員の処分軽減','pol','　自民党は２日、党内保守系議員有志の勉強会「文化芸術懇話会」で報道機関への圧力を求める発言が相次いだ問題を巡り、１年間の役職停止としていた木原稔衆院議員の処分期間を３か月に軽減することを決めた。　処分は６月２７日付だったため、９月２６日に失効した。　谷垣幹事長は２日、党本部で記者団に「反省の情が顕著だった」と理由を説明した。木原氏は勉強会の代表としての責任を問われたが、報道圧力を求める発言は別の出席者らによるもので、党内から「処分が重すぎる」との声が出ていた。このため、執行部は１０月の党役員人事までに処分を解除する方向で調整し、木原氏が務めていた青年局長の後任を置かず、空席にしていた。'),(102,'茂木・自民選対委員長、来夏の参院選は「保守中道ｖｓ革新」　民主党も「革新」？','pol','　自民党の茂木敏充選対委員長は２日、宇都宮市内のホテルで講演し、共産党が提唱した「国民連合政府」構想にふれ、「来夏の参院選は自民党と公明党の保守中道路線がいいのか、共産党も含めた革新路線を選ぶのかという構図になってくる」と述べた。民主党など安全保障関連法に反対した野党勢力を「革新」と色分けして選挙戦にのぞむ考えを示した。共産党は、内閣不信任決議案を共同提出した野党５党が選挙協力し、暫定的な連立政権を樹立する構想への参加を呼びかけている。'),(103,'生活・小沢代表「野党統一名簿を」　来夏参院選の共闘呼び掛け','pol','　生活の党と山本太郎となかまたちの小沢一郎代表は２日、来夏の参院選での野党による比例代表統一名簿作成を呼び掛ける談話を発表した。安全保障関連法に関し「違憲立法を許すならば戦前の昭和史を繰り返すことになる」と主張し、「反安保法」を掲げる勢力による政権交代の必要性を訴えた。共産党提唱の「国民連合政府」構想についても「野党共闘に向けた大きな弾み」と高く評価した。'),(104,'安倍首相が帰国','pol','　米国、ジャマイカを歴訪していた安倍晋三首相は2日夜、羽田空港着の政府専用機で帰国した。　'),(105,'＜菅氏＞ミサイル発射は安保理決議違反　北朝鮮をけん制','pol','　菅義偉官房長官は２日の記者会見で、北朝鮮の李洙※（リ・スヨン）外相が事実上の長距離弾道ミサイルの発射を示唆したことについて、「ミサイル技術を使ったいかなる発射も、明確な国連安保理決議違反だ」と述べけん制した。北朝鮮に自制を促すため「米国や韓国などとしっかり連携しながら取り組んでいる」と語った。　北朝鮮は、朝鮮労働党創建７０周年の今月１０日に合わせた長距離弾道ミサイルの発射を示唆している。菅氏は発射の兆候について「コメントは控えたい」と述べる一方、「北朝鮮の動向については重大な関心を持って情報収集、分析にあたっている」と語った。　中谷元（げん）防衛相も２日の記者会見で「わが国の安全保障上、強く懸念すべきものだ」と指摘。「平和と安全確保に必要な情報収集・分析に万全を期していく」と語った。【高本耕太、飼手勇介】　※は土へんに庸'),(106,'自民、木原前青年局長の処分軽減','pol','　自民党は２日、党所属若手議員らの勉強会で報道機関に圧力をかける発言が相次いだ問題をめぐり、１年間の役職停止とした木原稔前青年局長の処分期間を３カ月に軽減することを決めたと発表した。６月２７日付だった処分は９月２６日付で失効となる。谷垣禎一幹事長は党本部で記者団に対し、軽減の理由について「反省の情が顕著なため」と説明した。'),(107,'「おおさか維新の会」結成を表明 橋下徹氏ら会見全文5','pol','動画URL：https://www.youtube.com/watch?v=60z3iK2KOIs　司会：はい。ではその後ろの方。「おおさか維新の会」結成を表明橋下徹氏ら会見全文1　──橋下代表にお伺いします。ダブル選で大阪都構想の再挑戦について問うということなんですけれども、それの大義についてなんですけれど、先ほど松井さんは大阪、会議で腹が立ったということをおっしゃったんですけど、とはいえ住民投票から半年で、もう1回問うということ。これについて住民にどのようにご理解を得ていくことでしょう。　橋下：これはね、報道も分かってくれてるところはだいぶ修正がかかってきたんです。日経なんかはだいぶ、だんだん分かってきてくれたなと思うんですけど、単純な再挑戦じゃないですから。大阪都構想、いいですか、どうですかって話はこれは最後の住民投票なんですよ。　これはずっと、堺市長選挙のときにもその話をしてたんだけれども、なかなかメディアが理解が足りなくて大阪都構想の是非を問う堺市長選挙だってなりましたけども、今、問うてるのは、大阪都構想の議論をもう全部完全になしにしてしまいますか、それとも議論は継続しますかっていう話なんです。で、いいかどうかの話は最後の住民投票ですよ。大阪都構想、イエス、ノーはね。　さっきも言いましたけども、東京都政っていうものが出来上るまでにも、1943年に東條英機が内閣で閣議決定をしたと。そこに至るまでで48年かかってるわけですよ。そういう話なんでね。だから、議論をもう完全に終了してしまうのか、それこそ議論はまだ継続してくのか。　で、じゃあなんで焦って住民投票、あんな5月17にやったんだと。法定協議会のあの進め方はおかしいんじゃないかといろいろ言われますけどもね、法定協議会は全部フルオープンにしてるから皆さんも分かってると思いますけども、僕らは4年前の大阪府知事、大阪市長選挙のダブル選挙の民意を受けて、これは一定、大阪都構想について議論を進めることについては理解を得たという思いで議論を進めました。法定協議会っていうものもつくりましたけどもね。　自民党や民主党、公明党、共産党はもう鼻から大阪都構想反対ということで議論に、まったく中身の議論に応じなかったわけですよ。だからこれはいろんなすったもんだがありましたけども、これは維新の会、最終的には単独で設計図はまとめて、そしてわれわれの任期中の間に1回、真意を問うということで住民投票やりましたけども。　なんにもない無から有をつくり上げようと思ったら、一歩一歩形を見せていかないと議論なんかできませんから。だからあのまんま住民投票をやらずにね、法定協議会をずっと延々続けていっても、これは皆さん、新聞者の社説と同じように延々議論だけ。結論出さずにずっと100年かかっても議論だけになってしまうわけです。政治家っていうのはわれわれは、実行してなんぼ、実現してなんぼ、結果出してなんぼですから、やっぱり要所、要所で。で、これは知事が常日頃言ってるように、任期の間にね、一定の結論を出す、一定の結果を出す、一定の形を見せるということで5月の17の住民投票。なんとかあそこまで持ち込みました。　いろんな、それは政治的な駆け引きもありましたけどもね。ただ、やっぱりあの設計図では、大阪都構想の設計図では不十分だという有権者の判断が下ったのでね、それは真摯に受け止めて、柳本さんたちが言ってた大阪会議というものでできるんだったら、じゃあそれで大阪の課題、解決しましょうよと思って、大阪会議にもわれわれは賛成したんですよ。　われわれは大阪会議には反対だったんですよ。でも、これは住民投票の結果を受けて、僕らはいったん賛成に回ったと。そしたら大阪会議では2重行政についてはどうもこれ、議論しないとか、2重行政についての結果は出さないというような話になってきたんでね、そしたら大阪都構想の議論はやっぱり継続していきますかっていうことをね、もう1回問うというのは当然のことだと思いますよ。　だからこれは大阪都構想がいいか悪いかじゃなくて、議論を継続するかどうか。だから議論してもらって、吉村さんが言うようにしっかり対話をしながらね、知事がいつも言うように膝詰め談判をしながらいろんな意見を聞いて、で、また何年か後にイエスかノーかの住民投票をやったらいいんじゃないでしょうかね。　だから柳本さんがそれに対して、それだったら大阪都構想の設計図、ポンコツだってこと認めるんですね、なんてことを言いましたけど、いやそれは、ポンコツを認めるも何も僕ら政治家なんですから、一定の形あるものを見せなきゃいけないから5月17で1回区切りを付けて、これでたたき台が、もう土台ができたわけですから、さらによりいいものにしていくためにこれから議論をしていきましょう、という、議論していきますかっていうのが僕らの問い掛け。　いやいやもう、大阪都構想の議論は要りませんよっていうんだったら柳本さんたちを当選させればいいと思います。ただ大阪都構想の議論やめたところで大阪会議では何も動かないってことがはっきりしてるし、大阪を副首都にするとか、それからリニアモーターカーを大阪に持ってくるとか、北陸新幹線を大阪に持ってくるとか、経済成長戦略を大阪で大々的にこれ、展開してくってことを考えたら、それは大阪府、大阪市が併存してるままではこれは絶対に無理です。大阪都庁っていうものが絶対に必要だってことになると思うんですけどね。こういうことをまたダブル選挙で訴え掛けていきたいと思いますね。'),(108,'「おおさか維新の会」結成を表明 橋下徹氏ら会見全文4','pol','　司会：すいません、どうぞ続けてください。　──すいません、その順序としましては、大阪都構想、大阪都ができてから副首都化を目指すと。「おおさか維新の会」結成を表明橋下徹氏ら会見全文5　橋下：いや、もうこんなのは同時並行でやらないと。そんなのこれだけ大きな大構想なわけですからね。順序立てて1個が完成してから次なんてやってたら何百年たって、何百年かかるか分かりませんから。同時並行でやっていきます。大阪都構想、行政機構の再編、大阪都庁をつくって、それから大阪の成長戦略ってものもしっかりこれは実行していきますしね。おおさか維新の会、国政政党・おおさか維新の会というものの政治力でね、この副首都というものを法律で定めていく。こういう働き掛けもやっていくし、ありとあらゆることを同時並行でやっていきますよ。　大阪を日本の、2眼レフの中の1つにする2眼レフ構造とか2極化とか、日本を2極化しなきゃいけないとか、みんな口では言うんですけど本気でやった人、いませんからね。言うのは簡単なんです。本気で今、やろうとしてるのが国政政党・おおさか維新の会でもあり、地域政党・大阪維新の会でもあり、今回の府知事選挙、市長選挙にこれ、おおさか維新の会として挑戦して、もう一度大阪都構想、大阪都庁というものをしっかり大阪につくっていく。こういうことで大阪を副首都にしっかり僕はもっていきたいと思いますね。　12月18までが僕の役割ですから、こういうことをしっかりと吉村さんのほうに受けてやってもらいたいと思います。　──4月の統一地方選で、京都にも維新の地方議員の方が複数人誕生したんですが、今回の新党に、いわゆる大阪以外の地方議員の方の参加を呼び掛けられるのかどうか、というのが1点と、あともう1点がその場合に、おおさか維新の会京都支部というイメージなのか、それとも各地域でローカルパーティーのようなものをつくってもらうイメージなのか、そういった参加とか連携の形についてお考えがあればお聞かせください。　橋下：大阪以外の地方議員にも参加してもらいたいと思いますよ。これは先ほども言いましたけども、漢字での大阪ではありませんから、平仮名のおおさかというのは、地方分権、東京一極集中の是正、その中央集権体制の打破、こういうものが込められた、ある意味象徴的な意味で平仮名のおおさかにしていますから、これは大阪の地方議員だけじゃなくて、京都の地方議員も、そのほかの地方議員も、みんな東京一極集中っていうものは、これは日本の国にとって良くないよねって必ずみんな思ってると思いますから、地方分権やっていかなきゃいけないと。ですからぜひ国政政党・おおさか維新の会に入ってきてもらいたいと思います。　で、そのときに国政政党のおおさか維新の会の支部には、それぞれ地域政党をつくったらいいんですよ。今、地域政党・大阪維新の会、僕は大阪維新の会で代表やってますけども、これは維新の党のもともとは、今もそうです、僕だけが離党してるので、今も維新の党の大阪支部が大阪維新の会になってるわけですから、各地方で国政政党・おおさか維新の会のそれぞれの支部として、地域政党・京都維新の会とか、奈良維新の会とかをつくって活動されればいいと思いますけどね。　──あとすいません、もう1点。京都では来年2月に京都市長選が予定されてるんですが、いわゆるそういう大阪以外の首長選に関して、候補者を立てられるのかどうかとか含めてお考えがあればお聞かせください。　橋下：それは国政政党・維新の会が出来上がって、そこでの幹事長とか選対本部長の判断になりますので、今、僕が言うことではないと思ってます。'),(109,'「おおさか維新の会」結成を表明 橋下徹氏ら会見全文3','pol','動画URL：https://www.youtube.com/watch?v=60z3iK2KOIs　──ちょっとお時間ないということなので、先に松井さんにまとめてお伺いしたいんですが、次のおおさか維新の会、国政政党・おおさか維新の会の共同代表は、松井さんと片山さんということでよろしいんでしょうか。「おおさか維新の会」結成を表明橋下徹氏ら会見全文4松井：まだ人事については、今日は今月中、先ほど代表をやりましたけど、10月24日をめどに、目途に、目標にということですから、人事については一切決まっておりません。　──今の考えの中では、ある程度そういうふうには考えていらっしゃるということですか。　松井：いや、これはまったく考えていません、今は。　──是々非々で国政に当たるべきだというふうにおっしゃってましたけども、安倍政権との距離感というのは、どういうふうに考えていらっしゃるんでしょうか。　松井：是々非々の距離感ですよ。これまでも中央政府である安倍政府と、地方政府であるわれわれ、まあ大阪府は僕が今、知事として仕事させていただいてる、橋下市長が市長として仕事してる。これはなんでもかんでもわれわれ、政府が言われたものを全部、おっしゃるとおりですと言ってきたわけでもないし、われわれはこういうことをやってほしいということはどんどん、政府に対しては強硬に提案してきたこともありますから。これはもうお互いのポジションの中で、やっぱり日本国が良くなる、大阪が良くなるというところの意見交換はやってきましたけども、べったり賛成だとか、なんでも反対だというようなことにはなりません。　──吉村さんに。柳本さんが出馬表明をすでに意向を固めていらっしゃいまして、橋下さんの仮面をかぶった候補だ、というふうにおっしゃってます。相手への印象とか、どのように戦っていくのかというのをお伺いできますか。　吉村：そう言われないように頑張っていきたいと思います。で、私の印象ですけれども、早々に共産党さんが支援をされ、そして先日のテレビ見ても公務員労組とかから受けるんでしょうかね。で、本人は自民党でありながら無所属で出られると。　私は本来、今回のこの選挙っていうのは、やっぱり政策の選択の選挙であるべきだというふうに思ってるんです。選挙をうまくやってやろうとか、もうそういうものではなくて、どちらの選択で政策が、より大阪の成長、発展、それから基礎自治のサービス、そういうところにふさわしいのかっていう政策選択の選挙であるべきだと思ってますんで、ぜひそういうところを戦わさせていただきたいなというふうに思ってます。ですんで、別に仮面と呼ばれるのはいいんですけれども、そこの政策のところで戦って、そして最終的にはやっぱり主役は大阪市民の有権者の皆さまだと思ってますんで、そこでしっかり判断できるような、そういったことをやっていきたいというふうに思ってます。　──最後にしますが、橋下さん、ダブル選は大阪市内を中心に応援に入られるのか、全般で松井さんと一緒に回るのか、今、現時点どう考えてらっしゃいますか。　橋下：これは選挙対策本部長の戦略で動きますけどもね、大阪市内に入ったら逆効果なんじゃないですか、僕がね。半分が反対なわけですからね。でも、これは選対本部長のいろんな戦略の下でしっかりやっていきます。自分の選挙以上にやっていきたいなと思いますね。だいたい柳本さんもね、なんか橋下の仮面をかぶった候補って、逆に吉村さんの仮面欲しいよ。こんな男前の仮面を。そんな僕の仮面って、そんなとんでもないですよ。'),(110,'「おおさか維新の会」結成を表明 橋下徹氏ら会見全文2','pol','動画URL：https://www.youtube.com/watch?v=60z3iK2KOIs　司会：よろしいでしょうか。それでは切り替えさせていただきまして、来月行われますダブル選挙に向けまして、大阪府知事選挙、立候補予定者、松井一郎より皆さまにごあいさつをさせていただきます。「おおさか維新の会」結成を表明橋下徹氏ら会見全文3　松井：いよいよ、来月に迫りました。11月の22日、大阪府知事選挙、市長選挙に向けまして、おおさか維新の会として、候補を擁立をするということを決定をいたしました。大阪府知事選挙の候補予定者は僕自身が、松井一郎自身が、引き続き知事を担わしていただきたいということで覚悟をいたしました。そして大阪市長選挙におきましては、今日、もう辞職をしてまいりましたけども、大阪維新の会、もう前衆議院議員になるわけですけど、吉村洋文元大阪市議会議員という形で、この2人が大阪知事選挙、市長選挙の候補として、維新の会の公認という形で戦いたいと、こう考えております。　今回のダブル選挙、なぜわれわれがおおさか維新の会としてこれ、戦うことになったのかということなんですけど、先ほど橋下代表からも話ありましたけど、5月17日、大阪都構想の設計図についてはいったん否決をされました。廃案になりました。僕も橋下代表も維新のメンバーといろんな話をする中で、廃案になったこと、否決をされたことを真摯に受け止めようと、謙虚になろうという形の中で、5月の17日以前は、この二重行政を解消して豊かな大阪をつくっていく。まさに東京との2極をつくる、その手段としては、大阪都構想でしかこれはなかなか難しいという考えの下、大阪会議というものは否定をしてきました。　しかしながら、5月17日に大阪都構想の現在の設計図は廃案になったわけで、そのときの民意、大阪市民の皆さんの声を、話し合いで解決できるんなら、大きな形で変えるんではなくて、まず話し合いで解決してよと、そういう声が多かったと、こう感じています。そういう認識でした。7月の末に大阪会議、第1回が開かれましたけども、まさに5月の17日の住民投票においては、大阪都構想の対案とされてたはずの大阪会議がまさにそれを主張していた自民党や民主党や共産党の皆さんから、この大阪会議は大阪都構想の対案ではないと。単に大阪の問題を話し合う会議体。また研究者を招いて、大阪の成長のための研究をしていこうとか、そういう話が7月の第1回の会議で提案されました。　これは僕は違うと思います。今、大阪に一番必要なのは、大阪の経済を成長させていく、大阪を豊かにしていくためには、まさに大阪の二重行政の解消。広域行政を一元化にして東京と切磋琢磨できるような、そのような行政の仕組みが必要なわけで。大阪会議で二重行政が解消され、広域の、一元化することを決定ができ、実行できるんであれば、何もダブル選挙を維新の会で僕たちは戦う必要はないと思ってたんですけど、まったく大阪会議なるものがそういうものではないということがはっきりした今、これもう大阪の成長のために、もう一度とにかく僅差で否決された大阪都構想の設計図を、住民の皆さまにどこを変えればいいのか。区割りについてどういうふうに思われてるのか。地域の名前について、区の名前についても、どういうご希望があるのか。そういうことを膝詰め談判で本当にきめ細やかな意見交換を3年間やらせていただきたい。'),(111,'「おおさか維新の会」結成を表明 橋下徹氏ら会見全文1','pol','動画URL：https://www.youtube.com/watch?v=JVT0A5BjjFI　大阪維新の会の橋下徹代表と松井一郎幹事長は1日午後、大阪市内のホテルで会見を行い、国政新党「おおさか維新の会」結成を発表した。橋下氏は冒頭から維新の党について「偽者の維新になってしまいましたから、本物の維新を作る必要があります」と語るなど、維新の党を痛烈に批判。今後は「徹底した改革をおこなっていく」と話し「これから国会議員を集めにかかります」「人数集めで声かけはしない」などと述べた。また「大阪を副首都にしたい」と意気込みも語るなど、約2時間にわたって今後の意気込みを述べた。THEPAGE大阪では、この会見の模様を全文で紹介する。「おおさか維新の会」結成を表明橋下徹氏ら会見全文2　司会：お待たせをいたしました。それでは、大阪維新の会、記者会見のほう、させていただきます。まず始めに、大阪維新の会、橋下徹代表のほうからお話しをさせていただきます。　橋下：先月の末ですかね、ちょっといろいろ維新の党といろいろありまして、離党することになりました。その際に今は党を割るようなことはしないということを、維新の党の国会議員向けにメールを出したことは間違いありません。ただそれは、9月中は日本の国にとって非常に重要な安全保障の法案ですね。これについての審議がありますので、9月の国会中は党を割ることをしないと。その思いがあり、今は党を割るようなことをしないということを維新の党の国会議員にメールをしました。言ったとおり、僕は今に至るまで維新の党を割ってはおりません。ただこれからは大阪府知事選挙、大阪市長選挙のダブル選挙もありますし、なんと言っても現・維新の党が、偽物の維新になってしまいましたから、もう一度本物の維新を作る必要があります。　われわれ大阪維新の会は、終始一貫して徹底した改革を行っていく。東京一極集中を改める。今の中央集権国家のこの仕組みを、多極型、地方分権型の国家体制に変えていく。そして大阪を副首都になんとか持っていきたい。日本の2つのエンジンの1つにもう一度持っていく、大阪を再生させていく。ただ大阪再生だけが目的ではありません。　やはり今、日本の極は東京一極、中央集権体制そのものですから、これを地方分権型の国に変えようと思えば、まずは東京に並ぶ2極をしっかり大阪につくって、さらにそこから道州制に向かい、地方分権型の日本の国の形をつくっていく。このために大阪再生、そして大阪の副首都化、大阪都構想というものをしっかり掲げた改革政党、本物の維新の会をもう一度つくる必要があると思いまして、目指すは10月の24日に結党大会を開く、今、準備に入っております。　これからは正式に国会議員を集めにかかりますので、維新の党の国会議員とは激しい政治闘争になるかと思いますけれども、これは日本の国の形を変えるために新しい国政政党、名称は「おおさか維新の会」です。大阪はひらがなで「おおさか」と書きます。おおさか維新の会、そういう国政政党を立ち上げていきたいと思っております。今の偽物の維新の党から、本物の大阪維新の会をもう一度つくり直すと。そういう気持ちで新しい新党をつくっていきたいと考えております。以上です。もし何か補足あれば。　松井：いや、もう。　橋下：質疑応答でいいです。'),(112,'ようやく？　今さら？　民主・岡田克也代表が「安倍談話」に反応','pol','　民主党の岡田克也代表は２日の記者会見で、安倍晋三首相の戦後７０年談話への受け止めをまとめた談話を発表した。　岡田氏は、首相談話を「引用や間接的表現が多く、安倍総理自身の考えや認識がはっきりしない」と批判。「歴史認識と和解の問題についてどう考えているのか国会で直接説明し、この節目の年に国民全体でしっかりと総括することが、日本の未来にとって必要不可欠」と結んでいる。　８月１４日の首相談話発表から２カ月が過ぎようとしているこのタイミングでの発表について、岡田氏は「本来であれば、お盆明けの（衆院）予算委員会の質疑、党首討論などで議論したいと思っていたが、機会がないまま国会も終わったので、（首相）談話について考えを示すことにした」と説明した。'),(113,'食品輸出7000億円突破へ＝中間目標前倒しの公算―林農水相','pol','　林芳正農林水産相は2日、東京都内で時事通信社主催のセミナーで講演し、今年の農林水産物・食品の海外輸出額の見通しについて「7000億円の大台がクリアできるのではないか」と述べた。　政府が中間目標として掲げる「2016年に7000億円」を1年前倒しで達成できるとの認識を示した。　政府は海外での日本食ブームを背景に、国産農林水産物の輸出を拡大する方針で、最終的に「20年に1兆円」の目標を掲げている。今年の実績は7月までに4136億円に達している。　林農水相は、訪日外国人客の取り込みにも言及し、「（訪日客が）2000万人になれば飲食費だけで1兆円のお金が落ちる。それをどう地域創生につなげるかが大事だ」と強調した。　セミナーでは、10月15日のJA全国大会を控え、各JAの先進的な取り組みを紹介した。特産品「市田柿」を地理的表示保護制度に基づき登録申請しているJAみなみ信州（長野県飯田市）の田内市人代表理事専務理事は「生産者の努力を所得として還元するため、地域農協として努力する」と語った。　'),(114,'慰安婦の記憶遺産登録に反対＝菅長官','pol','　菅義偉官房長官は2日午後の記者会見で、国連教育科学文化機関（ユネスコ）の世界記憶遺産に関する4日からの国際諮問委員会で、中国が申請した旧日本軍による南京事件と従軍慰安婦の史料の登録の可否が審査されることについて、「ユネスコの政治的利用に対する懸念を説明し、慎重な審議を行うよう強く申し入れている」と述べ、登録に反対する考えを改めて示した。　'),(115,'日韓防衛相会談「適切な時期に」','pol','　【ソウル時事】韓国を訪問した原田憲治防衛政務官は2日、白承周国防次官と会談した。　韓国国防省によると、両者は「適切な時期に」防衛相会談を開くことで合意した。　'),(116,'民主・小西洋之氏「自衛隊員は他国の子供を殺傷する使徒」　後にツイッター削除、差し替え','pol','　民主党の小西洋之参院議員は９月３０日、自身のツイッターに「自衛隊員の母親の望みも虚しく、自衛隊員は他国の子供を殺傷する恐怖の使徒になるのである」と記した。安全保障関連法反対の立場からの投稿とみられるが、２日現在この記述は削除されている。　小西氏の最初の投稿では、安倍晋三首相が９月末に行った国連総会の一般討論演説で、日本がシリア難民に支援した母子手帳に言及したことを紹介。首相が「わが子の成長に目を細める母のうち一体誰が、その同じ子が、成長したのち、恐怖の使徒となるのを望むでしょう」と述べた部分を逆手にとったようだ。　小西氏は１日のツイッターで、首相発言の紹介をそのまま残した上で、「安倍総理の安保法制により、自衛隊の集団的自衛権行使を受ける国の子供達は自衛隊員を『恐怖の使徒』と思うだろう。違憲立法から自衛隊員を救わなければならない」との投稿に差し替えた。'),(117,'北方領土交渉への影響懸念＝ロシアのシリア空爆で―政府','pol','　シリア情勢に絡み、日本政府内でロシアとの北方領土交渉の先行きに懸念が広がっている。　ロシアがシリア空爆をめぐり、米国との対立を先鋭化させているためだ。日ロが接近すれば米国が不快感を示すことは必至で、日本政府は米ロ両国のはざまで難しいかじ取りを迫られる。　過激派組織「イスラム国」への攻撃を名目とするロシアの空爆に対し、米国は同組織以外の反体制派の拠点を狙ったと反発している。　これに対して、日本政府のスタンスは定まらない。菅義偉官房長官は1日の記者会見で、「当事国でなく、状況を把握していないのでコメントを控える」と述べ、距離を置いていた。だが、2日の会見では「（米国の主張が）事実であれば、シリア情勢のさらなる悪化につながるものと懸念せざるを得ない」と語り、対ロ批判をにじませた。　安倍晋三首相は、ロシアのプーチン大統領との個人的な信頼関係を突破口に、北方領土交渉を動かしたい考え。そもそも米ロはウクライナ問題で対立しているが、「日米が全てで一致するわけではない」（外務省幹部）として、首相は米国の懸念をよそに、プーチン大統領の年内来日を模索する姿勢を崩していない。　だが、シリア空爆を機に、米国が日本の対ロ外交へのけん制を強めるのは間違いない。政府関係者は「ロシアに追い打ちをかけられた。ウクライナ危機に続いてシリア情勢と、領土交渉が国際情勢に翻弄（ほんろう）されている」と嘆いた。　'),(118,'「南京」「慰安婦」遺産申請、菅長官改めて批判','pol','　菅官房長官は２日の記者会見で、中国が国連教育・科学・文化機関（ユネスコ）の世界記憶遺産に「南京大虐殺の文書」と「慰安婦に関する資料」を申請していることを改めて批判した。　菅氏は「両国が関係改善のために努力している時期に、中国がユネスコを政治的に利用し、過去の一時期の『負の遺産』をいたずらに強調しようとするのは極めて遺憾だ」と語った。　中国による申請が行われた昨年６月以降、下村文部科学相や斎木外務次官らは、中国に対し、申請を取り下げるよう求めてきた。ユネスコに対しても、これまで安倍首相や岸田外相らが計８回、「中国側が提出した資料の信頼性に問題があるので、慎重に審査するべきだ」などと申し入れ、世界記憶遺産に認定しないよう求めている。'),(119,'平沼赳夫氏らの復党「安保関連法案に賛成いただいた」　菅官房長官','pol','　菅義偉官房長官は２日の記者会見で、次世代の党を離党した平沼赳夫、園田博之両衆院議員の自民党復党が了承されたことに関し、「今回の安全保障関連法について賛成をいただいた」と述べ、同法制の国会審議対応が判断材料の１つになったとの認識を示した。　菅氏は「両議員ともかつて自民党の中で活躍され、郵政民営化などで離党した」と袂（たもと）を分かった過去を指摘。その上で、安保法制への賛同を評価し「自民党としてさまざまな問題の中で判断され、復党が認められたと思う」と述べた。'),(120,'櫻井よしこ氏が民主党の「謝罪要求」を一蹴　送付文書の全文','pol','　ジャーナリストの櫻井よしこ氏が２日、民主党本部に送付した文書は次の通り。　　　◇　１０月２日　民主党役員室長近藤洋介殿　貴殿より再度の質問を受けとりました。　新たに加えられた質問も含めて、先日の私の回答文で説明が尽くされています。したがって、再度の回答は不必要だと考えます。　但し、今後とも民主党の安保政策に関しては論評を続けます。　　　　　　　　櫻井よしこ'),(121,'モスクワ五輪「ボイコットはスポーツ界の決定」鈴木長官','pol','　今月新設されたスポーツ庁の初代長官に就任した鈴木大地氏（４８）が２日の記者会見で、日本が１９８０年モスクワ五輪の不参加を決めた経緯について、「政治が介入してきてボイコットしたということになっているかと思うが、最終的に決めたのはスポーツの人たち自身」と発言した。　アスリート出身の鈴木氏の長官就任によって国とスポーツ界の関係がどう変わると思うか、という記者の質問に答えた。「（当時は日本体育協会傘下にあった）ＪＯＣ（日本オリンピック委員会）の中で、参加すべきかしないべきか、結局自分たちで選んだ。スポーツ人たちが『出ない』と多数決で決めた」と説明した。　さらに国連総会が昨年、スポーツの独立性を認め、政治による干渉を抑止する決議を出したことを挙げ、「（スポーツ庁発足によって）確かに国の指導が強まったと言われても仕方ないかと思いますが、スポーツの自治、独立性は保たれていくと思う」と話した。　モスクワ五輪は、前年のソ連によるアフガン侵攻に反発した米国が不参加を表明。米国に追従した日本政府による補助金カットなどの圧力に屈し、ＪＯＣ（日本オリンピック委員会）が不参加を決めたとされている。これを教訓にＪＯＣは８９年、体協から独立した。'),(122,'「初代新党代表は橋下氏」松井氏明言　本人も「拒む理由ない」','pol','　国政政党「おおさか維新の会」の結党を表明した地域政党「大阪維新の会」の松井一郎幹事長（大阪府知事）は２日、新党のトップについて、大阪維新代表の橋下徹大阪市長が「初代代表になる」との見解を示した。大阪府庁で記者団に答えた。　松井氏は同時に「国政政党として（国会での）党首討論などの規定があるので、国会議員の共同代表は必要になる」と言明。また、橋下氏が１２月の大阪市長任期満了をもって政界引退の意向を示していることから、橋下氏の次の代表は「選挙で選ばれるのが普通の手続きだ」との認識を示した。　橋下氏は１日の記者会見で、初代代表について「権限に制限のある仮取締役みたいなものだが、誰がやるのと言ったら僕がやらざるを得ない。言われれば仮代表みたいなことは拒む理由はない」と述べていた。新党の結党大会は２４日に開かれる予定。　一方、松井氏は、難航している維新の党との協議について「結党までにはきれいな形で分かれた方がいいと思う」と語った。　党分裂をめぐっては、維新の党の松野頼久代表らが、党名変更や、政党交付金を双方に分配する「分党」を拒否する姿勢を示している。橋下氏は２日の会見で「名前からお金から、全部がめるんだったらそんな人たちです。有権者が一般常識で判断しますよ。お天道様は見ている」と松野氏らを痛烈に批判していた。'),(123,'１８歳選挙権、副教材を配布へ　教員には中立性を強調','pol','　文部科学省と総務省が、選挙や政治について学ぶ高校生向け副教材と教員用の指導書をつくり、２９日に発表した。選挙権年齢が来夏の参院選から「１８歳以上」に引き下げられるのを前に、模擬選挙や討論を通じて学ぶ内容だ。指導書では教える際に「政治的中立性」を守るよう強調し、教員に慎重な対応を求めた。　副教材は、高校生が社会や政治に参加する意欲を育もうと約３７０万部作られた。年末までに全国の高校に配られるが、教科書とは違い、各校が内容を選んで公民科の授業などで使う。全１０４ページのうち６０ページが議論や体験活動に割かれた。　例えば模擬選挙については、架空と現実の２種類を想定。架空のケースでは、大学生らの扮する「候補者」が示す政策を評価し、投開票する方法を紹介した。現実の選挙を題材としたケースでは、選挙公報や新聞などから分かる政策を関心分野ごとに抽出・比較するページを設けた。'),(124,'記憶遺産「中国はユネスコの場を政治利用」　菅官房長官が批判　「いたずらに負を強調」','pol','　菅義偉官房長官は２日の記者会見で、中国政府が国連教育科学文化機関（ユネスコ）の世界記憶遺産に南京事件と慰安婦の歴史資料の登録を申請していることに関し、「日中間の過去の一時期の負の遺産をいたずらに強調しようとしていることは極めて遺憾だ」と強い不快感を示した。　菅氏は「日中両国が関係改善のために努力する必要がある時期に、中国がユネスコの場を政治的に利用している」と牽制。外交ルートを通じて昨年６月に中国政府に抗議し、申請の取り下げを求めてきたことを説明した。'),(125,'東京五輪施設で諮問会議＝「新国立」教訓にコスト点検―都','pol','　2020年東京五輪・パラリンピックに向け東京都が整備する七つの競技施設について、舛添要一知事は2日の記者会見で、施設性能やコストが妥当かをチェックしてもらうため、有識者による諮問会議を設置すると発表した。　整備費が膨れ上がり計画が白紙撤回された新国立競技場の教訓を踏まえた。　諮問会議は建築や土木、法律、スポーツ分野の有識者7人で構成。9日に初会合を開く。基本設計が終わっている競泳会場「オリンピックアクアティクスセンター」（江東区）など3施設のチェックを先行。他の4施設も基本設計が固まった段階で点検に着手する。　舛添知事は「新国立が白紙撤回になったプロセスの反省の上に立って、同じ轍（てつ）は踏まない」と語った。　'),(126,'竹島、日本海の呼称 --- 青木 亮','pol','以下は井沢元彦「逆説の日本史14巻近世爛熟編『文治政治と忠臣蔵の謎』P168-182」から要約したものである。(京の)堀河に酒屋太郎衛門というものあり。(中略)家に久しく使う高麗人の女あり。それを女房にして子を生む。姉は大宮蔵入入道宗雅が室、その妹が館林の母公慶昌院殿なり。この姉妹ともに春日局に同道して東行、姉は御意に入らず、妹が残りて館林殿を生めり、以下略(『遠碧軒記』日本随筆大成　吉川弘文館刊)ここで館林というのは後の五代将軍綱吉のこと。当時綱吉は館林藩主だった。つまり綱吉の母は日朝混血児であったから綱吉には四分の一朝鮮人の血が入っていたことになる。このため綱吉は朝鮮外交で非常に宥和的であった。綱吉時代の日本の外交政策が今に至る「竹島」問題の起点になっている。韓国慶尚北道海岸から140キロの地点に鬱陵島(旧竹島)がある。朝鮮は倭寇対策のためこの島を無人島として朝鮮人の上陸を禁じた。それに乗じて多くの日本漁民がこの島に進出するようになった。その中漁民大谷甚吉が鳥取藩に正式の渡航許可を申請し同藩はそれを許可した。そして幕府は鎖国完成後もこの渡航許可を撤回していない。つまり鳥取藩も幕府もこの島は日本領だと認識していた。　元禄頃、朝鮮漁民もこの島を訪れるようになり日朝漁民の間で紛争が生じた。日本側は話し合いのため朝鮮漁民の一人安龍福という男を鳥取に連行した。結局日本側が譲歩し鬱陵島は朝鮮領で決着した。ここまではいい。ところが朝鮮は鬱陵島から92キロも離れた松島(現竹島、当時は松島)を鬱陵島と一体をなすものとして領有権を主張して今に至っている。だが日本側の認識では「松島」は鬱陵島とは別個の島であり、当時もその後も日本漁民が渡航し実際に支配していたし、幕府もそれを承認していた。日本側にも問題があった。明治38年松島を島根県に編入する際、それまでの松島を「竹島」と称した。それが鬱陵島(旧竹島)は朝鮮領であることを日本は認めていたのではないかと朝鮮が主張する隙を与えたのではないか。「綱吉暗君説」が学界の通説であるのに反し、井沢は「綱吉名君説」を唱えている。だがこの「竹島問題」処理では朝鮮に譲りすぎたと批判している。それには綱吉が朝鮮人の血をひいていたことが影響していたかもしれないとの説。'),(127,'沖縄米軍基地問題に解決はあるのか？ --- 岡本 裕明','pol','先日、翁長雄志沖縄県知事が国連の人権理事会で名護市辺野古に移設を進める米軍基地について強い懸念を表明しました。日本政府はこの夏、工事を一か月間止め、菅官房長官自らがその先頭に立ち、翁長知事と会談を重ねましたが、平行線のままで終わり、政府と沖縄県知事の確執は決定的な状態になっています。非常に悩ましく思います。在日米軍基地は北海道から沖縄まで各地に存在し、東京周辺でも横須賀、座間、立川、更には麻布ヘリポートなどというものもあり、見方によっては沖縄ばかりに集中しているとも言いがたいところもあります。東アジアに於ける日本の国防を見ると対ロシア、朝鮮半島、中国がその防御対象となりますが、特に東シナ海は中国海軍が太平洋に出ようとするのを防ぐ重要な生命線となります。更に中国は東シナ海の微妙な位置でガス田の開発を進め、尖閣についても最近は話題になりませんが、相変わらず高いレベルの「来船」を保っています。つまり、日本の自衛、国防という観点からすると沖縄は戦略的位置であることに疑う余地はありません。国防の役割を他県に移しにくいという宿命がそこにあります。そしてその防衛は日米地位協定に基づき、米軍と共に安全保障を担うことになります。翁長知事の主張はなぜ、沖縄だけが苦しめられなくてはいけないのか、ということでありますが、日本政府も米軍も沖縄に嫌がらせをしているわけではなく、重要な戦略的要素がある故であります。そんな中、翁長知事が国連に先立って行われたシンポジウムでの発言が気になります。「沖縄が独自の言語、文化を持つ独立国だった点を説明し、1879年に日本の一部となった琉球処分や、戦後の米軍基地建設など、『自己決定権が侵害された』歴史への理解を求めた」（毎日新聞）の一説であります。翁長知事のこの発言はいわゆる民族問題を明白に提示するものであり、民族的差別観を持って日本国政府との対峙を進める戦略のようにも思えます。沖縄を「琉球民族」と称する説もありますが、学術的には明白になっていないと理解しています。それをあえて区別化し、先住民的地位の主張をするとなるとほぼ単一民族日本に於いて歴史上あまり例をみない問題に展開することになります。日本で民族問題が起きるとそれに悩む中国はほくそ笑むし、その不和に乗じて中国が沖縄に接近することは大いにあり得るでしょう。事実、知事は4月に李克強首相と面談しています。その点からすれば翁長知事の発言は極めて慎重に検討、対応する必要があります。カナダやアメリカでは先住民の権利を尊重する姿勢が高じて今では「腫れ物に触る」ような状態になっていることは正直、国家の統一感に極めて異質な空気を作り上げています。逆説的な論理になりますが、沖縄を満足させるには米軍が退去し、日本の自衛隊ががっちりそこを抑え、守るというシナリオになりますが本当にそれを望んでいるのでしょうか？それで本当に守れるのでしょうか？知事の民族的地位の利用はふさわしくないアプローチであるとともに歴史に遺恨を残します。知事は徹底抗戦を考えているようですが、法的に勝ち取るのはなかなか難しいように思えます。米軍で悩んでいるのは沖縄の人たちだけではありません。そこは理解して頂かねばならないでしょう。もう一つ、不動産を専門とする者として一言付け加えると「住むところは個人の選択」であります。これを言うと10中8，9の方はなんで俺が動かなくてはならないのだ、とおっしゃると思います。北米的なドライな見方と言われるかもしれませんが、嫌なところで我慢するなら新天地に動くのはその人の人生をよりハッピーにしないでしょうか？非常に難しいテーマでありますが、対話を通じて少しずつでも前進していくことが重要でしょう。政府と沖縄の間に立つ裁定人の選定というアプローチも考えた方がよさそうです。今日はこのぐらいにしておきましょう。岡本裕明　ブログ　外から見る日本、見られる日本人（http://blog.livedoor.jp/fromvancouver/）　9月30日付より'),(128,'安倍首相のワースト決定　ドン小西が私服をファッションチェック〈週刊朝日〉','pol','　安全保障関連法案が成立した翌９月20日、山梨県へゴルフに行った安倍晋三首相。ファッションデザイナーのドン小西氏は、最悪のコーディネーションだという。＊　　＊　　＊　あれだけ揉めに揉めた安保関連法を通した直後だろ。壮絶な戦いを終えた勝者のエレガントなたたずまいを期待してたんだよ。ところがだ。プライベートとはいえ、この少年みたいな半ズボンファッションってどうよ。　ま、半ズボンは正式なゴルフウェアではあるんだよ。ただし、ハイソックスでなるべく足を隠すのが本当のルール。今は、足を出す人も増えてきたけど、それでも許されるのは、せいぜいセミが鳴いてるような真夏だけだよね。かと思うと上半身は、ポロシャツの袖から長袖の薄手のインナーを出す、秋らしい重ね着コーデ。これってゴルフ中継でも、プロがよくやってるだろ。高機能素材のインナーは動きやすいし、冷えないし。プロにはいいけど、日曜ゴルフのお父さんがマネすると、ダサいだけなんだって。　しかもこの日安倍さんは、日本でもっとも注目されたゴルファー。ここは機能よりビジュアル優先で、グレーのパンツとポロシャツに、ネイビーのニットを合わせるくらいはしてほしかったよな。過去の安倍さんのファッションでも、こりゃあ、ワースト決定です。※週刊朝日　2015年10月9日号'),(129,'［Japan In-depthチャンネルニコ生公式放送リポート］【安保法案成立、これから日本はどこへ行く】〜中野晃一上智大学教授に聞く〜','pol','可決されるまでの間、国会前で多くの国民が反対デモに参加し、国会では軸のぶれた議論が行われ、荒れに荒れた様子が報道された。今回のJapanIn-depthと週刊朝日のコラボ放送では、安保法案を巡って見えたデモ参加者や国会議員の姿を踏まえつつ、安保法案可決により、今後の日本がどのように変化するのかを議論する。ゲストには、上智大学国際教養学部教授中野晃一氏週刊朝日記者古田真梨子氏を招いた。国会前のデモの様子は、連日メディア各社により報じられた。なぜこれほどまで多くの人がデモに参加したのか。中野氏は「組織的な動員ではなく、老夫婦や子連れなど、多様な世代が参加できたのは、デモ主催者の雰囲気作りが功を奏したからと言える。もちろんデモ参加者の誰もが安保法案に対して怒りを抱いていたが、それと同時に彼らは、自分の意見を主張できる場ができたという喜びを見出していたのではないか」と指摘した。また「若者の力が大きく影響したのか」というAyaの質問に対し、「きちんと勉強した学生が、自分たちの言葉で演説をした。その姿に、学生でない層も鼓舞され、多様な年齢層の参加を促したと言える」と答えた。国会前のデモが活発に行われたのに対し、国会内の議論は低迷した。「安倍総理の政権運営は妥当だったか」と安倍編集長が尋ねると、中野氏は「違憲立法というスティグマを初期の段階で拭えず反対意見を強めたこと、そして与党が『安保法案のメリット』ばかりを訴えたことにより、議論が深まらず、法律としても国会答弁としても生煮えなまま終わってしまった」と述べた。また安倍編集長が「与党の軸がぶれる一方で、野党が対案を出さなかったことも問題だったのでは」と指摘すると、中野氏は「世論調査よる反対意見が大きかったため、野党は反対せざるを得なくなった。法案の修正協議でも対案は採用されなかったが、修正協議には安倍首相寄りの野党議員が多く参加したため、自民党によって形を整え行われたにすぎない」と指摘した。今回の安保法案成立で行われた「解釈改憲」は、戦後70年の間に政府が行った解釈とは異なる。中野氏は「解釈改憲そのものは悪いとは思わないが、今回の解釈改憲は9条の縛りを超えてしまっている。違憲かどうかが議論されてきた自衛隊も、9条に沿った活動により国民に受け入れられてきた。今回の解釈改憲で、『何でもあり』が許されるのではないか」と懸念を示した。また中野氏は、「自衛権は9条に反していない」と自衛隊は合憲とした上で、「日本を侵害していない国と日本との交戦権を認める集団的自衛権は、明らかに9条に反する。憲法の議論を置き去りにし、違憲な法律を成立させたのちに憲法を変えようとする与党の姿勢は、立憲主義という観点から問題がある。」と見解を述べた。集団的自衛権の是非に関して、安倍編集長が「日米安保条約があったからこそ、これまで日本は平和だった。アメリカにとって、日本が集団的自衛権を持たないのはアンフェアなのではないか」と言うと、中野氏は「これまでの国際社会で集団的自衛権が行使された例はベトナム戦争やアフガン侵攻など。アメリカに従属的な今の日本が、アメリカからの戦争参加の要請に反対できるとは思えず、専守防衛とは異なる戦争をする危惧がある」と述べた。衆参合わせて200時間かけられたが、本法案は議論が深められたとは言えない。議論が足りないのではなく、そもそもこの法案が何かがわからないまま可決されたのは、「（政権が）建設的な議論をする気がない現れ」と中野氏は指摘する。では、どうすれば国会が建設的な議論をする場になるのか。議論では与党が総理大臣候補を後継者として育てる、女性を大臣に積極的に登用するという意見が出たが、中野氏は「一回生・二回生という若い層の女性議員を増やすことが、ゆくゆくは国会の議論を変えるのではないか」と述べた。安倍編集長は「女性の登用も重要だが、今回デモに影響を与えた若者たちが、地方議員選挙に立候補し、硬直化した地方議会を変える力になれば、日本は変わるのではないか」と主張した。（この記事は、ニコ生【JapanIn-depthチャンネル】2015年9月30日放送　を要約したものです）'),(130,'NHKでも紹介された「安保法案賛成デモ」美女軍団の正体〈週刊新潮〉','pol','　まさか官邸から文句を言われないように、なんて考えたわけでもないだろうけど……。さすが、NHKは、安保関連法案に関する報道に際してもバランス重視である。法案の採決が近くなって、賛成派の街頭演説を紹介した。しかも、街宣車に乗っているのは美人の女性が4名。彼女たちは一体、何者か。　＊＊＊　彼女たちが集会を開いたのは9月12日のこと。NHKは、翌日のニュースで、〈集会は法案に賛成する人たちで作るグループがツイッターなどで呼びかけ開いたもので、新宿駅前には主催者の発表でおよそ200人が集まりました〉　と紹介した。集会では、「YES！安保法案」と書かれたうちわなどを手にする人や、日の丸を掲げる人の姿も見られたという。「安保関連法に反対するママの会」は知られているが、彼女たちは「守ろうニッポン!!」（通称・まもにち）という団体のメンバーなのだ。「発起人は、今年40歳になるごく普通のOLです。12日も私と一緒に街宣を盛り上げてくれました」　と説明するのは、広報担当の橘紅葉さん。「反対派がメディアで取り上げられる中、賛成派もいるのにと思ったのが、会を作るきっかけ。それから、彼女が友達を集め始めたのです。コアメンバーは12名。私自身は、小学生の娘を持つ母親です。政治や歴史に関するブログも書いています」　ネット上では、幸福の科学や生長の家と関係があるのではないかと囁かれているが、全く関係ないとか。　ある公安関係者も、「民主党政権時、尖閣諸島を巡る問題、長引くデフレ不況などを受け、民主党本部前で座り込みの抗議活動を行う人たちが現れた。その人たちも、『まもにち』に入っているようだが、背後に特定の政党や宗教団体はいない。ごく普通の人たちの集まりと見ています」　発起人の女性の素性は今のところ明かせないという。「12日の街宣が終わってから、恐らく反対派の方だと思うんですが、メンバーが後をつけられたそうです。何か起きた場合は、誰も責任を取れませんからね」（橘さん）　最後に「反対するママの会」については、「ママの会には、中核派の人がいたりしますよね。そういう人が一般メディアで紹介されていることには驚きます。ママの会の人も私たちも、子供を大切に思う気持ちは一緒。また、今回活動してみて、リスクが伴うこともわかりました。ですから、彼女たちの全てを否定するつもりはありません」（同）　さて、今後、サイレントマジョリティを盛り上げる活動となるか。【特集】「狂躁『安保法制』の後遺症」より※「週刊新潮」2015年10月1日号'),(131,'高市・中谷氏続投へ＝内閣改造、閣僚交代は10人以下―安倍首相帰国、調整本格化','pol','　安倍晋三首相は7日に行う内閣改造で、高市早苗総務相、中谷元防衛相を留任させる方針を固めた。　麻生太郎副総理兼財務相や菅義偉官房長官ら主要閣僚の続投が既に内定しており、交代は10人以下となる見通しだ。首相は2日夜、米国、ジャマイカ訪問から帰国。改造に向けた調整を本格化させる。　高市氏は、社会保障と税の共通番号（マイナンバー）制度の運用開始を来年1月に控えていることに加え、「女性の活躍」を引き続き実践する狙いから留任が固まった。中谷氏は、安倍政権最大の課題だった安全保障関連法の成立に尽力。同法に基づく自衛隊の運用変更に向け、続投が適当と判断した。　首相は麻生、菅両氏のほか、岸田文雄外相、塩崎恭久厚生労働相、甘利明経済財政担当相、石破茂地方創生担当相、遠藤利明五輪担当相を留任させる方針。残りの閣僚枠について、派閥の意向にとらわれず「老壮青」のバランスを考慮して人選を進める。新設する「1億総活躍担当相」に関しては「突破力」を重視する考えだ。　続投する閣僚が多い中、入閣適齢期を迎えている自民党の「待機組」の処遇も焦点となる。　7日は午前に、留任する谷垣禎一幹事長ら党役員人事を決定。これを受け、政府は正午ごろ臨時閣議を開き、現閣僚の辞表を取りまとめる。公明党の山口那津男代表との与党党首会談を経て組閣本部を設置、同日夕には第3次安倍改造内閣が発足する運び。　'),(132,'健保組合7年ぶり黒字＝高齢者医療負担が最高更新―14年度決算','pol','　健康保険組合連合会は2日、大企業の社員とその家族が加入する健康保険組合の2014年度決算見込みについて、1409組合の合計で636億円の経常黒字だったと発表した。　黒字は7年ぶり。ただ、高齢者医療への拠出金の額は3兆2794億円（前年度比55億円増）と4年連続で過去最高を更新。組合財政への重い負担となっており、今後も保険料率の引き上げを迫られる組合が出る見通しだ。　'),(133,'平沼、園田氏の復党了承＝木原氏処分、3カ月に軽減―自民','pol','　自民党は2日、党本部で党紀委員会（山東昭子委員長）を開き、平沼赳夫、園田博之両衆院議員の復党を了承した。　また、党紀委の席上、谷垣禎一幹事長は、若手議員の勉強会で報道機関への圧力を求める発言が出た問題に関し、木原稔衆院議員の役職停止処分を1年間から3カ月間に軽減し、既に期間を満了したと報告した。　'),(134,'ゴルゴ13に撃たれる？　＝麻生氏似の財務相登場にご満悦','pol','　「麻生太郎がゴルゴ13に撃たれるのか（後編を）楽しみにしている」―。　麻生太郎財務相は2日の記者会見で、愛読する漫画「ゴルゴ13」に、自身に似せた日本の財務相が登場したことに、ご満悦の様子だった。　雑誌「ビッグコミック」（小学館）に連載中のゴルゴ13は、人並み外れた狙撃の腕を持つ国際テロリストの活躍を描く人気漫画。　最新号は、米国のファンドを運用する女性が、国債の売買を武器に日本政府に戦いを挑む前編。麻生氏似の「高津財務相」が国会で、日銀の国債買い入れは財政赤字の穴埋めだと追及されるシーンも出てくる。　外国人投資家に日本国債を売り浴びせられるという政府にとって考えたくない事態がテーマだが、麻生氏は「国際金融に対する関心が高まるのはいいことだ。（作者の）さいとう・たかを氏に礼状でも書こうか」と、終始口は滑らかだった。　'),(135,'15年産米、平年並み＝東北、北海道が良好―農水省','pol','　農林水産省は2日、2015年産米の作柄概況（9月15日現在）を発表した。　単位面積当たりの収穫量を示す作況指数（平年＝100）は100の「平年並み」だった。九州を中心とする西日本の作柄は、台風や低温、日照不足で軒並み「やや不良」だが、主要産地の北海道や東北がおおむね天候に恵まれ、いずれも「やや良」とカバーした。　記録的な豪雨で河川が決壊するなどの被害に見舞われた茨城県は、8月15日時点で「やや良」だった作柄が一変し、「やや不良」に落ち込んだ。農水省は、把握できた豪雨被害については影響を織り込んだが、まだ状況が分からない部分もあり、「確定とは言えない」（生産流通消費統計課）と話している。　'),(136,'小沢一郎氏、参院選は野党各党の統一名簿で戦うべき','pol','　生活の党と山本太郎となかまたちの小沢一郎共同代表は２日、「政権交代こそ野党連携の最大の目的」と題した談話を発表し、野党各党が来年の参院選で、統一名簿をつくった上で臨む「オリーブの木構想」で戦うべきとの持論を示した。　小沢氏は「野党連携のための最善の策は何か。各党が解党して１つの党をつくることだ」と提言。ただ現段階では現実的ではないとして、「次善の策」として、「オリーブの木構想」を、プッシュしている。　「オリーブの木構想」とは、選挙時に届け出る母体の政党を、既存の政党とは別に立ちあげ、各党の候補者が母体の政党に個人として参加、選挙に臨むというもの。小沢氏は、所属政党を離党したり、既存政党を解党する必要がないメリットをあげ、「来年の参院選をこの方法で戦えば、１人区はほぼすべて勝利し、比例区と合わせてかなりの議席を取ることができるはず」と主張。参院で、野党がある程度の議席を獲得すれば「自民党も先の国会のような乱暴なことができなくなる」と指摘している。　そのためには、「『自分を捨てる』『自分を殺す』という利他の精神が必要」とし、「『オレがオレが』と主張していては、大事を成就できない」とも述べた。「野党はそのくらいの気概をもって参院選に臨み、次の総選挙で政権を取る道筋を国民に示すべきだ」とも強調している。　小沢氏は、野党による暫定的な連立政権を提唱した共産党に関し、「『安保法制廃止の国民連合政府』で一致する野党の選挙協力を提唱したことは、野党共闘に向けた大きな弾みとなり、私たちは高く評価している」と指摘。「政権獲得を目指さない政党の離合集散は、単なる子どもの遊びになってしまう」と、危機感も示した。　また、安全保障関連法を成立させた安倍政権を「今また戦前の道へと突き進み、国民の命と生活を脅かしている」と厳しく批判。「こうした事態を避けるためのシステムが民主主義」と述べ政権交代の必要性を訴え、「現在、自公に代わる政権の受け皿がありません。政権交代を現実のものとするためには、何としても野党が連携していくことが不可欠です」と主張した。　小沢氏は先月下旬の国会閉会後、定例の記者会見も開いていないが、野党連携に向け、水面下で動いているとみられる。共産党の「野党による国民連合政府」提唱や、維新の党の「東西分裂」など、野党各党に動きが出てきたタイミングをとらえて、野党結集の必要性をあらためて強調した。'),(137,'（マイナンバーＱ＆Ａ：上）「番号通知」届いたら　今月中旬から来月末、各戸へ郵送','pol','　マイナンバー法が５日施行され、１０月中旬から１１月にかけて、日本で暮らす一人ひとりに割り振られるマイナンバー（社会保障・税番号）の通知が届く。開始にあたって知っておきたいポイントを、２回にわけて紹介する。　■勤務先にナンバー届け出　――そもそも、マイナンバーってなに？　住民票を持つすべての人に付けられる１２桁の番号だ。外国人や在日韓国・朝鮮人などの特別永住者にも割り振られる。政府がもっている税や社会保障に関わる個人の情報を番号で結びつけ、所得を把握しやすくするのがねらいだ。　――マイナンバーはどのように知らされる？　１０月５日時点で住民登録している住所あてに、家族ごとにまとめて、マイナンバーを印刷した「通知カード」が郵送される。……本文：1,295文字この記事の続きをお読みいただくには、朝日新聞デジタルselectonYahoo!ニュースの購入が必要です。'),(138,'武雄市図書館で是非　なぜ東京・千代田区で「民間委託」が機能したか？','pol','　佐賀県の武雄市図書館を運営するCCC（カルチュアコンビニエンスクラブ）が、図書館の蔵書を充実させるために系列の古書店から本を購入していたことに対して、批判する声があります。武雄市の例を受けて、こうした図書館運営に「指定管理者制度」はそぐわないという見方も出る一方、サービス充実につながっている自治体もあります。東京都千代田区です。それはなぜでしょうか？　指定管理者制度とは、地方自治体の公の施設の管理運営を、民間事業者やNPO法人など幅広い団体に委託できる制度。これまで委託先は公共的な団体などに限られていました。　武雄市は2013年に市立図書館に同制度を導入して、CCCに運営を委託しました。CCCに委託した初年度、来館者は92万人に増加し、滑り出しは順調でした。ところが、ここへきて問題が表出してきています。CCCが購入したのは佐賀県や武雄市とは関係性が乏しい埼玉県のラーメン本や10年以上も前に出版された資格試験の本だったのです。稀覯本や貴重な郷土資料ならば、図書館が購入する意義はあるでしょう。しかし、図書館が新たに購入するにはふさわしくない本だったことから、図書館運営に疑問が呈されるようになったのです。　こうした問題は神奈川県海老名市でも起きています。そうしたことから、経営効率を追求する同制度は図書館に向いてないとする指摘もあります。　しかし、武雄市よりも早くから図書館に導入している自治体があります。それが東京都千代田区です。東京都千代田区は、2007年から区内に4館ある図書館の経営を民間事業者に委託しています。また、都立図書館だった日比谷図書館は2009年に千代田区に移管されましたが、2012年から民間事業者に運営を委託されています。全図書館の運営を指定管理者に任せている千代田区ですが、武雄市のような問題は発生していません。「指定管理者制度を導入するときは、貸出率や経営効率を上げようという意見も出ました。しかし、千代田区は出版社が多く立地している自治体です。そのため、編集者や作家といった人たちが図書館を頻繁に利用しています。また、日本有数の古書店街である神田神保町もあります。いわば、千代田区にとって出版は大事な産業であり文化でもあります。図書館も出版文化を担う施設ですから、経営効率を求めるものではないという考えに至りました」（千代田区文化振興課）　千代田区が図書館を重要な施設として捉えていることは予算からもうかがえます。指定管理者制度を導入する前の2006年の図書館の経費は、約2億7000万円。民間委託を開始した2007年は、3億6000万円。同制度を導入しても図書館にかかる経費は増加しているのです。　さらに、2012年には8億7600万円まで増加しています。これは、東京都から日比谷図書館が移管されるとともにリニューアルして日比谷図書文化館になったからです。日比谷図書文化館は従来の図書館機能のみならず、博物館機能や講演会などが催されるコンベンションホール機能なども併せ持っています。'),(139,'安保法「冷静になればわかってもらえる」　自民・高村氏','pol','■高村正彦・自民党副総裁　抑止力か、他国の戦争に巻き込まれる危険かという議論というのは昨日今日始まったわけではなく、長い歴史がある。自衛隊を作るときもそうだったし、日米安保条約改定の時もそうだった。ＰＫＯの時も憲法学者の８割が反対した。こういう長い歴史がある中で善良な国民は「戦争法案だ」とか「徴兵制になる」だとか、私に言わせれば根も葉もないことを言われて不安に陥れられたというところもあるが、先鋭的な対立が終わって、冷静になれば「やっぱりそんなことないよな」と必ずわかっていただける。あらゆる安全保障の法案は、不安がかき立てられた時はそれなりの運動は起こるが、結局わかっていただけたという歴史を今までたどってきた。日本国民は大変賢い国民だと思っている。（ＴＢＳ番組の収録で）'),(140,'＜最終処分場＞加美町長、首長会議に慎重姿勢','pol','　福島第1原発事故で発生した指定廃棄物の最終処分場建設をめぐり、宮城県加美町の猪股洋文町長は1日の定例記者会見で、栗原、大和両市町が村井嘉浩知事に開催を求めた市町村長会議について「（国が実施する放射性濃度の）再測定結果を待って、処分場問題そのものを解決する場にすべきだ。候補地での詳細調査をどうするかとの趣旨での開催はいかがなものか」と慎重な姿勢を示した。　町が開催に応じる考えを示す、専門家を交えた環境省との意見交換会にも触れ「（候補地に通じる町道が）通れる状況ではなく、現状は調査凍結と同じだ。田代岳が不適地と訴える機会は大事で、交換会の開催自体を拒否しているわけではない」と語った。'),(141,'＜宮城豪雨＞洪水時広域避難　仙台市が検討','pol','　仙台市議会9月定例会は1日、一般質問を始めた。9月の宮城豪雨を受けた洪水災害予測地図（洪水ハザードマップ）の見直しに関し、寺内譲危機管理監は「隣接市町への避難も検討する」と広域避難の必要性に触れた。　ハザードマップは2005年に策定。名取川や広瀬川、七北田川の氾濫を想定し、国や県の浸水予測に基づき避難の方向や場所を示す内容で、避難先は市内を原則とする。太白区の名取川下流域では西方への避難を求めているが、議員が「南下して名取市に避難する方法もある」と指摘した。　職員の人事評価を年2回の勤勉手当（ボーナス）に反映させる制度に関しては、加藤俊憲総務局長が「対象を部長級以上から課長級以上に拡大する」と答弁した。職員の意欲向上策の一環で、実施時期は未定。　高橋卓誠（自民党）、沼沢真也（市民フォーラム仙台）、佐藤幸雄（公明党市議団）、高見紀子（共産党市議団）、樋口典子（社民党市議団）、伊藤優太（維新の党）、佐々木心（自民党）の7氏が質問した。'),(142,'菅官房長官、露の空爆に懸念…シリア情勢悪化も','pol','　菅官房長官は２日午前の記者会見で、ロシア軍がシリア空爆で「イスラム国」以外を攻撃しているとみられることについて、「事実とすれば、シリア情勢のさらなる悪化につながる」と懸念を示した。　その上で「情勢の改善に向け、米国と連携しながら適切に対応していきたい」と語った。'),(143,'参院選、野党統一名簿を＝小沢氏','pol','　生活の党の小沢一郎代表は2日、来年夏の参院選での野党連携に関し、「最善の策は一つの党をつくることだが、現実的にはそこまでいかない。次善の策は（比例代表選挙を）野党統一名簿で戦う『オリーブの木構想』だ」とする談話を発表した。　同構想については、「選挙の届け出政党を別に一つつくり、そこに各党の候補者が個人として参加するもの」と説明した。　小沢氏はまた、野党の選挙協力と連立政権樹立を目指す共産党の提案を「野党共闘への大きな弾みで、この決断を高く評価する」と歓迎。「政権獲得を目指さない政党の離合集散は単なる子どもの遊びになる」などと指摘した。　'),(144,'おおさか維新、代表に橋下氏…市長任期満了まで','pol','　２４日に旗揚げする新党「おおさか維新の会」の初代代表に、母体となる地域政党・大阪維新の会代表の橋下徹大阪市長が就任することが決まった。　新党に参加する国会議員の中から選ぶ代表とともに「共同代表」となる。　大阪維新の会幹事長の松井一郎大阪府知事が２日午前、大阪府庁で記者団に明らかにした。橋下氏は１２月１８日の市長任期満了まで暫定的に代表を務め、市長退任に合わせて代表選が行われる。　松井氏は「市長の任期が終わるまでは代表でやってもらう」と語った。橋下氏は市長退任後の政界引退を表明しているが、発信力のある橋下氏を党の「顔」とすることで、求心力を高める狙いがあるとみられる。'),(145,'おおさか維新、年内に代表選＝松井知事','pol','　松井一郎大阪府知事は2日、結成を表明した新党「おおさか維新の会」の代表について、「代表選挙で選ばれるのが普通」と述べ、年内に代表選を実施して、初代代表に就く橋下徹大阪市長の後継代表を選出すべきだとの考えを示した。　府庁で記者団に語った。　松井氏は「橋下氏には（12月18日に）市長任期が終わるまで代表でやってもらう」と指摘。代表選の有権者に関しては「今回はタイトなスケジュールなので（国会・地方議員ら）特別党員まで」と語り、一般党員の投票を認めない考えを示した。　'),(146,'富山など24計画認定＝本社機能の地方移転支援―内閣府','pol','　内閣府は2日、大都市から地方へ本社機能を移した企業に対する税制優遇措置ついて、申請した富山や鳥取など21道府県の24計画を認定した。　東京一極集中の是正を促す狙いで、各計画が掲げた目標が実現すると、今後5年間で6600人の雇用創出が見込まれる。　地方移転した企業への支援策は、今年の通常国会で成立した改正地域再生法に基づくもので、今回が初めての認定。社屋の取得や従業員の新規雇用などの際に減税措置を受けられる。東京23区から移転した場合は減税幅がさらに拡充される。　'),(147,'菅義偉官房長官、ＴＰＰ交渉「不退転の決意」','pol','　菅義偉官房長官は２日午前の閣議後の記者会見で、米アトランタで開かれている環太平洋戦略的経済連携協定（ＴＰＰ）の交渉日程が延長され続けられている現状に関し「不退転の決意と覚悟で臨み、会合で交渉を成功裏にまとめあげたい」と述べた。　菅氏は交渉状況を「大筋合意を達成すべく各国が全力で交渉にあたっている」と説明。「知的財産や一部の市場アクセスなどで難しい課題が残されているが、各国の相違を埋めるべく最大限努力していく」と語り、交渉国間で対立する課題について甘利明ＴＰＰ担当相が仲介役を務めていることを指摘した。'),(148,'NHK受信料義務化を議論＝放送の検討会設置―高市総務相','pol','　高市早苗総務相は2日の閣議後記者会見で、「放送をめぐる諸課題に関する検討会」を月内にも設置すると表明した。　自民党の「放送法の改正に関する小委員会」が9月にまとめた提言で、NHK受信料の支払い義務化の検討を総務省とNHKに求めており、総務相は「検討課題の一つ」と述べた。　検討会は、テレビ番組のインターネット同時配信などを幅広く議論し、2016年6月をめどに検討結果をまとめる。　'),(149,'新幹線輸出戦略に影響せず＝インドネシアの中国案採用―太田国交相','pol','　太田昭宏国土交通相は2日の閣議後記者会見で、日本と中国が受注を競ってきたインドネシアの高速鉄道計画で中国案の採用が固まったことに関連し「直ちに他国（と進める新幹線輸出交渉）には影響しない」と述べ、今後も新幹線輸出戦略を積極的に進めていく意向を示した。　　政府は成長戦略でインフラ輸出の強化を掲げ、インドやタイ、米国にも新幹線方式の高速鉄道輸出を目指している。国交相は各国との交渉を通じ「日本の技術力は素晴らしいと評価を受けている」と指摘。開発から運用、廃棄までを含む全体で見れば「コスト面でも優れている」と強調した。　'),(150,'シリア情勢　菅義偉長官「懸念せざるを得ない」　ロシアの空爆で','pol','　菅義偉官房長官は２日午前の記者会見で、ロシアがイスラム教スンニ派過激組織「イスラム国」を標的だとして実施したシリアでの空爆について、米国が「無差別な軍事作戦だ」と批判したことに関連、「仮にロシアがイスラム国以外の対象を攻撃したのが事実であれば、シリア情勢のさらなる悪化につながり、懸念せざるを得ない」と述べた。　シリア情勢をめぐる日本政府の対応に関し、菅氏は「情勢の改善に向け、引き続き米国と連携しながら適切に対応したい」と語った。'),(151,'おおさか維新の対応見守る＝菅長官','pol','　菅義偉官房長官は2日午前の記者会見で、橋下徹大阪市長が率いる新党「おおさか維新の会」について、「（安倍政権とは）是々非々ということだから、設立された段階でどういう対応をするのか見守っていきたい」と述べた。　　菅長官は、綱領案に憲法改正が盛り込まれたことに関し、「自民党は憲法改正が立党の精神だから、野党であれ、そうした方向に協力していくのは当然だろう」と語った。　'),(152,'世界経済に下振れリスク＝G20で議論―麻生財務相','pol','　麻生太郎財務相は2日の閣議後記者会見で、8日にペルー・リマで開かれる20カ国・地域（G20）財務相・中央銀行総裁会議に関し、「中国や欧州を含め先行きの見通しが鮮明ではない。世界経済には下振れリスクがある」と述べ、不透明感が増す世界経済の行方が主要議題になるとの認識を示した。　'),(153,'遠藤利明五輪相「五輪とラグビーＷ杯に全力を」','pol','　遠藤利明五輪相は２日午前の記者会見で、１日に発足したスポーツ庁について「５０年、１００年先の日本のスポーツ政策をどうするかで設立された。当面は２０２０年東京五輪や（日本で開催する）２０１９年ラグビーワールドカップ（Ｗ杯）のために最大限努力をしてほしい」と期待感を示した。　遠藤氏は「予算そのものはまだ一体的にはならないが、いずれ完全に一体化するだろうし、そうしていかなければならない」と強調。その上で「スポーツビジネスで経済産業省と交流するなど（各省庁との）交流をしっかりとやったらいい」と述べた。　下村博文文部科学相も２日の記者会見で「鈴木大地長官のリーダーシップで職員が一丸となり、誰もが気軽にスポーツを楽しめる環境を整え、日本から世界にスポーツの価値を広げてほしい」と語った。'),(154,'＜おおさか維新の会＞橋下氏が市長任期満了まで新党代表に','pol','　新党「おおさか維新の会」の設立を発表した大阪維新の会幹事長の松井一郎大阪府知事は２日、橋下徹大阪市長が政界引退する任期満了（１２月１８日）まで、橋下氏が新党の代表を務めると明言した。年内に代表選を行い、新体制に移行する。　大阪市内で記者団に語った。松井氏は、代表選を１１月２２日投開票の知事、大阪市長のダブル選後に実施し、議員や首長ら「特別党員」に投票権を持たせるとの見解を示した。【松井聡】'),(155,'大島衆院議長が訪韓へ','pol','　大島理森衆院議長は11〜13日の日程で韓国を訪問する。　関係者が2日、明らかにした。日韓関係改善を後押しする狙いがあり、韓国国会の鄭義和議長との会談を予定している。　'),(156,'性犯罪厳罰化を諮問へ＝上川法相','pol','　上川陽子法相は2日午前の閣議後の記者会見で、性犯罪の罰則強化に向けた刑法改正を9日に開催される法制審議会（法相の諮問機関）に諮問することを明らかにした。　　性犯罪をめぐっては、省内の有識者検討会が8月、強姦（ごうかん）罪などを被害者の訴えがなくても起訴できる非親告罪にすることや、法定刑の引き上げ、親子関係や雇用関係を利用した性犯罪への処罰規定創設などの検討を求めた報告書をまとめた。　会見で法相は「性犯罪事案の実態に即した対処をするために行うものであり、大変重要な問題だ」と強調。報告書の内容に沿って諮問する意向を示した。　'),(157,'維新、繰り上げ当選予定者が移籍否定の誓約書','pol','　１１月２２日投開票の大阪市長選に立候補を予定している維新の党の吉村洋文衆院議員（比例近畿ブロック）は１日、大島衆院議長あてに議員辞職願を提出し、許可された。　維新の離党届も執行部に提出した。２０１４年衆院選の比例選名簿に従って、次点の椎木保氏が繰り上げ当選となる予定だ。　椎木氏は先の衆院選で大阪２区から出馬し、落選。このため、維新執行部は橋下徹大阪市長が旗揚げする新党「おおさか維新の会」に移籍する可能性を危惧し、一時は比例選名簿から抹消することも検討したが、最終的に椎木氏が移籍しない旨を記した誓約書を執行部に提出し、決着した。'),(158,'防衛予算、上限見直さず＝政府','pol','　政府は2日の閣議で、防衛政策の基本方針をまとめた防衛大綱と2014年度から5年間の防衛予算の上限を定めた中期防衛力整備計画（中期防）について、「見直す必要があるとは考えていない」とする答弁書を決定した。　民主党の本村賢太郎衆院議員の質問主意書に答えた。　中期防は、14年度から5年間の防衛予算総額の限度を24兆6700億円程度としている。安全保障関連法の国会審議で、自衛隊の任務拡大に伴い、中期防を見直して防衛予算を増やすのではないかとの指摘が野党から出ていた。　'),(159,'菅義偉長官、憲法改正を評価　おおさか維新の会結党','pol','　菅義偉官房長官は２日午前の記者会見で、大阪の橋下徹大阪市長による国政政党「おおさか維新の会」の結党表明に関し「地方分権や行政改革に強い意思で取り組んでいる。今後、どのような政策を具体的に掲げていくか見守っていきたい」と述べた。　憲法改正を掲げている新党綱領案に対しては「いろいろな政党が自分たちの憲法に対する考え方を明快にすることは、国民世論を深めるために大事だ」と評価した。橋下氏が５月に頓挫した「大阪都構想」への再挑戦や、東京一極集中を是正するため大阪を「副首都」とする構想を示した点には「従来述べてきた原点に立ち返ったのかなという印象を持っている」と語った。'),(160,'〔ふるさと短信〕返礼品に「米1反分」や「鹿の角」＝奈良市','pol','　奈良市は、ふるさと納税の返礼品を拡充し、収穫間近の奈良市産米「ヒノヒカリ」1反分（玄米ベースで約600キロ）や奈良の伝統行事「鹿の角きり」で切り落とされた鹿角を使った刀置きなどを新たに加えた。返礼品で「米1反分」は全国初。鹿角細工も市販されていない希少な品だという。「奈良にこれだけの魅力があったのかということを返礼品のラインアップを通して知ってもらいたい」（仲川元庸市長）としている。　ヒノヒカリの贈呈は30万円以上の寄付者が対象で限定1人。市南部の八島町で無農薬栽培しているもので、申し込みを受けてから稲刈りをし、玄米または白米で自宅まで届ける。稲刈りの時期があるため、10月15日までに申し込み、入金する必要がある。　鹿角の刀置きも30万円以上が対象で限定5セット。雄鹿の立派な角が杉の台に固定され、きり箱も付いているため、装飾品としても使用できる。　市のふるさと納税は、相次ぐ返礼品のてこ入れなどで今年は好調に推移し、9月末までに昨年同期の約6倍に当たる3700万円が集まった。特に100万円以上の寄付者が対象の奈良一刀彫のひな人形に7件も申し込みがあるなど、高額納税が多いのが特徴だ。　'),(161,'初日終了　難航3課題を協議 　TPP閣僚会合','pol','　【アトランタ（米国ジョージア州）玉井理美】環太平洋連携協定（TPP）閣僚会合は30日（日本時間1日午前）、当地で初日の協議を終え、各国が今会合での大筋合意を目指す考えを確認した。医薬品のデータ保護期間、乳製品の市場開放、自動車の原産地規則の残る3課題を中心に、1日も関係国間で協議を詰める。米国が2国間の閣僚協議を頻繁に開くなど水面下の動きが活発化しており、1日までの閣僚会合が延長する可能性もある。　甘利明TPP担当相は全体会合で「各国の政治状況を考慮すると、ここでまとめなければ交渉が漂流してしまう可能性すらある」と発言。11月のアジア太平洋経済協力会議（APEC）首脳会議に合わせて再びTPP閣僚会合を開く案が浮上していることには「11月までに大きな政治日程を抱えている国があり、もう一回結集できる保障はない」とし、各国閣僚に今回を最後にするよう呼び掛けた。全体会合後、記者団に明らかにした。　甘利担当相は全体会合の場で米国、カナダ、メキシコ、ニュージーランド（NZ）の閣僚と短時間会談した。米国とは、大筋合意の鍵を握る医薬品のデータ保護期間の交渉の進め方について意見を交わし、カナダ、メキシコとは残された自動車の原産地規則をめぐり協議。日本は自動車協議を事務レベルでも行った。　議長国の米通商代表部（USTR）フロマン代表は、知的財産をめぐり対立するオーストラリアのロブ貿易相と交渉したが、打開策は見いだせていないもようだ。乳製品では、NZが米国やカナダなど関係国と協議を進めた。難航課題の解決には米国の柔軟性が不可欠だが、米国議会の圧力を背景に、どこまで譲歩できるか不透明だ。1日は午後に全体会合を開く予定だが、調整が長引けば、閣僚会合は2日に延長する可能性もある。'),(162,'ロシアのシリア空爆を懸念＝菅官房長官','pol','　菅義偉官房長官は2日午前の記者会見で、ロシアのシリア空爆について「仮に『イスラム国』以外の対象を攻撃したということが事実であれば、シリア情勢のさらなる悪化につながるという思いの中で、懸念せざるを得ない」と述べた。　'),(163,'（７０年目の首相　苦闘：５）評論家らが再生プロジェクト','pol','　次期首相に安倍晋三を推す政治評論家・三宅久之の記事を読んだ衆院議員の下村博文。さっそく、三宅に電話をかけた。２０１１年初夏のことだった。　「安倍さんにもう一度登板をしてもらう必要があるんじゃないでしょうか」。下村の言葉を聞いた三宅は「確かにそうだ。だが、世間はそうは思っていない」と応じ、まだ迷いがあるようだった。　自民党総裁選まで１年半を切っていたが、世間では安倍待望論はほぼ皆無だった。だが、民主党政権のもとで日米同盟は揺らぎ、尖閣諸島沖の中国漁船衝突事件では中国人船長が不起訴となった。一部の「保守層」には、思想的に共鳴する安倍への期待が高まっていた。……本文：1,261文字この記事の続きをお読みいただくには、朝日新聞デジタルselectonYahoo!ニュースの購入が必要です。'),(164,'＜全町避難＞復興下支え治安最前線戻る','pol','　東京電力福島第1原発事故に伴い移転中の福島県警双葉署は1日、避難区域の富岡町内にある本庁舎で一部業務を再開した。復旧作業で増加する交通量や人の出入りなどに対応。治安面から復興を下支えする。【防犯カメラ】楢葉町民の安全・安心守る24台　署内に「双葉地域復興治安推進本部」を設置し、警察官2、3人が交代で常駐する。パトロールの拠点と位置付け、一時帰宅する住民の相談や遺失物の受け付けなどに当たる。本署機能は当面、楢葉町内にある臨時庁舎が担う。　1日に本庁舎であった再開式で、石田勝彦県警本部長が署員ら110人を前に「震災前の地に立ち戻り再びその灯をともすことは、福島の復興をしっかりと支えるという揺るぎない決意だ」と訓示。パトカーと白バイが出動し、富岡町内など管内をパトロールした。'),(165,'＜全町避難＞役場機能4年7カ月ぶり一部戻る','pol','　東京電力福島第1原発事故で全町避難する福島県富岡町は1日、役場機能の一部を4年7カ月ぶりに町内に移転し再開した。町は早ければ2017年4月の帰還開始を目指しており、先月には復興拠点の施設整備計画を策定。町内に業務の足場を設けたことで、復旧復興を加速させる。【防犯カメラ】楢葉町民の安全・安心守る24台　移転したのは道路や下水道の復旧を進める「復旧課」と、除染業務を管轄する「復興推進課」。移転先は居住制限区域にある同町本岡の町保健センターで、職員19人が業務を担う。両課は隣接する楢葉町内の双葉地方水道企業団の事務所を間借りしていた。保健センターは8月に改修が完了した。　開所式典が1日、現地であり、宮本皓一町長が「わが町は復興に向け着実に動きだしている。一人でも多くの町民が戻ってみたいと思える町にするため、全力で取り組んでいく」とあいさつした。　役場の中枢機能は今も避難先の郡山市内にあり、町は一部機能を戻すことによって復興業務の加速化と効率化を狙う。現場に常駐することで除染効果の検証作業などが迅速に進められるほか、本庁舎の改修や工事の立ち会いも便利になる。開所に合わせ、環境省福島環境再生事務所も相談所を同センター内に設置した。職員4人態勢で、除染や被災家屋の解体など町内に一時帰宅した住民の相談に応対する。'),(166,'ＴＰＰ閣僚会合、１日延長　甘利氏「希望見えてきた」','pol','　米アトランタで開かれている環太平洋経済連携協定（ＴＰＰ）交渉で、甘利明ＴＰＰ相は１日夜（日本時間２日午前）、記者団に対し、参加１２カ国による閣僚会合について「状況は厳しいが、希望は見えてきた。１日延長して、合意に向けて全力を傾けることになった」と明らかにした。【写真】ＴＰＰ交渉の閣僚会合後、取材に応じる甘利明ＴＰＰ担当相（右）と米国のフロマン通商代表部（ＵＳＴＲ）代表＝１日午後、米アトランタ、清井聡撮影　閣僚会合は１日夜、約１時間開かれ、当初は１日までの２日間の予定だった会合を１日延長することを確認した。甘利氏によると、１日の予定だった共同記者会見は３日に開くという。　甘利氏とともに姿を見せた米国のフロマン通商代表部（ＵＳＴＲ）代表は記者団に対し、「残る難題への現実的な解決を見いだそうと、すべての国が懸命に取り組んでいる」と話した。　甘利氏はその後、アトランタ市内の別のホテルで記者団に対し、焦点となっているバイオ医薬品のデータ保護期間について「状況の厳しさは一番」と指摘し、「米豪両国を中心にもう１日がんばってみよう、ということだ」と述べた。残る懸案の乳製品と自動車分野については「前進がみられている」と語った。（アトランタ＝鯨岡仁、清井聡）'),(167,'橋下徹氏「おおさか維新の会」10月中結党正式表明','pol','　維新の党を離党した橋下徹大阪市長（４６）と松井一郎大阪府知事（５１）は１日、大阪市内で記者会見し、同党「大阪系」国会議員らと新党「おおさか維新の会」を１０月中に結成すると正式表明した。橋下氏は「今の維新の党は偽物になった。本物の維新の党を作る必要がある」と民主党との連携に前向きな松野頼久代表ら執行部を批判した。橋下氏は１２月までの市長任期を全うし、政界を引退する意向だが関係者には将来的な復帰への待望論が根強い。【写真】小泉進次郎氏明言、戦後最年少での初入閣「ない」　新党旗揚げ会見を表明した大阪市内のホテル。壇上に上がった橋下氏は、たもとを分かつ維新の党の松野代表を挑発した。「今の維新は偽物。もう１度、本物の維新をつくる必要がある」。さらに民主党との合流構想に「国会議員の身分を守るためにくっつくだけだ」と切り捨てた。　新党には「大阪系」の国会議員ら１５人程度が参加する予定だが、「政治は数」と豪語する橋下氏は「これからすさまじい政治闘争になる」とし、２４日の結党大会まで中間派議員とされる国会議員をめぐる引き抜き合戦の激化を予告した。　新党の基本政策の１つとして大阪の副都心化、地方自治体の権限強化を掲げる。橋下氏は「今の中央集権という大きな岩を砕くには、まず２つに割らないといけない。東京一極集中を変えるためには、大阪を副首都にするべき。地方から国の形を変えるのが維新の理念だ」と持論を展開した。　維新分裂により「カネ」をめぐるバトルも激化する。大阪系議員は新党が未交付分の政党交付金を受け取る「分党」を求めている。維新の党が年内に受給する見通しの金額は計１３億円余り。橋下氏は「名前からお金から全部くれてやればいい」と言いながら「これまでの維新の党ができた経緯は見てほしい。名前からお金まですべてをガメるなら、そんな人たちに改革なんてできない。金にガメつい人はじき消滅しますよ」と痛烈だ。“円満離婚”ができない場合は「偽物と言い続けます」と橋下節をさく裂させた。　橋下氏は１２月までの市長任期を全うした上で政界を引退する意向は変わらないとし「政治はきっぱり終了です。（新党に）政治的には関わらない。政党は個人の持ち物ではない」と強調した。ただ安倍首相や菅官房長官らの政権与党とも蜜月関係にあり、新党関係者も含めて、将来的な政界復帰への待望論もしぼんでいない。【松浦隆司】'),(168,'維新の党松野頼久代表は不快感、看板返上突っぱねる','pol','　維新の党を離党した橋下徹大阪市長（４６）と松井一郎大阪府知事（５１）は１日、大阪市内で記者会見し、同党「大阪系」国会議員らと新党「おおさか維新の会」を１０月中に結成すると正式表明した。橋下氏は「今の維新の党は偽物になった。本物の維新の党を作る必要がある」と民主党との連携に前向きな松野頼久代表ら執行部を批判した。　「偽物」呼ばわりされた維新の党の松野頼久代表はこの日の会見で、「仲間で悪口を言い合うのはよくない。（離党から）１カ月で（橋下氏は）変わったのかなというのが感想」と話した。「（橋下新党は）我々の党と基本理念は同じ。今も、なぜ分裂していくのか釈然としない」と、橋下氏に再考を求めた。　維新の看板返上要求に関しては「昨年の衆院選で、維新の党として４年の任期をいただいた。そこはしっかり残していきたい」と反論。「分党」の議論も難航しているが、松野氏は「お金の問題はどうでもいい。公党の責任をどう果たすかだ」と、不快感を示した。'),(169,'松井氏と吉村氏が立候補正式表明、大阪都構想再挑戦','pol','　大阪府知事の松井一郎氏（５１）と維新の党の元衆院議員吉村洋文氏（４０）が１日、１１月２２日投開票の知事選、大阪市長選にそれぞれ立候補すると正式表明した。ダブル選には「大阪都構想」への再挑戦を掲げ臨む。　橋下徹氏と同じ弁護士で側近の吉村氏は「とにかく大阪の街をよくしたい」。橋下氏はダブル選に「自分の選挙以上にやりたい」とフル参戦を明言。市長選には自民党大阪市議の柳本顕氏（４１）が無所属で出馬し、同党が推薦する。元大阪市北区長で兵庫県加西市長を務めた中川暢三氏（５９）も立候補を表明している。'),(170,'小泉進次郎氏明言、戦後最年少での初入閣「ない」','pol','　７日の内閣改造で、戦後最年少入閣が取りざたされる自民党の小泉進次郎復興政務官（３４）は１日、都内で取材に応じ「（入閣は）ないです」と明言した。入閣待機組議員が６０人いる現状を念頭に、「大臣をやりたい方が上に控えていますから」と、配慮もにじませた。【写真】橋下徹氏「おおさか維新の会」10月中結党正式表明　安倍晋三首相周辺では、来年の参院選を見据え、人気が高い進次郎氏を閣内に取り込む願望があるとされるが、進次郎氏は「『小泉進次郎？　もともと使う気なんかないよ』と、理解できないのでは。私は勘違いしません」と、機先を制するような発言も。この日は、味の素本社で「男の料理教室」に参加し、ブロッコリーとパプリカの総菜を作成。同社では、３４歳社員が「いちばん若い課長にいかないくらい」の立場と聞くと、「３４歳は（大臣どころか）課長にもいかないくらい」と、笑わせた。'),(171,'鈴木大地氏スポーツ庁初代長官就任　戦う長官になる','pol','　戦う長官になる−。国のスポーツ施策を総合的に推進するスポーツ庁が１日、文部科学省の外局として発足。初代長官に、８８年ソウル五輪競泳金メダリストの鈴木大地氏（４８）が就任した。就任会見では「現場に足を運んで、選手と一緒に戦う」と語り、元金メダリストとして現場主義を強調した。　スポーツ庁は国が支出する強化費を一元的に管理する。１９年ラグビーＷ杯、２０年東京五輪と国内でのビッグイベントの前に、まずは来年リオデジャネイロ五輪が控える。鈴木長官は五輪予選などには積極的に顔を出し「日本チームを激励したい。リオの金メダルは最低でも２ケタ」と目標を掲げた。　新国立、エンブレム問題と東京五輪に向けてスポーツ界は揺れている。組織委会長、五輪担当大臣、ＪＯＣ、ＪＳＣ会長など、船頭が多いことも混乱の一因。行政経験のない新長官への不安は隠せないが「“こいつで大丈夫”と思われるかもしれないが、経験不足の分は吸収することで進んでいきたい」と前を見た。　任期は２年。長官就任のため日本水連会長、順大教授を辞任。長男からは「大丈夫。バカじゃないの」と心配されたという。「（長官就任には）消去法とか、ジジイ殺しとかいろいろ言われているが、明るく楽しく元気よく取り組みたい」。持ち前の明るさとポジティブ思考で、よどんだスポーツ行政に新風を吹き込む。【田口潤】　◆鈴木大地（すずき・だいち）１９６７年（昭４２）３月１０日、千葉県習志野市生まれ。７歳で水泳を始める。市船橋高３年の時、１００メートル背泳ぎで日本新記録。８４年ロス五輪に出場。順大４年時には、８８年ソウル五輪男子１００メートル背泳ぎで金メダルを獲得した。９２年に引退。２０１３年に順大スポーツ健康科学部教授就任、同年から日本オリンピアンズ協会会長も務める。２０年東京五輪招致委員会では理事。家族は妻と２男。　◆スポーツ庁　トップ選手強化や市民レベルのスポーツ振興などに専門的に取り組む。施設を整備する国土交通省、健康増進を担う厚生労働省など多くの府省に分散するスポーツ関連事業を調整し、施策の効率的な実施を目指す。ことし５月に設置が決まった。'),(172,'消費支出、2．9％増＝猛暑効果で3カ月ぶりプラス―8月','pol','　総務省が2日発表した8月の家計調査によると、1世帯（2人以上）当たりの消費支出は29万1156円となり、物価変動の影響を除いた実質で前年同月比2．9％増加した。　プラスは3カ月ぶり。住宅リフォームや自動車購入への支出が伸びた。猛暑効果でエアコンや飲料もプラスに寄与した。　主な項目別では、住居が15．2％増、自動車購入などの交通・通信が8．6％増。昨年の消費税増税以降、低調だった反動もあり大幅に伸びた。8月中旬までの好天を背景に、光熱・水道が6．8％増、エアコンなどの家具・家事用品が7．7％増、国内パック旅行を含む教養娯楽が1．5％増加。うなぎのかば焼きや外食への支出も伸び、食料は0．6％増えた。被服・履物は4．9％減、保健医療は4．2％減だった。　勤労者世帯の実収入は47万5369円と、実質で2．2％増加し、5カ月連続のプラスとなった。　'),(173,'ケント・ギルバート氏「すぐに訴訟を」　サンフランシスコの慰安婦問題で','pol','　中国や韓国が反日宣伝活動を展開する中、「今後、『歴史戦』をいかに戦うか」と題した講演会が１日夜、東京都千代田区の憲政記念館で開かれた。慰安婦問題に詳しい弁護士でタレントのケント・ギルバート氏が「日本は世界に向けてもっと積極的に、英語で（真実を）発信しないといけない」と訴えた。　ギルバート氏は、米カリフォルニア州サンフランシスコ市議会が先月、慰安婦の碑または像の設置を支持する決議案を可決したことに言及。「カリフォルニアは中国に汚染されている」とし、「すぐにでも訴訟を起こしたほうがいい。一度建ってしまうと（撤去を求める）裁判に勝つのは難しい」と警告した。　産経新聞の阿比留瑠比論説委員兼政治部編集委員も講演し、慰安婦募集の強制性を認めた平成５年の河野洋平元官房長官談話について、強制連行を示す証拠が存在しないことを説明。　「この談話はいまだに撤回できずにいるが、国内では無効化したに等しい。今後の課題はそれをいかに米国や世界に広げていくか。自民党が責任を持って河野氏を国会に呼び、根拠を問うべきだ」と述べた。　阿比留氏は、安倍晋三首相がかつて「歴史問題（の改善）はほふく前進で行くしかない」と語っていたことを明かし、「残り（任期）の３年間もほふく前進し、振り返れば『よくここまで来たな』と思えるところまで行けるのではないか」と期待を示した。　講演会は、米カリフォルニア州グレンデール市に設置された慰安婦像の撤去活動を展開するＮＰＯ法人「歴史の真実を求める世界連合会（ＧＡＨＴ）」が主催した。'),(174,'「２００％で体当たり」大仁田厚氏が千葉・袖ケ浦市長選出馬に意欲','pol','　プロレスラーで元参院議員の大仁田厚氏（５７）が１日、東京都内で記者会見を開き、任期満了に伴う千葉県袖ケ浦市長選（１８日告示、２５日投開票）への出馬を前向きに検討していることを明らかにした。会見では地元の支援者らと出馬についての協議が終わっていないことなどを理由に「正式な出馬表明はまだ」などと説明。その一方で、「中途半端な気持ちで袖ケ浦市に向かうつもりはない。２００％で体当たりしていきたい」などと話し、８年ぶりの政界復帰に強い意欲をにじませた。　「普段の記者会見とは違うので…。今日はご足労いただきありがとうございます。先日の報道について説明いたします」。会見の冒頭、リング上での豪快な姿とはかけ離れた神妙な表情で切り出した大仁田氏。９月末に一部スポーツ紙が大仁田氏が袖ケ浦市長選に出馬する意向を固めたと報じたことを受け、都内のプロレスイベント会社の一角に設置された会見場には、千葉県内で取材活動を担当する新聞各社の記者らやスポーツ紙の記者らが集まった。　大仁田氏は会見で、すぐにはこの記事の内容について否定も肯定もせず、同市で今年７月に開催したデビュー４０周年記念興行の試合について語り始めた。同市にはその試合の開催前の２月頃から、営業や宣伝活動で数十回訪れていたという。そして、市内の各所を回るうちに「隣の木更津市は繁栄しているのに、何で袖ケ浦市は簡素なのか。どうにかできないのか」という思いを強くしていったことを明かした。　「もったいないという思いが募り、市役所に資料を取り寄せるなどして自分なりにまじめに勉強した。そのうちに市長選が１０月２５日に行われることを知った」　同市への熱い思いを淡々と語る。ただ、約５分間の冒頭説明では「正式な出馬表明は来週早々にも行いたい」と話すにとどまり、出馬に前向きに姿勢は示したものの“出馬する”とは断言しなかった。　大仁田氏は参院議員時代、平成１８年の長崎知事選に出馬を検討したが、立候補を見送った経緯もある。その後の質疑応答では、この日の会見で“事実上の出馬会見”ともとれる発言を繰り返しながら、出馬を断言しない理由を尋ねる質問もあった。大仁田氏はこれに対し「自分は前向きな決意があるけど、周りがついてこない状況にしてはいけない。支援者との協議が残っている」と語り、あくまで慎重な姿勢を崩さなかった。　また、大仁田氏は同市との縁はこの試合が初めてだったと明かし、「『縁もゆかりもない』との批判は承知の上。拒否反応もあるだろうが、外の人間だから分かることもある。若者のためにも新しい波を起こしたい」と呼びかけた。選挙戦は「完全無所属」で戦うという。　会見開始から約２０分が経過し、質問がほぼ出尽くすと、大仁田氏は「最後にＮＨＫさんのカメラに“決めぜりふ”を言って終わりにさせてくれよ」と要望。記者席の中央に置かれたＮＨＫのカメラに向かってこう語った。　「来週早々、自分の決意を胸一杯込めて、正式表明をしたいと思いますので、皆さんよろしくお願いします。一つだけ言っておききますが、中途半端な気持ちで袖ケ浦市に向かう気は全くない。１００％、いや１５０％、２００％の気持ちで体当たりしていきたい」　やや唐突な印象も残るが、大仁田氏が正式に出馬した場合、袖ケ浦市民はどのような判断を下すのか。大仁田氏の動向が市長選の「台風の目」となりそうだ。　　　　　◇　　　　　　　大仁田氏は長崎市出身。全日本プロレスに入門し、昭和４９年にデビュー。平成１３年の参院選では自民党の比例代表候補として出馬して初当選を果たし、１期務めた。２２年には長崎県知事選に無所属で出馬したが落選した。　袖ケ浦市長選には、３選を目指す現職の出口清市長（６９）と、元市議の福原孝彦氏（５９）がいずれも無所属での出馬を表明している。'),(175,'内閣改造　稲田氏ら四役続投　高市・中谷氏も','pol','　【キングストン＝桑原雄尚】安倍晋三首相は９月３０日夕（日本時間１０月１日午前）、ジャマイカの首都キングストン市内のホテルで同行記者団と懇談し、７日に行う自民党役員人事で稲田朋美政調会長ら党四役と高村正彦副総裁を続投させると明言した。来年夏の参院選に向け、政権の安定運営が必要と判断したとみられる。閣僚人事では、高市早苗総務相、中谷元（げん）防衛相の留任も固まった。　党幹部で続投するのは稲田、高村両氏のほか谷垣禎一幹事長、二階俊博総務会長、茂木敏充選対委員長。首相は理由について「『１億総活躍社会』の実現に向け、新しい『三本の矢』を打ち込むつもりだ。大胆な政策や抜本的な改革が必要であり、その中で特に党内での政策の立案調整が重要になる」と説明した。　１億総活躍社会に関し、新設する担当相は「新しい政策を進めていく上で、突破力、結論を出していく能力も必要だ」と強調。新三本の矢の達成時期について（１）国内総生産（ＧＤＰ）６００兆円＝２０２０年ごろ（２）出生率１・８＝２０２０年代半ば（３）介護離職ゼロ＝２０２０年代初頭−とした。　女性の登用については「常に念頭におきながら組閣にあたるが、数ありきではない」と述べ、閣僚や党幹部で現在の女性の人数を維持するかにはこだわらない考えを示した。　公明党からの入閣については「今までと同様に閣僚１人をお願いしたい」とし、具体的なポストは「公明党ともよく相談しながら決めていく」と語った。　首相は１日午前（日本時間同日深夜）、米ニューヨークでの国連総会とジャマイカ訪問の全日程を終え、ジャマイカのノーマン・マンリー国際空港を政府専用機で出発した。２日夜、羽田空港に帰国する。　'),(176,'「防衛装備庁」が発足　調達・輸出を一元管理','pol','　防衛装備の研究開発や調達、輸出を一元管理する防衛省の外局「防衛装備庁」が１日、発足した。防衛省内に分散していた装備品に関する機能を集約し、取得コスト削減につなげる。同省の内部部局（内局）の運用企画局を廃止し、自衛隊の部隊運用権限を統合幕僚監部に一本化する新体制も同日から始まった。　組織改編は６月に成立した改正防衛省設置法の施行に伴う措置。中谷元（げん）防衛相は「文官だけ、自衛官だけではことをなし得ない。両者が車の両輪となることが必要だ」と訓示した。　装備庁は、陸海空自衛隊の各装備取得部門や内局の経理装備局の装備グループなどを統合して新設された。初代長官には渡辺秀明前技術研究本部長が就任。約１８００人体制とした。　各部署が個別に取得を行ってきた体制を改め、長期契約やまとめ買いなどを進め、コスト圧縮を図る。防衛装備移転３原則に基づき、装備品の共同開発や輸出の窓口機能も担う。　一方、自衛隊の部隊運用を統幕に一本化したのは、内局との業務の重複を解消して迅速な意思決定を可能にするためだ。　新体制では統合幕僚長を政策面から補佐する文官ポスト「総括官」も新設した。'),(177,'新党「おおさか維新の会」続く縮小、参加見通し２０人割れ','pol','　■消長握る安倍政権との距離感　新党「おおさか維新の会」には、維新の党の「大阪系」国会議員がそろって加入する。ただ、参加が確実な議員は２０人に届いておらず、橋下徹大阪市長をトップに一時は国会議員が６０人を超えていた過去の勢いはない。再興のカギを握る橋下氏の政界復帰も保証されておらず、１１月の「大阪ダブル選」で敗れれば、永田町における影響力低下に拍車がかかるのは必至だ。　橋下氏が平成２４年に立ち上げた「日本維新の会」は直後の衆院選で５４議席を獲得し、国政初挑戦で民主党に迫る野党第二党に躍り出た。しかし、昨年の次世代の党との分党、結いの党との合流、そして今回の分裂を受け、“本家・維新”の勢力は大幅に縮小する見通しだ。　高い知名度と発信力で党を引っ張ってきた橋下氏は１日の記者会見でも、１２月の市長任期満了で「政治はきっぱり終了」と強調した。松井一郎大阪府知事らが期待する政界復帰の確約はない。新党には若手が目立ち、国政で強い影響力を持つ国会議員は少ない。足元の大阪ダブル選で完勝が果たせなければ「将来性のない少数政党として永田町で存在感を失う」（維新の党関係者）との見方が強い。　一方、松井氏は１日の会見で、新党の立ち位置について「今後も是々非々だ」と強調した。ただ、合流も視野に来年夏の参院選の選挙協力に向けて維新の党や民主党が目指す野党共闘とは一線を画す意向だ。　橋下氏は会見で、官公労の支援を受ける民主党と維新の党による野党再編について「改革を放棄した」と猛批判。また、安全保障関連法の廃案を訴えた民主党と連携したことで「維新の党は終わった」と突き放した。　「第２ステージ」（橋下氏）を歩み出す新党が存在感を維持するための光明は、憲法改正など政策面で親和性が高い安倍政権との強固な信頼関係だ。橋下氏の資質を高く評価する首相は９月６日の読売テレビ番組で、橋下氏の国政進出について「可能性はあるのではないか」と期待感を示した。馬場伸幸前国対委員長や遠藤敬国対委員長代理ら大阪系議員は菅義偉（すが・よしひで）官房長官と個人的に親しい。　おおさか維新が安倍政権と憲法改正などで協力し、同時に自らの主張を政府の政策に反映させる「是々非々」路線を貫徹すれば、新党としての実績を積み重ねることは可能だ。消長を握るのは、ダブル選と来年夏の参院選に向けた政府との距離感次第となりそうだ。（酒井充、内藤慎二）'),(178,'首相、参院選にらみ党四役続投　継続性と挙党態勢重視','pol','　７日の内閣改造に先立ち、安倍晋三首相（自民党総裁）が党四役らの留任を決めたのは官邸や党幹部間の連携がスムーズな現在の執行部体制を維持し、来年夏の参院選に向け必勝態勢を築くためだ。特に首相は、谷垣禎一幹事長が官邸と党との「緩衝材」として機能する現状を評価。アベノミクスの「新三本の矢」を中心とした参院選公約を早期にまとめるためにも継続性を重視したといえる。（小島優）　「参院選を考えれば、首相は人事で『挑戦』するより、『安定』を選んだということでないか」　党幹部は１日、党四役らの留任方針についてこう解説してみせた。　首相が執行部人事で重視するのは「挙党態勢」だ。９月の総裁選で首相は無投票再選を果たした。ただ、出馬を見送った石破茂地方創生担当相や野田聖子前総務会長らをはじめ党内には不満の声もくすぶる。　結束の必要性を説いたのは谷垣氏だった。安全保障関連法案の審議が佳境を迎えていた９月上旬、谷垣氏は首相に「法案が成立したら党内融和を進めましょう」と進言。首相は２６日の外遊出発前に、谷垣氏に続投を要請した。　首相は「ポスト安倍」を目指し派閥を創設した石破氏を警戒。谷垣氏を続投させることで、首相の批判勢力に多いリベラル系が石破氏らの下に集まるのを抑える狙いもある。軽減税率導入をめぐる与党協議や環太平洋戦略的経済連携協定（ＴＰＰ）交渉の妥結後の国内対策作りなどでは、高村正彦副総裁、二階俊博総務会長が要になると判断したようだ。参院選の選挙態勢作りを進める茂木敏充選対委員長も続投させた。　一方で、首相を悩ませたのが稲田朋美政調会長の処遇だ。「将来の首相候補」として目をかける稲田氏を主要閣僚に起用し、経験を積ませる選択肢もあった。　ただ、稲田氏への厚遇は「党内で嫉妬とやっかみを生んでいる」（党幹部）。当選衆院５回、参院３回以上の入閣待機組が７０人を超える中、衆院当選４回の稲田氏を再入閣させれば、新入閣の枠はさらに減る。　稲田氏が所属する細田派会長の細田博之幹事長代行は２４日、党本部で首相と面会。関係者によると、細田氏は派内の入閣候補を数人あげたが、稲田氏は薦めなかったという。稲田氏の将来も考え、首相は留任と最終判断したようだ。'),(179,'橋下氏「民主の落選組」　維新“残留者”を批判','pol','　「おおさか維新の会」の結党を正式表明した橋下徹大阪市長は１日の記者会見で、松野頼久代表ら維新の党の“残留組”を「偽物」などと激しく批判した。　橋下氏は、松野氏らが安全保障関連法の廃案を目指し民主党などと共闘したことをあげ、「維新の党は終わった」と強調。「みんな民主党の落選組じゃないですか。維新の党は民主党の落選者を民主党に再度ほうり込むための装置になり下がった」とこき下ろした。　橋下氏は、松野氏らが「維新」の党名返上と、政党交付金を双方に配分する「分党」を拒否していることについて「偽物の維新と言い続ける」と宣言。　「今の維新の党の国会議員は自分たちの力で党を作り上げたわけではない」と指摘したうえで「カネと名前がほしいなら全部くれてやったらいい。カネにがめつい人はじきに消滅する」と突き放した。'),(180,'シリア空爆、北方領土交渉に打撃…米反発の恐れ','pol','　ロシアによるシリアでの空爆を受け、安倍首相が重視する露政府との北方領土交渉は厳しさを増しそうだ。　ロシア批判を強める米国が、日本の対露接近に難色を示すのは必至だからだ。　首相はこれまで、領土交渉を進展させるため、米国の理解を得るよう配慮してきた。４月末に米国でオバマ大統領と会談した際、北方領土問題を解決する重要性を強調し、日露間の対話を続ける意向を伝えた。　こうした経緯も踏まえ、首相は９月２８日に米国で行ったプーチン露大統領との首脳会談で、領土交渉の加速に意欲を示したばかりだ。ただ、今回の空爆により、米国がロシアと距離を置くよう日本への「圧力」を強めることは避けられない。　米国は、ウクライナ南部クリミア半島を編入したロシアへの制裁を続けている。シリア問題でも、市民への弾圧を続けるアサド政権を支援するロシアを批判してきた。今回の空爆については、アサド政権と対立する反体制派を攻撃したとみて、強く非難している。'),(181,'首相動静（10月2日）','pol','（現地時間）　1日午後、米ロサンゼルス国際空港で給油。　午後7時50分、米ニューヨークでの国連総会出席とジャマイカ訪問を終え、政府専用機で羽田空港着。同59分、同空港発。（了）'),(182,'首相、遠藤五輪相と高市総務相を留任させる意向','pol','　安倍首相は１日、７日に行う内閣改造で、遠藤五輪相と高市総務相を留任させる意向を固めた。　同時に行う自民党役員人事では、谷垣幹事長ら執行部５人を続投させることを決めた。　２０２０年東京五輪・パラリンピックに向け、新国立競技場の建設計画など懸案は山積しており、遠藤氏が引き続き担当するのが適当と判断したとみられる。高市氏は来年１月から運用が始まる共通番号（マイナンバー）制度を所管している。首相は既に、麻生副総理兼財務相や菅官房長官ら主要閣僚の留任を固めており、閣僚の交代は１０人前後となりそうだ。　自民党執行部体制の維持は９月３０日夜（日本時間１０月１日午前）、訪問先のジャマイカで同行記者団と懇談した際に明言した。谷垣氏のほか、二階総務会長、稲田政調会長、茂木敏充選挙対策委員長の党四役と高村正彦副総裁が留任する。懇談では内閣改造について、派閥のバランスは考慮せず、公明党から従来通り１人を起用する方針も示した。'),(183,'＜内閣改造＞政権安定へ１０閣僚留任…首相方針','pol','　安倍晋三首相は７日に行う内閣改造で、新たに高市早苗総務相と中谷元（げん）防衛相を留任させる意向を固めた。既に留任が固まっている菅義偉官房長官や麻生太郎副総理兼財務相らと合わせ、１９閣僚のうち１０人が続投する見通しとなった。自民党役員についても首相は９月３０日（日本時間１０月１日）、訪問先のジャマイカで谷垣禎一幹事長ら党四役と高村正彦副総裁を留任させると明言した。来夏の参院選をにらんで政権の安定を優先させる。　◇高市・中谷氏続投　「制度改革とか、極めて大事な問題を抱えている中で、今の体制でしっかり対応していこう、と首相が判断されたのだろう」。菅官房長官は１日の記者会見で、党幹部を留任させる首相の意図をこう解説した。閣僚人事でも、首相は同様の方針で臨む。　高市氏は来年１月のマイナンバー制度の円滑なスタートに取り組む。中谷氏は、先の国会で成立した安全保障関連法の答弁に立ち続けた。今後は、国連平和維持活動（ＰＫＯ）で自衛隊が「駆け付け警護」を行えるようにするなど、来年３月の同法施行に向けた防衛省内の実務をつかさどる。首相は、重要課題を実現に移す作業を、両氏に継続して担わせるのが望ましいと判断した模様だ。　両氏のほかに続投の見通しになっているのは、麻生副総理兼財務相、岸田文雄外相、塩崎恭久厚生労働相、太田昭宏国土交通相、菅官房長官、甘利明経済再生担当相、遠藤利明五輪担当相の７人。石破茂地方創生担当相も閣内にとどめる方針だが、「１億総活躍社会」担当相の新設に伴って役職は変わる可能性がある。　多くの主要閣僚と党幹部を留任させるのは、首相が最重要課題と位置付ける経済と社会保障の政策課題を着実に進めるためだ。一方、人事刷新に伴うリスクを少なくする狙いもある。２００６年発足の第１次安倍内閣では閣僚辞任が相次いだこともあって０７年の参院選に敗北し、退陣につながった。昨年９月の内閣改造でも、新たに入閣した３閣僚が「政治とカネ」の問題を指摘されて辞任し、政権への打撃になった。公明党幹部は「現状でいいということだろう。力が弱まった派閥を気にせず、安定して使える人を使いたい、ということではないか」と指摘する。　ただ、留任が多くなれば、党内に滞留する入閣待望組への配分枠はそれだけ減る。安定優先の姿勢は、党内の不満を募らせる副作用も生みそうだ。【田中成之】'),(184,'安倍首相、帰国の途に','pol','　【キングストン時事】安倍晋三首相は1日午前（日本時間同日夜）、米国、ジャマイカ歴訪の日程を終え、キングストンのノーマン・マンリー空港から政府専用機で帰国の途に就いた。　'),(185,'＜おおさか維新＞政権との近さが頼み…「清新さ」不透明','pol','　橋下徹大阪市長が１日に結党を表明した「おおさか維新の会」は、政権寄りの新党として出発することになる。所属国会議員数は現在の維新の党から半減以下になる見通しで、政権との近さをよりどころにせざるを得ない状況だ。　「現維新の党が偽物の維新の党になってしまった」。橋下氏は記者会見で新党こそが維新の結党精神を体現する本家だと繰り返した。　大阪府知事・大阪市長のダブル選を目前にした新党結成表明は、日本維新の会結成当時の清新さを取り戻すと強調し、勢いをつける狙いがある。この日発表した綱領案でも「既存政党は全て地方分権に積極的ではない」「既存の中央集権型政党とは本質的に異なる」と繰り返し、既成政党との違いを前面に出した。　新党は、橋下氏が大阪都構想の住民投票否決から復活するための最初のステップだ。都構想実現のためには、ダブル選で勝利し、来夏の参院選でも存在感を示す必要がある。　しかし、内紛が続いた揚げ句、分裂で生まれた新党が、どこまで「清新さ」をアピールできるかは不透明だ。しかも新党参加の国会議員は、衆参で５０人の現在の維新の党からは激減する。国政での存在感を発揮するためには、橋下氏や松井一郎大阪府知事が個人的に親しい安倍晋三首相や菅義偉官房長官ら政権中枢との関係に頼らざるを得なくなる。松井氏は記者会見で「政府とは是々非々だったが、維新の党はいつのまにか安全保障関連法でもなんでも反対になったので、原点に返る」と強調した。　政権にとって新党は、安全保障関連法のような重要法案で与野党対決が激化した時も協力をあてにできる貴重な存在になる。菅氏は記者会見で「改革姿勢のなかで政党が結成されればいいなとは思う」と述べ、新党に秋波を送った。政権の補完勢力と見られれば埋没しかねないジレンマも抱えるが、新党は野党再編からは取り残されている。「連携相手」は政権側しか残っていないのが実情だ。　◇維新中間派、二の足…地域色の強さに懸念　新党参加者は現時点では衆参で１７人にとどまっている。党名に「おおさか」と地名を入れたことで、８月下旬の橋下氏の新党設立表明当初は参加の意向を示していた維新の党の中間派が二の足を踏んでいる。　中間派が懸念しているのが、新党が大阪中心の地域政党色を強めていることだ。維新の党の松野頼久代表と距離があり、新党参加に傾いていた中間派議員は「『おおさか維新』ではとても地元で選挙を戦えない」と苦渋の表情を見せる。　１１月の大阪府知事・大阪市長のダブル選の情勢を見極めたいという思惑もある。ダブル選で敗北した場合には新党の党勢が低迷し、先行きが危うくなるのは必至だ。このため、様子見をしている部分もある。　新党の１７人に対し、松野氏側には関西出身議員の一部も含め、２５〜３０人程度が残留する見通しとなっている。態度未定の中間派は５、６人まで減った。新党側も中間派の一部を確保したが、現時点では争奪戦は、松野氏側に有利に進んでいるようだ。【福岡静哉】'),(186,'「橋下新党」巡り議論','pol','　維新の党の馬場伸幸、松木謙公両衆院議員は１日、ＢＳ日テレの「深層ＮＥＷＳ」に出演し、橋下徹大阪市長が結成を表明した国政政党「おおさか維新の会」に関して議論した。　新党に参加予定の馬場氏は、松野代表ら維新の党執行部について、「年内に民主党と一緒になるのを目指している。『維新』の名前も年内でいらなくなるので返してほしい」とけん制した。維新の党に残る意向の松木氏は「改革マインドは松野執行部も同じだ。松野氏が間違いを犯しているとは思えない」と語り、分裂を回避すべきだと主張した。'),(187,'「維新」党名めぐり応酬＝松野氏と松井氏','pol','　維新の党の松野頼久代表は1日の記者会見で、同日旗揚げした新党「おおさか維新の会」の参加議員が「維新」の党名を返上するよう求めていることに対し、「維新の党として4年間の任期を有権者に頂いている。しっかり（党名を）残していきたい」と述べ、要求を拒否した。　　これに対し、維新の党を離党した松井一郎大阪府知事は1日夜のBSフジの番組で、「松野氏らは民主党と新党をつくるのだろう。だったら『維新』の名前は要らないではないか」と述べ、松野氏の対応を批判した。　'),(188,'橋下新党会見　新党「おおさか維新」結成を正式表明　２４日に結党大会','pol','　維新の党を離党した大阪維新の会代表の橋下徹大阪市長は１日、大阪市内で記者会見を行い、新たに国政政党「おおさか維新の会」を結党すると正式に表明した。現時点で大阪選出を中心に国会議員１５人以上が参加する見通しで、２４日に結党大会を開く予定。５月に頓挫した「大阪都構想」への再挑戦を掲げ、当面は１１月２２日投開票の大阪府知事選、大阪市長選のダブル選での勝利を目指す。　橋下氏は記者会見で、東京の一極集中を是正するため、大阪を「副首都」とする構想を明らかにし、「地方分権の国に変える」と新党結成の意義を語った。党名に地域名を入れたことには、「地方分権の象徴だ」と説明した。維新の党に対しては「偽物の維新になった」と述べ、民主党との合流を視野に入れる松野頼久代表らを批判。「本物の維新の会をもう一度作り直す」と訴えた。　会見には新党の代表就任が有力な松井一郎府知事が同席。再選に向けて松井氏が府知事選に、１日に議員辞職願を提出、許可された吉村洋文前衆院議員が市長選にそれぞれ立候補すると正式に表明した。　会見では、新党の綱領案も公表した。大阪発の「地方分権型政党」を目指し、憲法改正による首相公選制、一院制の実現を掲げた。地方の課題については地方自治体が国家の意思決定に関与できる新たな仕組みを創設するとした。　おおさか維新には、維新の党所属国会議員５１人のうち、馬場伸幸前国対委員長ら大阪選出の全議員と、片山虎之助参院議員会長らが加わる。維新に残るのは元民主党の松野氏や旧結いの党出身の江田憲司前代表ら２０人以上となる見通し。　双方は１日、国会内で２回目となる分裂に関する協議を行ったが、松野氏らは新党組が求める党名の「維新」の返上について、昨年の衆院選で「維新の党」として有権者の票を得たことを理由に重ねて拒否。維新として年内に受給する約１３億円の政党交付金についても、国会議員数などに応じて配分する「分党」を求める新党組の要求を拒んだ。２日に再び協議する。'),(189,'＜来夏参院選＞公明、最多７人擁立へ…改選増選挙区で攻勢','pol','　公明党は１日の中央幹事会で、来年夏の参院選の神奈川、愛知、福岡の３選挙区に、新人３人を擁立することを決めた。同党の選挙区候補は計７人となる見通しで、過去最多となる。都市部の選挙区で参院選挙制度改革により改選数が１増することを受け、強気の姿勢で党勢拡大を目指す。　この日公認したのは▽神奈川（改選数４）の元防衛大准教授、三浦信祐（４０）▽愛知（同４）の元厚生労働省職員、里見隆治（４７）▽福岡（同３）の元外務省職員、高瀬弘美（３３）−−の３氏。近く兵庫選挙区（同３）も新人１人の公認を発表する。　２０１３年参院選は改選数３以上の東京、神奈川、埼玉、大阪の４選挙区で擁立し当選したが、来夏から改選数が１増する愛知、福岡、兵庫の３選挙区でも議席獲得を目指す。公明党は１９８３、９２年参院選で選挙区に６人擁立したが、来年はそれを上回る。山口那津男代表は記者会見で「改選増のところはチャンスあり」と議席増に意欲を示した。　都市部での議席増は、安全保障関連法への批判票獲得を狙う共産党も模索する。１３年は共産が１２年ぶりに選挙区で議席を獲得しており、公明党幹部は「最終的に公明と共産の戦いになる選挙区も出てくる」と指摘し、両党のつばぜり合いも激化しそうだ。【横田愛】'),(190,'＜自民執行部留任＞続く「政高党低」…参院選対策、手堅く','pol','　安倍晋三首相（自民党総裁）は谷垣禎一幹事長ら党四役と高村正彦副総裁を留任させる意向を表明した。安定した体制で来夏の参院選に臨むとの決意を示したものだ。政策立案や選挙戦略で首相官邸が主導的な役割を果たす「政高党低」の体制が続くことになりそうだ。【影山哲也】　首相は３０日午後（日本時間１日午前）、訪問先のジャマイカ・キングストンで「大胆な政策や抜本的な改革が必要で、党内の政策立案や調整が必要だ」と党執行部を続投させる理由を説明。首相が表明した「１億総活躍社会」の実現に向け、党の協力に期待を示した。　外遊中の安倍首相が具体的な人事について明言するのは異例だ。党執行部続投を決め、臆測が飛び交うことを抑える狙いがあったようだ。　首相の表明を受け、谷垣氏は党本部で「首相の『新三本の矢』の矢をしっかりサポートしたい」と記者団に強調。１億総活躍社会の実現のために首相が掲げた（１）強い経済（２）子育て支援（３）社会保障−−の３本の政策の柱を支える考えを示した。　また、高村氏は党執行部の留任について、「チームワークよく、党が一体となり政府を支えたことを首相が評価したのではないか」と語った。二階俊博総務会長も「安定と実行という点で判断したのかと思う」と述べた。　首相は、執行部のうち稲田朋美政調会長については、経済産業相などで入閣させることを検討した。しかし、参院選に向けた政策を具体化させていく中で、農協改革などで手腕を発揮した稲田氏を党の政策トップに残した方が政府と党の調整がうまくいくとの結論に達したようだ。　一方、ある派閥幹部は「新三本の矢は掲げたものの中身はない」と語り、参院選に向けた政策の具体化は難航するとの考えを示唆。執行部全員が留任となり「新鮮な政策が打ち出せるのか」（党関係者）という声も漏れる。'),(191,'＜新三本の矢＞ＧＤＰ６００兆円、２０年ごろ…首相目標表明','pol','　【キングストン仙石恭】安倍晋三首相は３０日（日本時間１日）、訪問先のジャマイカ・キングストンで記者団に、アベノミクス（安倍政権の経済政策）の「新三本の矢」についての達成目標時期を表明した。名目国内総生産（ＧＤＰ）６００兆円は「２０２０年ごろ」、希望出生率１．８は「２０年代半ば」、介護離職者ゼロは「２０年代初頭」としている。　首相は人口減で先細りする労働力について「拱手（きょうしゅ）傍観していたのでは日本の未来は開かれない」と強調。「これらの目標に向かってどのような政策を進めるか、これから議論する」と語った。'),(192,'＜橋下新党＞「おおさか維新」結党表明…１７人確保','pol','　橋下徹大阪市長は１日、大阪市内で記者会見し、新党「おおさか維新の会」の結党を正式表明した。今月２４日に結党大会を開き、執行部体制などを決める。橋下氏は「大阪都構想を掲げた改革政党として、本物の維新をもう一度作る必要がある」と述べ、５月の住民投票で否決された都構想への再挑戦を新党の旗印とする考えも示した。　新党に参加する維新の党の馬場伸幸前国対委員長は１日、国会内で松野頼久代表らに対し、現時点で最低でも衆院議員１１人と参院議員６人の計１７人が新党に参加を決めていると伝えた。橋下氏は会見で「これから国会議員を集めにかかる。維新の党とは激しい政治闘争になる」と語った。　橋下氏は新党名に「おおさか」を入れた理由について「東京一極集中の是正の象徴だ」と説明。統治機構改革や地方分権など８項目の基本政策を掲げた新党の綱領案を発表、綱領案には大阪の副首都化や地方自治体が国政に関与できる新たな仕組み作りを盛り込んだ。憲法改正を伴う首相公選制や１院制の実現も柱で安倍政権との連携も視野に入れる。　また、橋下氏は「（大阪市長任期の）１２月１８日まで（新党の）実務をとりしきる」と述べ、暫定的に代表に就任する可能性を示唆した。一方で、「市長の任期が満了する１２月で政治はきっぱり終了する」と述べ、改めて政界引退の意向を強調した。会見では大阪府知事選に松井一郎氏、市長選に衆院議員を辞職した吉村洋文氏をそれぞれ擁立することも発表した。【福岡静哉】'),(193,'＜防衛装備庁＞発足…６組織を集約、コスト削減へ','pol','　防衛装備品の研究開発や調達、廃棄、輸出を一元的に担う防衛省の外局「防衛装備庁」が１日、発足した。防衛省・自衛隊に分散していた装備関連の６組織を装備庁に集約することで効率的な調達を行い、コスト削減や装備品の輸出推進を図る。防衛装備品を巡っては旧防衛庁時代から業者との癒着が繰り返されており、不祥事の防止が今後の課題だ。【防衛装備庁のイメージ図】　装備庁は、初代長官に就任した渡辺秀明・防衛省技術研究本部長をトップに計１７８０人体制でスタート。昨年４月に閣議決定された一定の条件で武器輸出を認める防衛装備移転三原則に基づき、検討が進むオーストラリア軍の次期潜水艦の共同開発・生産への参画など他国への武器輸出を促進する役割も担う。定期・不定期に監察を実施する防衛監察本部とは別に、日常的な監察を担当する内部監察担当を装備庁内に約２０人配置し、監察機能も強化した。　また、防衛省は１日、官僚や事務官など文官（背広組）中心の組織である内局の運用企画局を廃止し、自衛隊の部隊運用に関する業務を自衛官（制服組）中心の統合幕僚監部（統幕）に一元化した。　制服組トップの統合幕僚長の下に、文官ポストとして統幕副長級の「総括官」と部課長級の「参事官」を新たに設け、約４０人の文官が統幕に異動する。一方、内局には運用に関する法令の企画・立案を担当する運用政策課を新設し、内局の運用施策への関与を残した。【町田徳丈、飼手勇介】'),(194,'橋下氏、新党「おおさか維新の会」結成を表明','pol','　橋下徹大阪市長は１日、大阪市内で記者会見し、地域政党・大阪維新の会を母体にした新党「おおさか維新の会」を結成する構想を正式に表明した。　党綱領に、大阪都構想と大阪の「副首都」化を柱とする地方分権など、八つの基本政策を掲げた。２４日に結党大会を開き、維新の党所属国会議員のうち大阪選出を中心とした十数人が参加する見通し。新党の代表は、大阪維新の会代表である橋下氏が就任し、１２月１８日の大阪市長任期満了まで暫定的に務める見込みだ。　橋下氏は記者会見で「大阪都構想、大阪の副首都化を掲げた改革政党、本物の維新の会をもう一度作る必要がある」と述べ、東京と大阪の対立軸を強調。「地方分権型政党」と位置づけ、大阪に党本部を置く方向だ。　新党は安倍内閣が重視する憲法改正や労働分野の規制改革などを基本政策とし、政府・与党と連携して政策実現を図る路線を明確にした。'),(195,'民主・岡田氏、細野氏らの異論にクギ？　民維連携は「中身が伴わないとダメ」','pol','　民主党の岡田克也代表は１日、盛岡市で開いた参院民主党の研修会で、合流も視野に入れた連携協議に乗り出した民主党と維新の党の関係について「大事なのは両党の協力が選挙目当ての離合集散ではなく、『しっかりとした野党ができた』と受け取られるよう中身が伴ったものでないとダメだ」と強調した。　岡田氏は、野党再編を含めた今後の動きについて「それぞれ意見はあると思うが、執行部に委ねてほしい」とも言及。その上で「みんながいろいろな発信をするのは好ましくない。『まとまっていないね』『いつまでも信用できないね』ということになる」とクギを刺した。　野党再編路線をめぐり、細野豪志政調会長らがブログなどで、執行部の対応に異論を唱える動きを牽制（けんせい）したとみられる。　来年夏の参院選対策については、「これまでの政権批判に加え、民主党として何をするのか、何がしたいのかを示すことで、国民の期待を集めなければいけない」と強調。選挙公約の見直しなどに着手する考えを示した。'),(196,'幹事長に小川敏夫氏＝国対は加藤氏―参院民主','pol','　民主党の郡司彰参院議員会長は1日、盛岡市内で開かれた参院民主党の研修会で、参院幹事長に小川敏夫元法相、参院国対委員長に加藤敏幸元選対委員長を充てる人事案を示し、了承された。　任期満了に伴う人事。　小川　敏夫氏（おがわ・としお）立教大法卒。検事、党参院幹事長、法相。参院東京選挙区、当選3回。67歳　加藤　敏幸氏（かとう・としゆき）新居浜工業高専卒。連合労働政策局長、党選対委員長、参院国土交通委員長。参院比例代表、当選2回。66歳。　'),(197,'橋下氏「偽物の維新、本物に作り直す」　新党２４日結党','pol','　地域政党「大阪維新の会」の橋下徹代表（大阪市長）は１日、大阪市内で記者会見を開き、新たな国政政党「おおさか維新の会」の設立を正式に発表した。結党大会は２４日。その時点では「維新の党」から１５人ほどが加わる見込みだ。５月の住民投票で廃案となった大阪都構想へ再挑戦する環境づくりを狙っている。　橋下氏は「今の偽物の維新の党から、本物の維新の会をつくり直す」と発言。維新の党の執行部が、都構想に反対した民主党などとの野党再編を目指すことへの反発が結党の背景にあると説明した。　維新の党は衆院３９人、参院１１人（１日に辞職願・離党届を出した吉村洋文衆院議員は除く）。大阪府内の選挙区が地盤の衆参１１人が新党に合流し、さらに片山虎之助・維新の党前総務会長ら数人が加わる見通し。１１月の大阪府知事、大阪市長のダブル選挙の結果次第という中間派もおり、流動的だ。'),(198,'小泉進次郎氏、３４歳なら「課長にも行けない」　入閣の可能性を改めて否定','pol','　「自分はまだまだ修行、修行」−。自民党の小泉進次郎復興政務官（３４）は１日、公務のため訪れた味の素本社（東京都中央区）で記者団の取材に応じ、７日の内閣改造で入閣する可能性を改めて否定した。　小泉氏は、東日本大震災後から続く同社の復興支援企画「男の料理教室」に赤いエプロン姿で参加し、ブロッコリーとパプリカのあえ物に挑戦。その後、安倍晋三首相から復興相の打診があった場合の対応を記者団に問われると、「ない」と即座に打ち消した。　小泉氏は居合わせた同社の関係者に対し、自らと同年齢の社員の役職を質問。「一番若い課長…（３４歳では）行かないかも」との答えに「課長にも行けない」と“悲観”してみせ、会場の笑いを誘った。　「首相は『小泉進次郎？　もともと使う気ないよ』と思っているのでは。だから勘違いはしない。大臣をやりたい人は、いっぱい上に控えている」。改造人事をめぐる報道の過熱ぶりとは対照的に、小泉氏は冷めた態度に終始した。'),(199,'レゲエの本場、安倍首相ノリノリ？　ジャマイカでダンス','pol','　安倍晋三首相は９月３０日夕（日本時間１０月１日朝）、カリブの島国ジャマイカの首都キングストン市内にある「ボブ・マーリー博物館」を訪れた。同国のシンプソンミラー首相らが出迎えて案内し、「レゲエの神様」と慕われた同国出身の歌手ボブ・マーリーの銅像やレコードの展示などを見学した。【写真】ジャマイカのシンプソンミラー首相主催の夕食会で、レゲエ界の大御所フレディ・マクレガー氏の歌に合わせて踊る安倍晋三首相＝９月３０日午後（日本時間１日午前）、ジャマイカ・キングストンの首相官邸、飯塚晋一撮影　ボブ・マーリーの代表的なヒット曲「ワン・ラブ」にあわせてシンプソンミラー氏が口ずさみ、安倍氏も曲の調子に乗りながら聞いていたという。　また、シンプソンミラー氏主催の夕食会にも参加。同氏の求めに応じ、レゲエ歌手の歌にあわせて参加者らとダンスを楽しんだ。　これらに先立ち、安倍氏とシンプソンミラー氏は首脳会談を行った。日本が常任理事国入りを目指している国連の安全保障理事会の改革や防災、気候変動問題などで連携していくことで一致。新たな省エネ技術の協力などを盛り込んだ共同声明を発表した。（キングストン＝福間大介）'),(200,'海外リスク債への投資解禁＝年金運用、高利回り期待―GPIF','pol','　公的年金を運用する年金積立金管理運用独立行政法人（GPIF）は1日、高い利回りが期待できる海外の低格付け債への投資を開始したと発表した。　より高い運用利回りを確保するのが狙い。　GPIFではこれまで債券投資で、「投機的（ダブルB）」以下の格付けの「リスク債」を対象から外してきたが、これからは、運用の委託先の判断に基づき「ダブルB」以下の低格付け債への投資を認める。　これに伴いGPIFは、低格付け債投資も認める運用委託先として野村アセットマネジメントなど18社を選定した。　'),(201,'畠山、川端が持ち味＝真中監督の見た正夢−プロ野球・ヤクルト','spo','　ヤクルトの真中監督は試合前に「一回にうちが点を取る夢を見た」と話した。指揮官の夢を現実にしたのは、4番畠山のバットだった。　2番川端が中前打で出ると、山田が四球を選んで好機を広げる。4番の畠山は外角低めのスライダーに体勢を崩しながらも左前へ技ありの一打。1点を先制し、「どんな形でも、どうしても先制点が欲しかった。走者をかえすことができてよかった」。　優勝が懸かる大一番での先制点は、畠山自身にとっても価値ある1点となった。今季105打点目。1977年に大杉がマークしたチームの日本選手最多記録（104打点）を更新した。9月28日に記録が並んだ際には「チームメートに感謝したい。自分が打点を挙げて、優勝が決まればうれしいけれど…」と願っていた。　先制のホームを踏んだ川端も一回の安打で今季193安打。チームでは青木（現米大リーグ・ジャイアンツ）以来となるシーズン200本も実現の可能性があるが「数字は全く考えていない。それよりも勝ちたいだけ」。　2年連続最下位のヤクルトが優勝目前。ここまで引っ張ってきた看板の強力打線が、立ち上がりに持ち味を見せた。'),(202,'小木曽が2位浮上＝アジア・アマゴルフ','spo','　優勝者に来年のマスターズ・トーナメントの出場権が与えられる男子ゴルフのアジア・パシフィック・アマチュア選手権は2日、香港のクリアウォーターベイ・クラブ（パー70）で第1ラウンドの残りと第2ラウンドが行われ、小木曽喬（福井工大）が65で回り、通算8アンダーで首位と2打差の2位に浮上した。　　長谷川祥平（大院大）が通算6アンダーで6位、小西健太（東北福祉大）が3アンダーの19位につけ、日本勢は6人ともが決勝ラウンドに進んだ。　'),(203,'レスリング登坂「会社の名前背負って強くなれる」','spo','　レスリングの世界女王、登坂絵莉（２２＝至学館大）が頼もしいバックアップを受けて「女子レスリングの顔」になる。【写真】登坂絵莉も逆転金に涙「これで本当のチャンピオン」　９月の世界選手権４８キロ級で３連覇を果たしたリオデジャネイロ五輪の金メダル候補は２日、名古屋市内で東新住建入社内定会見に出席。来春の入社を前に「これからは会社の名前を背負うけれど、背負うものがあるほど強くなれる」と抱負を口にした。　多くの企業から勧誘を受けた登坂が愛知県稲沢市にある同社への入社を決めたのは「練習環境を変えずに金メダルを目指したい」から。さらに「これからも（吉田）沙保里さんと一緒に練習していきたい」とも話した。入社後は広告宣伝課レスリング部に籍を置き、競技生活に専念。同時に至学館大大学院にも進む。　日本レスリング協会女子強化委員会はリオデジャネイロ五輪後、吉田沙保里の５３キロ級と伊調馨の５８キロ級には若手を登用する方針。栄和人強化本部長は「今後は登坂がレスリング界の顔になるのでは」と期待した。'),(204,'＜浅田真央＞手応え！トリプルアクセル…３日、復帰戦に登場','spo','　フィギュアスケートの日本、欧州、北米の３地域対抗戦、ジャパン・オープンの公式練習が大会前日の２日、会場のさいたまスーパーアリーナで行われた。【写真特集】練習に取り組む浅田真央選手　約１年間の休養を経て、復帰戦に臨む元世界女王、浅田真央（中京大）は「緊張や不安もあるが、自分が戻ってきたいと思って戻ってきた舞台。雰囲気を楽しめたらいいんじゃないかな」と笑顔をみせた。　上下黒の練習着でリンクにあがった浅田は、フリーの曲「蝶々夫人」の音楽に乗せて１度、音なしの練習で２度の計３回、トリプルアクセル（３回転半ジャンプ）に挑戦し、すべて着氷。「自分の中にちゃんとアクセルがある感じ」と手応えを口にした。　最後に優勝した２０１４年世界選手権と同じ会場。復帰会見から５カ月で同じ演技構成ができるレベルに仕上げ、「優勝したときの感じを思い出して臨みたい」と浅田。自らリクエストした着物をモチーフにした新しいコスチュームで復帰戦の舞台に臨む。【中村有花】'),(205,'【公式練習後一問一答】真央、復帰戦へ「自分の思っている以上に良かった」／フィギュア','spo','　フィギュアスケート女子の浅田真央（中京大）が２日、復帰戦となるジャパン・オープン（さいたまスーパーアリーナ）の前日練習に臨んだ。以下、公式練習を終えての一問一答。　−−公式練習を終えて　「リンクの感覚は、去年の世界選手権と変わらない。自分の思っている以上に良かった。いつもと変わらず、落ち着いて滑れた。その感覚を忘れずに滑りたい。きょうだけでなく、今後の自信にもなる練習だった」　−−復帰後、初の試合に向けて　「１年間休んで、休養していたけど、（昨季までの）試合前日と状態は変わらない。１年間、試合に出ていなかったことは考えず、いつも通り試合に臨む。今まで練習してきたことを出す最初の舞台。緊張はある。この舞台に戻って来たいと思っていた。試合を楽しめればいい」　−−フリーについて　「ジャンプだけが見どころじゃない。蝶々夫人は大人の物語。自分なりに表現して、見ている人に何かを感じてもらえれば」　−−日本チームとしての目標　「１年１年過ぎれば、一番上になる。日本チームでは一番年上。引っ張っていけたら」　−−フリーの衣装は　「フィギュアの衣装でなかなか作れないけど、着物をイメージしたものになっている」　−トリプルアクセルの調子は　「特別なジャンプと捉えることなくきている。それだけ自分の中にアクセルがある」　−−練習を再開してからの状態は　「昨年の世界選手権のレベルまで戻せるか不安だったけど、同じレベルに持ってこれた。優勝したときのエレメンツ（演技構成）と同じ。いいイメージで臨める。優勝したときを思いだしながら臨みたい」'),(206,'フィギュア、昨季全日本女王・宮原「気持ちは大きく変わらない」','spo','　フィギュアスケート女子の宮原知子（１７）＝大阪・関大高＝が２日、ジャパンオープン（３日、さいたまスーパーアリーナ）の前日練習を行い、取材に応じた。　練習を終え、「すごく楽しみ」と話した宮原は、昨季の全日本女王として臨むシーズンにも「自分の中で気持ちが大きく変わることはない」と平常心を強調した。　昨シーズンは世界選手権でも銀メダルを獲得。「世界２位を自信にして、今年は（グランプリ）ファイナルにいきたい。メダルが取れるようにがんばりたい」と意気込んだ。'),(207,'浅田真央　トリプルアクセル進化に手応え「楽に跳べるようになった」','spo','　フィギュアスケートのジャパンオープン（３日・さいたまスーパーアリーナ）の前日練習が２日、会場で行われ、１年間の休養からの復帰戦となる元世界女王の浅田真央（２５）＝中京大＝は、得意のトリプルアクセル（３回転半ジャンプ）に３度挑戦し、すべて完ぺきに着氷するなどブランクを感じさせない滑りを披露した。　休養前以上のキレを感じさせた“伝家の宝刀”について真央は「楽に跳べるようになった。良い感じでスポットに入っている。ソチ五輪シーズンよりもいいアクセルが跳べている」と説明。　自身の代名詞ともいえるジャンプだが「自分の意識の中でトリプルアクセルを特別なジャンプととらえることなくきてる。それだけ自分の中にアクセルがある」と、手応えを滲ませた。'),(208,'【競輪】成田和也が落車して救急搬送される　左鎖骨骨折の疑い','spo','　「平安賞・Ｇ３」（２日、向日町）　２日目１０Ｒの２次予選で落車した成田和也（３６）＝福島・８８期・Ｓ１＝は、左鎖骨骨折の疑いで、長岡京市内の病院に救急搬送された。　成田は昨年８月に豊橋で右鎖骨を骨折。同１２月にも広島で右鎖骨、恥骨を骨折。今年６月の小田原では左鎖骨を骨折している。'),(209,'浅田真央　フリー「蝶々夫人」の衣装は着物風','spo','　フィギュアスケートのジャパンオープン（３日・さいたまスーパーアリーナ）の前日練習が２日、会場で行われ、１年間の休養からの復帰戦となる元世界女王の浅田真央（２５）＝中京大＝は、トリプルアクセル（３回転半ジャンプ）に３度挑戦し、すべて完ぺきに着氷するなどブランクを感じさせない滑りを披露した。　この日は上下黒の練習着で滑ったが、練習後には３日にお披露目となるフリー「蝶々夫人」の衣装にも言及。「自分のこだわりで着物のようなコスチュームになっています。蝶もついている」と、出来映えに自信。　久々の試合に向けて「ジャンプも見所だけど、それだけじゃなく、蝶々夫人という物語を自分なりに表現して、見ている人に感じてもらえたら」と、笑顔で話した。'),(210,'トリプルアクセル着氷…浅田真央、仕上がり順調','spo','　フィギュアスケートのジャパンオープン（３日・さいたまスーパーアリーナ）の公式練習が２日、行われた。　１シーズンの休養を経て復帰する浅田真央（中京大）は、代名詞のトリプルアクセル（３回転半ジャンプ）を着氷するなど順調な仕上がりを見せた。　優勝した昨年３月の世界選手権以来の大会出場となる浅田は、その時と同じ会場での復帰戦を前に、「（優勝時と）同じレベルまで（状態を）もってこられた。いいイメージで臨めると思う」と力強く語った。最近の練習でトリプルアクセルを楽に跳べているといい、「うまく自分の中でコントロールできている」と笑顔を見せた。　大会は、男女各２人のチームによる団体戦。日本、北米、欧州の３チームが、フリーだけで競う。'),(211,'浅田真央　完全復帰へトリプルアクセル全て着氷「以前よりいい質で跳べている」','spo','　フィギュアスケートのシーズン開幕戦「ジャパンオープン２０１５」（３日、さいたまスーパーアリーナ）で、２シーズンぶりに競技に復帰する浅田真央（２５＝中京大）が２日の前日練習で休養前と変わらぬジャンプを披露した。　代名詞のトリプルアクセルは３回飛んで、いずれも着氷した。「休養前と何を変えたわけじゃないけど、楽に跳べるようになりました。アクセルとルッツは以前よりいい質で跳べている」　前日練習でトリプルアクセルを３回しかトライしないこと自体が異例。「特別なジャンプと捉えることなくできている」と普段の練習でも、最重要課題としていないことを明かした。　さいたまスーパーアリーナは休養前最後の試合であり、優勝を果たした昨年３月の「世界選手権」と同じ会場。「今後に向けても自信になる練習でした。いいイメージで臨めると思う」　５月の復帰会見では「最低でも昨年の世界選手権のレベルに戻らなければ、試合には出られない」と話しており、その条件をクリアしたと判断したうえでの復帰戦。ジャンプの構成などは以前と同じ。さらに強い真央になって、戻ってきたのは間違いなさそうだ。'),(212,'【浅田真央一問一答】再スタートへ「ここからが長いんだろう」','spo','　フィギュアスケート女子の元世界女王で、現役続行を明言した浅田真央（２５）＝中京大＝が２日、復帰戦であるジャパンオープン（３日、さいたまスーパーアリーナ）の前日練習を行い、取材に応じた。１年の休養を経て、浅田がいよいよ競技の第一線に戻ってくる。　‐前日練習を終えて。　「ここに来るまで、緊張もワクワクも、いろいろあった。１年間あいたけど、そこまで久しぶりという感じはしない。戻ってきたなという感じ。（１４年の）世界選手権で優勝したリンクで、また初戦を迎えられるのはうれしい。感覚は世界選手権と変わらないし、自分の滑りは思っている以上によかった」　‐リンクサイドで練習を見守った佐藤信夫コーチ（７３）からは？　「いつものようにいろんなアドバイスをもらった。私も先生も何も変わらず、ですね」　‐練習の状態は。　「自分の中ではベスト。最初は大丈夫かなって不安の方が大きかったけど、とにかく（１４年の）世界選手権のレベルまで戻すという気持ちだけでやってきた」　‐休養によってトリプルアクセルに変化は？　「楽に跳べるようになった。ソチシーズンよりいいアクセルが跳べてるんじゃないかな。ジャンプも見どころだけど、蝶々夫人という物語を自分なりに表現したい。見ている人に感じてもらえたら」　‐休養は良かった？　「そうですね。ジャンプだけじゃなくて、気持ちもそう。自分の人生においても１年休んで良かった」　‐いざ復帰して。　「心から戻ってきたいと思って来た。今は前へ進もうという気持ちが強い。また大きくステップアップできるための休養だった」　‐今季の衣装は？　「ショート（プログラム）は好きな色。フリーは自分のこだわり、着物のようなコスチュームです。フィギュアの中でも着物はあまりないので、作りたいという気持ちがあった。蝶々夫人なので、チョウをつけたり。フリーもショートとは違う色だけど、好きな色です」　‐復帰を発表してからここまでは。　「早いですね。今からがスタートだから、ここから長いんだろうと思いますが」　‐今季の目標は？　「１つ１つベストのプレーをすること。今回のジャパンオープンでも、できることを出し切りたい」　‐順調に復帰戦を迎えて、五輪への思いは。　「今はあしたのことを考えたいなと思います」'),(213,'前田が1500投球回＝プロ野球・広島','spo','　広島の前田健太投手は、2日の中日24回戦（マツダ）の五回に1死を取ったところで通算1500投球回に到達した。　プロ野球169人目。　'),(214,'浅田真央、トリプルアクセル好調　ＪＯ前日練習','spo','　フィギュアスケートのジャパンオープンは３日、さいたまスーパーアリーナで開かれる。２日の前日練習では、現役続行を決めた女子の浅田真央（中京大）が、トリプルアクセル（３回転半）ジャンプを３度試み、すべて着氷させた。順調な調整ぶりを披露し、「ソチ五輪より、良い感じでトリプルアクセルが跳べている」と語った。【写真】公式練習をする浅田真央＝白井伸洋撮影　現役続行を表明した５月の記者会見では「（昨年の）ソチ五輪の時の状態に戻したい」と目標を語っていた。アイスショーを終えた８月上旬から本格的な練習を再開し、トリプルアクセルも手応えをつかんだという。「レベルはすでに戻っている。今までと変わりなく初戦を迎えられる。ベストのパフォーマンスを出し切りたい」。オペラの名作「蝶々夫人」の曲を使用するフリーは、着物をイメージした衣装で舞う。'),(215,'電通から出向、エンブレム責任者を事実上更迭','spo','　２０２０年東京五輪・パラリンピックの大会エンブレムが白紙撤回された問題で、大会組織委員会は２日、エンブレム作成の責任者を務めていたマーケティング局の槙英俊局長と、企画財務局の高崎卓馬・クリエイティブディレクターが同日付で退任したと発表した。　２人は大手広告会社の電通から出向していたが、「業務遂行の見直し」を理由に２人の出向協定が解除され、事実上の更迭となった。マーケティング局長は当面、布村幸彦・副事務総長が兼任する。　組織委によると、槙局長は、マーケティング局がインターネット上の他人のサイトから写真を無断で使用した問題で戒告処分を受けていた。高崎ディレクターは、旧エンブレムを作成したアートディレクターの佐野研二郎氏の原案修正に関与した。'),(216,'浅田、トリプルアクセル3度着氷＝2季ぶり復帰戦へ自信―フィギュア','spo','　フィギュアスケートの日本、北米、欧州の3地域対抗団体戦、ジャパン・オープンの公式練習が大会前日の2日、会場のさいたまスーパーアリーナで行われた。　2シーズンぶりの復帰戦に臨む浅田真央（中京大）はトリプルアクセル（3回転半ジャンプ）を3度着氷。順調な調整ぶりを示し、「自分が望んだレベルまで戻せた。シーズン初戦にしては、今までの中でもいい方だと思う」と自信をにじませた。　浅田は今季フリーで使用するオペラの名曲「蝶々夫人」をかけた練習で、冒頭のトリプルアクセルからフリップ―ループの連続3回転、ダブルアクセル（2回転半）―3回転トーループなど得点源となるジャンプを次々に着氷。「（休養する前より）トリプルアクセルと3回転ルッツの質は良くなっている」と手応えを口にした。　浅田は昨年3月の世界選手権で3度目の優勝を果たした後、約1年間休養。今年5月から佐藤信夫コーチと練習を再開し、現役続行を決めた。　'),(217,'【駅伝】駒大に「欽ちゃん走り」伝授　活躍続ける秘訣も','spo','　学生３大駅伝の開幕戦、出雲駅伝（１２日）に向けて、最終調整に入った駒大に「欽ちゃん走り」が伝授された。今年、駒大仏教学部に入学したタレントの萩本欽一さん（７４）が２日、東京・世田谷区の玉川キャンパスで選手を激励した。　駒大ランナーにとって最高の“欽曜日”だった。社会人硬式野球クラブの「茨城ゴールデンゴールズ」の監督経験を持ち、スポーツにも理解が深い欽ちゃんのアドバイスは真剣で熱いものだった。前回の箱根駅伝４区２位の次世代エース工藤有生（２年）が「長い間、活躍を続ける秘訣（ひけつ）は何ですか」と質問すると「勝った時、喜ぶ時間を短くするの。エベレスト登頂に成功した人は頂上で一日、喜びに浸っているわけではない。すぐに山を降ります。それと同じ。そして、負けた時、悔やむ時間をやっぱり短くするの。それを続けていたらアッという間に７４歳になっちゃった」と笑顔で答えた。　欽ちゃんはヒーローインタービューについても助言。箱根駅伝で１、２年時に連続で区間賞を獲得した中谷圭佑（３年）が「区間賞、取りました」と言うと「タメを入れないとダメ、ダメ！」とダメ出し。「区間賞、取っ…たぞー！」。中谷の“テイク２”に欽ちゃんは「その調子だよぉ」と拍手を送った。さらに「インタビューの最後に『欽ちゃんのお陰で勝てました』と言ってくれたらうれしいね」とオチをつけて選手の笑いを誘った。　前回の箱根駅伝を圧勝した青学大が今季も大本命。だが、其田健也主将（４年）は「青学大は確かに強いですが、負けたくありません」と言い切った。生き生きとした欽ちゃん走りを直伝された駒大ランナーの決意は固まった。３冠目指して、ドンとやってみよう！'),(218,'日比野が決勝進出＝女子テニス','spo','　女子テニスのタシケント・オープンは2日、タシケントで行われ、シングルス準決勝で日比野菜緒（フリー）がボヤナ・ヨバノフスキ（セルビア）を6―3、6―4で下して決勝に進んだ。　'),(219,'柏原が1打差2位＝首位は柳簫然―日本女子オープンゴルフ','spo','　【女子ゴルフ・日本女子オープン選手権】第2日（2日、石川・片山津GC・白山、6613ヤード＝パー72、賞金総額1億4000万円、優勝2800万円）　柳簫然（韓国）が72で回り、通算4アンダーの140で首位を守った。1打差の2位に柏原明日架、さらに1打差の3位に香妻琴乃がつけ、4位にはささきしょうこ、アマチュアの新垣比菜（沖縄・興南高）、イ・ボミ（韓国）らが続いた。　通算7オーバーまでの61人が決勝ラウンドに進み、宮里藍は1打及ばず、昨年優勝のテレサ・ルー（台湾）も予選落ちした。　'),(220,'長谷川が現役続行＝34歳「もう一度世界を」―ボクシング','spo','　ボクシングの元世界2階級王者、長谷川穂積（34）＝真正＝が2日、現役続行を表明した。　5月の再起戦に勝った後、進退について態度を保留していたが、記者会見で「引退しようかなと思ったが、もう一度強い相手と戦いたいと思うようになった。チャンスがあれば（世界）挑戦したい」と話した。　再起戦後に初めて取り入れたフィジカルトレーニングに効果を感じたそうで、「これを続けたら強くなると思った。強くなれると分かっているのに辞める必要はない」と理由を説明した。　次戦は12月11日に神戸市立中央体育館で行うフェザー級ノンタイトル戦で、世界ランカーと対戦する予定。同日は、多田悦子（真正）が出場する国際ボクシング連盟（IBF）女子ミニフライ級王座決定戦も行われる。　'),(221,'加藤が戦力外＝プロ野球・阪神','spo','　阪神は2日、加藤康介投手と来季の契約を結ばないと発表した。　'),(222,'100ｍ総体王者の東京・大嶋健太Ｖ　わかやま国体','spo','＜２０１５紀の国わかやま国体＞◇第７日◇２日◇和歌山・紀三井寺公園陸上競技場◇少年男子Ａ１００メートルほか【写真】大嶋が100ｍ涙の連覇　日本選手権のリベンジ果たす　高校総体王者の大嶋健太（東京高３年）が優勝を果たした。　追い風１・０メートルの決勝で、１０秒３４でフィニッシュ。２位犬塚渉（静岡・浜名高３年）とわずか０秒０４差の接戦を制した。　「冷静に走ることができた。６０メートルまでは競っていたけど、最後に抜けた。レース展開が良かった」と笑顔を見せていた。'),(223,'＜ボクシング＞長谷川、現役続行を表明…１２月に１０回戦','spo','　世界ボクシング評議会（ＷＢＣ）バンタム、フェザー両級元王者の長谷川穂積（３４）＝真正＝が２日、神戸市内の所属ジムで記者会見し、「練習しているうちにもう一度、強い相手とやりたいと思うようになった」と現役続行を表明した。１２月１１日に神戸市立中央体育館でフェザー級ノンタイトル１０回戦を行う。相手は世界ランカーを予定している。　長谷川は進退を懸けた５月の再起戦（フェザー級ノンタイトル１０回戦）に判定勝ちしたが、進退を明言しなかった。その後、これまで取り組まなかったフィジカルトレーニングを行い「強くなれる自分が見つかった。それを試すのは試合でしかない」と考え、８月に現役を続けることを決めたという。　また国際ボクシング連盟（ＩＢＦ）女子ミニマム級王座決定戦に多田悦子（３４）＝真正＝が臨むことも発表された。【安田光高】'),(224,'フェアリージャパンに国際体操連盟会長も太鼓判','spo','　９月にリオデジャネイロ五輪予選を兼ねた新体操の世界選手権に出場した日本代表（フェアリージャパン）が２日、東京都内のスポーツ庁を訪れ、鈴木大地長官（４８）と対面した。【写真】鈴木大地スポーツ庁長官が初登庁「精進したい」　個人総合では個人で３大会ぶりとなる五輪出場枠を獲得。団体も５位で８位以内の五輪出場を決めた。団体ではリボンで銅と７５年マドリード大会以来、４０年ぶりにメダルを獲得。五輪種目ではない種目別とはいえ、日本の実力アップを証明した。　イオン・カップ世界クラブ選手権（２日開幕、東京体育館）視察のため、来日中でともにスポーツ庁を訪れた国際連盟のグランディ会長も「日本はトップ国の１つになった」と太鼓判を押した。　鈴木長官は新体操のレベルアップに感心しつつ、同世代の山崎浩子監督を見て「一緒に（ソウル）五輪に出た」と旧交を温めた。'),(225,'大嶋、少年男子100連覇＝和歌山国体陸上','spo','　第70回国民体育大会「紀の国わかやま国体」は2日、和歌山市の紀三井寺公園陸上競技場などで行われ、陸上少年男子Aの100メートルは、大嶋健太（東京・東京高）が10秒34で制し、高校総体に続いて連覇を遂げた。　同女子A100メートルはエドバー・イヨバ（同）が11秒66の大会タイ記録で初制覇した。　成年女子5000メートルは西原加純（群馬・ヤマダ電機）が15分33秒51で、同男子砲丸投げは日本記録を持つ畑瀬聡（群馬・群馬綜合ガードシステム）が17メートル57で制した。　'),(226,'【ラグビーW杯】キーマン五郎丸歩「サモア戦は『組織』で勝負します」','spo','　もう絶対に負けられない。ラグビーのワールドカップ（W杯）イングランド大会で、南アフリカから歴史的な勝利を挙げた1次リーグB組の日本代表は、3日午後2時半（日本時間同日午後10時半）から、英国ミルトンキーンズでパワフルなサモアと第3戦を戦う。目標の決勝トーナメント進出（ベスト8）を果たすためには、勝利が至上命令となる。　日本は目下、南アフリカに勝ちながらも1勝1敗の勝ち点4でサモアと並んでいる。同組1位が2勝のスコットランドで勝ち点10、2位は1勝1敗の南アで勝ち点7となっている。いずれもボーナスポイントを生かした結果で、日本が残り2戦を連勝しても、決勝トーナメントに進出する5チーム中上位2チームに入れない可能性もあるが、人気急上昇のフルバック（FB）五郎丸歩（ヤマハ発動機）は言う。「我々はあくまでチャレンジャー。まだ（ボーナスポイントを）計算するレベルではないですね。他チームのことや、先のことを考えずに、勝つことが一番大事だし、チーム全員がそう思っています。（サモアに）勝たないことには何も始まらない」　第2戦のスコットランド戦ではラスト20分、ディフェンスの連係、ブレイクダウン（タックル後のボール争奪戦）での精度が落ちて大敗した。だが、中9日で心身ともにリフレッシュはなされた。ディフェンスも、アタックも、個のサモアに対し、「全部組織で勝負ですね」と、五郎丸は強調した。　サモアの選手個々の破壊力は凄まじく、身体能力も高い。巨漢の相手がスピードに乗ると手がつけられなくなる。日本が守勢に回ると、タックルを受けながらでもボールをつないでくる。まずはこの勢いを止める。南ア戦で見せたような相手の太ももに入る“チョップ・タックル”と前に早く出るラインディフェンスがカギを握る。　サモアのキーマンは、トップリーグのサントリーでお馴染みのスタンドオフ（SO）トゥシ・ピシと、今季からリコーに入団するFBティム・ナナイ・ウィリアムズである。特に「アンストラクチャー（崩れた局面）」で自由にさせるとピンチが広がる。怖いのはキックからのカウンター、ターンオーバーからの逆襲……。「アンストラクチャーからのアタックは彼らの得意なところ。その辺は警戒すべきですね」と五郎丸。　すなわち、蹴り出す時はきっちりタッチを割る。パントキックには複数で“網”となってチェイスし、フォローする。五郎丸らの戦略的なキックがより重要となるだろう。「相手の（ゴール前）5メートルまでいけば、（ラインアウトから）トライは獲れるので強気で攻めるしかない」と意気込む。　チーム練習では、このサモアの2人のキーマンの名前を叫びながら、マークを意識した。ピシは精神的に脆いところがある。名前を呼ぶことは、相手へのプレッシャーになるし、日本チームの意思統一を促すことになる。　月曜日（9月28日）の練習ではエディー・ジョーンズヘッドコーチ（HC）のカミナリが落ちたそうだ。「気持ちを切り替えろ」「サモア戦に集中しろ」と。理不尽な怒り方にカチンときたらしいが、これでスイッチが入ったと副将の五郎丸は説明する。'),(227,'健康と美容にも効果抜群！アスリートの体調を整えるオーストラリアの完全食品。','spo','アスリートの心の中に渦巻くブツ欲を赤裸々に紹介し、解消していくこの企画。「ご意見番」として登場するのは、ファッション＆モノ業界で長年活躍する“スマート”奥山泰広氏と、その相棒の“ワイルド”高成浩氏。季節はすっかり秋！　本格的なスポーツシーズンを前に、夏の暑さで身体のコンディションを崩してしまった高氏。そこで奥山氏が用意したのは、ここ最近アスリートの間で人気が高まりつつあるオーストラリア発の健康食品「ヘンプシード」だ。必須脂肪酸をはじめ、ビタミンやミネラルも豊富なパーフェクトフードのおかげで、高氏の体調は完全復活するのか!?　　奥山　めっきり涼しくなったので、スポーツが楽しくなるじゃないですか。高さんは早速、秋のロングライドに行くんでしょ？　　高　いや、それがサァ、この夏の暑さで体調を崩しちゃったみたいでサァ……。食欲がないし、便の調子も良くないんだよねぇ。回復しないうちは、ロングライドに行けないな……っていうか、身体のコンディションが良くないと、スポーツする気が失せちゃうよな。　奥山　ふむふむ。高さんのことだから、暑い夏にビールをガンガン呑みまくってたんでしょ!?　しかも野菜なんて食べないで、脂っこいモノばっかりつまんでたんでしょ!?　　高　ギクッ!!　　いや、ビールは痛風が怖いんで、プリン体「0」のホッピーを呑んでたんだけど……。　奥山　高さんみたいに好きなモノばっかり食べてると、栄養が偏ってしまうんです。また、栄養素の中には体内で作り出すことができないモノもあって、そういうのはちゃんと食べ物で補わなきゃいけないんですよ。例えば生命維持に不可欠なEFA……必須脂肪酸は、食べ物から摂取しないとダメなんです！　　高　ギクギクッ。EFAってどんな食べ物に含まれているの？　　奥山　EFAにはアルファーリノレン酸、EPA、DHAなどの「オメガ3系」と、リノール酸やアラキドン酸の「オメガ6系」が代表的ですね。アルファーリノレン酸はシソ油とか亜麻仁油とか、高級スーパー＆セレブ食品店にあるようなリッチな食品油に含まれています。EPAやDHAがサバとかマグロとかに多く含まれているのはご存知ですよね？　リノール酸はナッツ類、アラキドン酸は牛や豚のレバーに含まれていますよ。　高　う〜む、今年は相模湾のサバ釣りに行かなかったから、あまり食ってないな。その代わり、焼きトン屋で呑んだときは必ずレバーは食ってたし、二次会ではバーボン呑みながらナッツをつまんでたよ。　奥山　しめ鯖も焼きトンもナッツも、毎日食べられないでしょ？　　高　ううむ、まぁ、そうだな(汗)。でも、どうしたらいいの？　　奥山　そこで高さんにお薦めしたいのが、この『ラリースヘンプ』シリーズです。'),(228,'【ラグビーW杯】母国の代表の座を捨ててまで日本を選んだ男たち','spo','　ラグビー日本代表が南アフリカ代表相手に歴史的勝利を飾った翌日、その立役者となったFB（フルバック）五郎丸歩がツイッターでつぶやいた、日本代表のユニフォームを着て戦う外国人選手にもスポットを当ててほしいとの内容は、ワールドカップの報道のなかでも視点の違った関心事として注目を集めた。前編はこちら＞＞＞　今大会の日本代表メンバー31人のうち、外国出身の選手は10人。そのうち日本国籍を取得している5名は、前回のコラム（【ラグビーW杯】日本代表を彩る「外国出身選手」の異色な経歴）で紹介したとおりだ。今回は、残る5人の外国籍の日本代表選手がどんな人物なのか、スポットを当ててみたい。　まずは、日本代表のBK（バックス）陣を見てほしい。そのリストに控える外国籍選手の面々は、いずれも世界クラスの実力を誇るラガーメンばかりだ。「ワールドカップ史上最大のアップセット（番狂わせ）」と評された南アフリカ代表戦――。終了寸前に決勝トライを決めたのが、宗像サニックスでプレーしているWTB（ウィング）カーン・ヘスケス（30歳）だ。　ニュージーランド出身のヘスケスは、2010年に来日。日本での生活は6シーズン目を迎えている。妻のカーラ・ホヘパは2010年の女子ラグビーワールドカップにニュージーランド代表として出場し、トライ王を獲得。さらに年間最優秀女子選手にも輝くなど、夫婦そろってインターナショナルレベルで活躍するラグビー選手だ。　現在7人制ラグビーで活躍する妻の「影響もあった」と語るヘスケスは、来日3年目ぐらいから日本代表を意識しはじめたという。そして、2014年に初キャップを獲得。日本食が大好きで、特にうどんなどの麺類が好物だと語るヘスケスは、日本の地にすっかり根付いたウィンガーである。　日本代表のBKラインの要として欠かせない存在であるCTB（センター）マレ・サウ（27歳）は、U20ニュージーランド代表にも選ばれたことのある選手。2008年、19歳でヤマハ発動機に入団し、五郎丸とは同期にあたる。　両親がサモア人であることから、当初はサモア代表入りが有力視され、代表候補にも選ばれていた。サモア代表、ニュージーランド代表、日本代表の3ヶ国で代表資格を持っていたが、2013年に日本を選択。不動のアウトサイドセンターとして、今大会でもBK陣を牽引している。ちなみに嫌いな食べ物は、納豆といくら、なんだとか。　そのBK陣のなかで一番のベテランは、ラグビーリーグ（13人制）のスター選手としてオーストラリア代表「カンガルーズ」でもプレーした経験を持つCTBクレイグ・ウィング（35歳）だ。父がオーストラリア人、母がフィリピン人で、トップリーグではアジア枠で出場できることから、2010年にNTTコミュニケーションズに入団。2012年から神戸製鋼でプレーしている。'),(229,'今月のイチオシ第2弾！10月はテニス、サッカー、ゴルフも見逃せない','spo','■スポルティーバ・今月のイチオシスポーツ　10月は注目のスポーツが盛りだくさん！ということで、プロ野球以外にも注目していきます。　錦織圭選手が出場するテニスの楽天ジャパンオープンが、3日から東京・有明で始まります。錦織選手の世界ランキングは現在6位。昨年末に初出場を果たした、世界ランキング8位までの選手による”ATPツアー・ファイナル”に今年も出場するためには、この大会でもポイントを稼いでおきたいところ。錦織選手はもちろん、日本で世界トップレベルのプレーが見られる貴重なチャンスです。　また、8日にはサッカー日本代表が2018ロシアワールドカップアジア2次予選のシリア戦をアウェー（開催地はオマーン）で戦います。シリアは現在グループEの1位で、2位の日本の上にいる状況です。2次予選突破の条件が、各グループ1位8カ国＋各グループ2位の中で成績上位4カ国＝計12カ国と考えると、ここはぜひとも勝って1位になっておきたいですね。　このほか10月は、男女のゴルフメジャー大会である日本女子オープン（1日から）、日本オープン（15日から）や、競馬のGIレース（4日：スプリンターズステークス、18日：秋華賞、25日：菊花賞）も華やかに開催されます。Jリーグヤマザキナビスコカップは、7日、11日の準決勝で鹿島アントラーズvsヴィッセル神戸、ガンバ大阪vsアルビレックス新潟が対戦し、その勝者が10月31日の決勝で激突します。　海外ではNBAが27日（日本時間28日）に開幕しますが、シカゴ・ブルズのデリック・ローズが眼窩（がんか）骨折という心配なニュースも。そのブルズの開幕戦の相手は、レブロン・ジェームズ率いる昨シーズンのカンファレンス王者、クリーブランド・キャバリアーズです。盛り上がること間違いなしの一戦は見逃せません。'),(230,'【ロードバイク情報】リドレー フェニックス SL   JP10周年記念 日本限定カラー','spo','株式会社ジェイピースポーツグループでは、リドレー取り扱い10周年を記念して、リドレーのベルギー本社に直接オーダーした日本限定カラーの「フェニックスSL」を発表した。日本限定カラーは2種類あり、ひとつはノアで人気があったデザインにも似た鮮やかなレッドカラー。もうひとつは日本代表をイメージして白地に赤をあしらったデザイン。価格は完成車で30万5000円（税抜）（参考：フレーム価格23万5000円税抜）。何がすごいって「フェニックスSL」は2015ツール・ド・フランスでステージ4勝を挙げたアンドレ・グライペル（ロット・ソウダル）と同じバイク。そう、プロスペックなのである。それなのに完成車でこの価格というのは、10周年記念限定ならでは。初心者ならアルミロードから入るという手もあるが、「フェニックスSL」というチョイスもオススメ。日本でしか手に入らない限定カラーモデルは、いま注文すると2016年春ごろ入荷予定。フェニックスから「フェニックスSL」になって進化したのは、フロントフォークのエアロ技術、フレキシブルなシートステーなど。250gの軽量化も実現し、軽量、快適性、空力性を兼ね備えてリドレーのいいところを盛り込んだオールラウンド・エンデュランスバイク「フェニックスSL」が気になる！という人は、リドレー正規販売店までお問い合わせを。'),(231,'来年1月にコロンビア戦＝フットサル日本代表','spo','　日本サッカー協会は2日、フットサル日本代表が来年1月にコロンビア代表と国際親善試合を2試合行うと発表した。　来年1月27日に東京・国立代々木競技場、同30日に大阪市中央体育館で対戦する。　'),(232,'決勝は1時5分開始＝Jリーグ・ナビスコ杯','spo','　Jリーグは2日、ナビスコ・カップ決勝（31日、埼玉スタジアム）の試合開始時間が午後1時5分に決まったと発表した。　準決勝の鹿島―神戸、G大阪―新潟の勝者が対戦する。　'),(233,'チームは生き物…。リーチ主将が語る、サモア戦を前にしたアップダウン','spo','　9月28日の朝。練習前にエディー・ジョーンズが強い口調で怒鳴ったという。FLリーチマイケル主将は振り返った。「これまで南アフリカ代表とやった後も、スコットランド代表とやった後も、切り替えよう、切り替えよう、と言っていた。ただ、何人かが切り替えられてなかったから…。その雰囲気を見て、エディーが『集中しろ』と」【ラグビーW杯2015】ラグビーリパブリック特設サイト　チームは生き物だ。ラグビー日本代表は、9月19日、ブライトン・コミュニティスタジアムでのラグビーワールドカップ（W杯）イングランド大会・予選プールB初戦で過去優勝2回の南アフリカ代表を34-32で撃破。23日、グロスター・キングスホルムスタジアムでの第2戦ではスコットランド代表に10-45と敗れたが、かすかに最初の金星に酔う匂いがあったと、指揮官は感じたのだろう。　　10月1日、合宿地であるウォリックでの取材エリア。FLリーチ主将は、一喝とその後の変化を明かした。「それまではまだ南アフリカ代表戦の話題も出ていた。ただ、そのことがあってからは話す内容がサモア代表戦のことだけになった。次の試合がどれだけ大事か。1人ひとりがわかって、集中しています」　10月3日には第3戦に挑む。ミルトンキーンズ・スタジアムmkでサモア代表とぶつかる。フィジカルの強さに自信を持つ相手を向こうに、「我慢です。こちらが焦っていつもやらないプレーをしてしまったら、一気に崩れてしまう。耐えて、耐えて…」と主将は意気込む。実は、1日の練習でもFLマイケル・ブロードハーストによれば「気負いでしょうか。意気込みはあったのですが、ディフェンスのところでエラーがあった」。ただ、その空気を察したFLリーチが皆をまとめ、こんな話をしていたようだ。「試合でも、こういうことは起こる。ちょっと、落ち着こう」　FLブロードハーストの述懐について、FLリーチ主将本人は言う。「今日の練習も入り（序盤）はよくなかったけど、練習の時に失敗をして『次は…（気を付けよう）』と気持ちを持って行くことはできた。状態はいいです」　準々決勝進出に向け、負けられない一戦を真っ直ぐに見据える。かねて「日本ラグビーを変えられるのは俺たちしかいない」と宣言してきたW杯出場2度目のリーダーは、こう言い切った。「チームは4年前（前回のニュージーランド大会）の時に比べたらいい。あちこち、痛いところはあるけど、大きなケガ人はいない。常にディシプリンとハードワークを。この2つが重要。自分の身体を犠牲にしないといけない」　相手のキーマンのSOトゥシ・ピシやFBティム・ナナイ・ウィリアムズにも、各所でプレッシャーをかけるという。例えば、ボールが渡る前から名前を呼んでいらつかせたり。「とても重要な試合です。代表が立ち上がった頃からベスト8を目指してきた。この試合に勝たないと目標を達成できない。ただ、勝つことにフォーカスし過ぎず、やるべきことをやる。結果、勝ったら次の試合へのメンタルづくりもしやすくなるし、目標にも近づく」　SO小野晃征やWTB山田章仁といった、南アフリカ代表戦で活躍したメンバーも故障などから復帰する。37歳のLO大野均は、日本代表のW杯最年長出場記録を塗り替える予定だ。それぞれがそれぞれの思いを持って臨む日本ラグビー界きっての大一番は、日本時間で10月3日の22時30分、キックオフ。（文・向風見也）'),(234,'キリオス、ストレート勝ちでベスト4進出＜男子テニス＞','spo','男子テニスツアーのマレーシア・オープン（マレーシア/クアラルンプール、ハード）は2日、シングルス準々決勝が行われ、第7シードのN・キリオス（オーストラリア）は第3シードのI・カルロビッチ（クロアチア）に7-6(7-4)，7-6(7-2)のストレートで勝利し、ベスト4進出を果たした。この試合、キリオスはカルロビッチの強力なサービスにブレークを奪うことが出来ず、1・2セット共にタイブレークまでもつれ込んだが、勝負所で強さを見せ接戦を制した。試合時間は1時間24分。キリオスは2回戦で伊藤竜馬（日本）に勝利し、準々決勝へ勝ち進んでいた。準決勝では第2シードのF・ロペス（スペイン）と第8シードのV・ポスピシル（カナダ）の勝者と対戦する。また今大会の第1シードD・フェレール（スペイン）は8強入りを果たしており、準々決勝でM・ククシュキン（カザフスタン）と顔を合わせる。昨年のマレーシア・オープンでは錦織圭（日本）が大会初のタイトルを獲得した。'),(235,'勝利に導くのは川崎F・大久保か、G大阪・宇佐美か','spo','3連勝中の川崎フロンターレと引き分けひとつを挟み4連勝中のガンバ大阪。『明治安田生命2015Ｊリーグチャンピオンシップ』出場に向けて、星を落とせない両軍が今週末激突する。【写真】宇佐美貴史(ガンバ大阪)G大阪は2ndステージ6勝4分2敗・勝点22の4位、川崎Fは6勝2分4敗・勝点20の6位。首位を走るサンフレッチェ広島が9勝1分2敗・勝点28を稼ぎ、2位・鹿島アントラーズが勝点25、3位・浦和レッズが勝点23で続く状況を考えると、正直両軍ともステージ優勝への道のりは厳しい。広島に勝点6差のG大阪はまだ可能性を残すが、広島が得失点差＋21に対し、＋5なのが響くかもしれない。だが、2ndステージ優勝に届かなくても、年間順位で3位に入れば『明治安田チャンピオンシップ』に届く。年間順位3位は勝点56のFC東京である。G大阪は勝点54の4位、川崎Fは勝点50の5位で追う。残り5試合、一進一退が続くFC東京との勝点6差は十分射程圏内である。そのためには、川崎FもG大阪も勝ち続けるのみだ。勝つために必要なのは、ゴールだ。川崎Fには大久保嘉人、G大阪には宇佐美貴史と19ゴールをマークし、得点ランクトップタイで並ぶエースストライカーがいる。史上初の3年連続得点王を狙う大久保が、第11節・名古屋グランパス戦でハットトリックを決めれば、第5節から4試合ノーゴールだった宇佐美もここ3試合で3得点と負けてはいない。エースだけではない。第9節・鹿島戦で戦線復帰した川崎F・小林悠は前節、前々節で3ゴールを量産し、エウシーニョは直近4試合で2得点、田坂祐介はここ3試合で2得点をマークする。G大阪はリーグ戦無得点に喘いでいた倉田秋が第9節・湘南ベルマーレ戦、第11節・松本山雅FC戦でゴールを決め、1stステージ第3節以来ゴールから遠ざかっていた阿部浩之が前節・柏レイソル戦で2得点を奪っている。両軍とも絶対的なエースだけに依存しているわけではない。スケジュール面では川崎Fに追い風が吹く。G大阪は9月30日に『ACL』準決勝第1戦・広州恒大戦を戦っている。気温31度と蒸し暑い広州で、フルメンバーで挑み、1-2で敗れた後、脱水症状に陥る選手がいたほどハードな試合だった。疲労困憊の上、長距離移動を強いられての中3日のゲームにリカバリーし切れない選手が現れる可能性もある。中7日、ホームで第13節を迎える川崎Fはコンディション面で優位に立つ。『明治安田チャンピオンシップ』出場争いに踏みとどまるのは川崎Fか、G大阪か。得点ランキングでライバルを突き放すゴールを決めるのは大久保か、宇佐美か。『明治安田生命Ｊ１リーグ』2ndステージ第13節・川崎F×G大阪・等々力陸上競技場は10月4日(日)キックオフ。チケット発売中。'),(236,'石川が2位浮上＝東海クラシックゴルフ','spo','　【男子ゴルフ・トップ杯東海クラシック】第2日（2日、愛知・三好CC西、7315ヤード＝パー72、賞金総額1億1000万円、優勝2200万円）　3位で出た石川遼が5バーディー、3ボギーの70で回り、通算6アンダーで2位に浮上した。首位は8アンダーの朴相賢（韓国）。　初日首位の片山晋呉は74と崩れ、小田孔明らとともに5アンダーの4位。さらに1打差の7位で池田勇太ら3人が続いた。　通算5オーバーまでの68人が決勝ラウンドに進んだ。　'),(237,'ドラフト候補に高橋純ら＝プロ野球・阪神','spo','　阪神は2日、兵庫県西宮市の球団事務所でスカウト会議を開き、今年のドラフト会議で指名する選手を上位15人に絞り込んだ。　高校球界屈指の右腕、県岐阜商の高橋純平投手、今夏の全国高校選手権で優勝した神奈川・東海大相模の小笠原慎之介投手らが入っている。　'),(238,'エンブレム責任者が退任…東京五輪組織委','spo','　２０２０年東京五輪・パラリンピック組織委員会で大会エンブレムの責任者を務めていたマーケティング局の槙英俊局長が退任したことが２日、分かった。　組織委は９月１日、エンブレムの活用例として組織委に提出された画像がインターネットの個人サイトから無断で流用されていたことなどが発覚し、エンブレムの「白紙撤回」を決定した。'),(239,'亀田興、河野戦へ集中＝裁判勝訴には「一安心」―WBA・Sフライ級','spo','　米シカゴで16日（日本時間17日）に行われる世界ボクシング協会（WBA）スーパーフライ級タイトルマッチで4階級制覇を目指す亀田興毅は1日、トレーニング先の米ネバダ州ラスベガスからインターネット電話を通じて記者会見し、「いろいろな選手と100ラウンドぐらいスパーリングをやっている。ボクシングに集中できている」と自信を示した。　対戦するチャンピオンの河野公平（ワタナベ）については「特にない」と話し、挑発はしなかった。　会見は、亀田興らが日本ボクシングコミッション（JBC）の男性職員と争った裁判で勝訴した結果を受けて行われた。東京地裁で9月30日に判決があり、亀田興は「結果が出て一安心している」と心境を語った。判決は、世界戦に際し亀田陣営から暴行やどう喝を受けたとする職員の主張を退け、亀田側の名誉が傷ついたとして職員に320万円の支払いを命じた。　'),(240,'プロボクシング長谷川穂積が現役続行　次戦は１２月','spo','　プロボクシング元世界２階級王者の長谷川穂積（真正、西脇市出身）が２日、神戸市兵庫区の所属ジムで現役続行を表明し、１２月１１日に神戸市立中央体育館でフェザー級１０回戦を行うと発表した。歴戦の３４歳は「強くなっている自分がいる。新しい『長谷川穂積』を見せられる」と言い、「次の試合で思うように戦えれば挑戦したい」と世界戦への意欲も見せた。　長谷川は約１年ぶりの試合となる５月９日のフェザー級１０回戦で、右足首を痛めた状態ながら当時２９戦全勝の世界ランカーに大差で判定勝ち。ボクサー人生の集大成と位置づけた試合を終え、「満足もあった。（次を）やる意味が見つからなかった」と引退もよぎったが、「筋力、スタミナすべてを総合的に上げる」（長谷川）というトレーニング方法に出会い、「強くなれると分かっているのにやめる必要はない」と現役続行を決めた。　相手は世界ランカーで調整中。陣営の山下正人会長によると５人程度に絞っており、今月中に決まる予定。（大盛周平）'),(241,'レイヴンズ、スティーラーズ下し今季初白星','spo','【AFP＝時事】15NFLは1日、第4週の試合が行われ、ボルティモア・レイヴンズ（BaltimoreRavens）はオーバータイムの末23-20でピッツバーグ・スティーラーズ（PittsburghSteelers）に勝利した。【写真】決勝のフィールドゴールを決めるタッカー（その他全5枚）　開幕から3連敗を喫していたレイヴンズは、オーバータイムにジャスティン・タッカー（JustinTucker）が52ヤードのフィールドゴールを決めて今季初白星を挙げた。レイヴンズは敗れた3試合すべてで終盤にミスを犯す間の悪さもあり、3戦合計14点差で試合を落としていた。　スティーラーズがオーバータイム2度目の攻撃権で敵陣33ヤードまで攻め入ったが、フォースアンドワンとなったところでジョシュ・スコビー（JoshScobee）にフィールドゴールを蹴らせないことを決断。負傷したQBベン・ロスリスバーガー（BenRoethlisberger）に代わって先発したマイケル・ヴィック（MichaelVick）がパスを投じたが、インコプリートに終わった。スコービーは、第4クオーターに2本のフィールドゴールを外していた。　その直後に8プレーで32ヤードを前進し、決勝のフィールドゴールにつなげたレイヴンズは、球団史上初となる開幕4連敗を免れた。【翻訳編集】AFPBBNews'),(242,'局長、事実上の更迭＝エンブレム問題で東京五輪組織委','spo','　2020年東京五輪・パラリンピックの公式エンブレムが白紙撤回となった問題で、大会組織委員会は2日、マーケティング活動を担う専任代理店の電通から出向していた槙英俊マーケティング局長、高崎卓馬企画財務局クリエイティブディレクターの出向協定を解除したと発表した。　事実上の更迭とみられる。マーケティング局長は当面、布村幸彦副事務総長が兼任する。　組織委は旧エンブレムの公募の際、審査で1位となった佐野研二郎氏を含むデザイナー8人に対し、槙氏の判断で参加要請文書を事前に送っていた。　'),(243,'快進撃の日比野菜緒がツアー初の決勝進出 [タシケント／女子テニス]','spo','　ウズベキスタン・タシケントで開催されている「タシケント・オープン」（WTAインターナショナル／9月28日〜10月3日／賞金総額25万ドル／ハードコート）のシングルス準決勝で、日比野菜緒（フリー）が前年準優勝のボヤナ・ヨバノフスキー（セルビア）を6-36-4で破り、WTAツアーでは初の決勝進出を果たした。試合時間は1時間13分。日比野菜緒が予選勝者のコズロバを倒してWTAツアー初の4強入り[タシケント・オープン]　20歳の日比野は今大会でWTAツアーで初めて本戦から出場。1回戦で今大会のダブルスパートナーでもあるアンヘリーナ・カリニナ（ウクライナ）を6-46-4で、2回戦はアリャクサンドラ・サスノビッチ（ベラルーシ）の棄権による不戦勝で、準々決勝では予選勝者のカテリーナ・コズロバ（ウクライナ）を6-36-3で破り、WTAツアー自己最高のベスト4進出を果たしていた。ヨバノフスキーとは今回が初対戦だった。　日比野は決勝で、第4シードのヨハンナ・ラーション（スウェーデン）とドナ・ベキッチ（クロアチア）の勝者と対戦する。（テニスマガジン／TennisMagazine）'),(244,'レスリング世界Ｖ３登坂が入社会見「会社の名前背負って戦う」','spo','　レスリング女子４８キロ級で世界選手権３連覇中の登坂絵莉（２２）＝至学館大４年＝が２日、名古屋市内のホテルで、建設会社の東新住建（本社・愛知県稲沢市）への入社内定会見を行った。来年４月から同社の広告宣伝課に所属し、現在と同じ至学館大を拠点に練習を続ける。　来年のリオデジャネイロ五輪の金メダル候補に、産学挙げての全面バックアップ体制が敷かれる。９月の世界選手権（米ラスベガス）では、決勝で劇的な逆転勝利を収め３連覇。大学卒業後の進路は候補が複数あったが、登坂は「至学館高校、大学と７年間愛知でやってきたので、地元で続けられることが決め手になった」と入社の理由を説明した。　来春の入社後も勤務することはほぼなく、練習に集中できる環境が整った。東新住建の辻明典社長は「競技に支障がない範囲で、企業の顔として商品をＰＲしてくれればと。メダリストが入社してくれれば、社員たちの励みにもなる」と期待を寄せた。　また、入社と同時に至学館大の大学院に進学することも決まった。「私はけがが多いので、体のメカニズムや栄養学も勉強したい」と、社会人、選手、院生の“三刀流”に意欲を燃やした。全日本女子ヘッドコーチも務める同大学の栄和人監督は「リオ以降もチャンピオンで居続けられるようにサポートしていきたい」と、引き続き指導を続ける。　進路も決まり、来夏の金メダル挑戦へしっかりと土台は固まった。「私は背負うものがあればあるほど強くなれると思うので、会社の名前を背負って戦う」。吉田、伊調らに続き、ここから“新女王伝説”を築き上げていく。'),(245,'セットプレーから勝機を＝日本、守備も重要―ラグビーW杯','spo','　目標の8強進出へ、日本は生き残りを懸けてサモアとの決戦に臨む。　対戦成績は3勝11敗と大きく負け越しているが、ジョーンズ・ヘッドコーチが就任した2012年以降は1勝1敗と互角。うまく戦って日本のペースに持ち込めば、勝機はある。　サモアはFW、バックスともに巨漢ぞろいで、コンタクトは激しい。巧みなステップと走力のあるSOのT・ピシ、元7人制ニュージーランド代表のFBナナイウィリアムズらにスペースを与えると苦しくなる。リーチ主将（東芝）は「体を張って、みんなが自分を犠牲にして止めないといけない」。体格差を考慮し、複数の選手で相手を囲むようにして守る必要がある。　サモアはラインアウトに弱点を抱え、南アフリカ戦では思うようにボールを確保できなかった。スクラムも得意ではなく、日本が優位に立てそうだ。FB五郎丸（ヤマハ発動機）のキックで確実に敵陣に入り、セットプレーで重圧をかければ、必ず得点機は生まれる。　日本はスタメン15人のうち、プロップの稲垣とナンバー8のホラニ（ともにパナソニック）を除いた13人が大金星を挙げた初戦の南ア戦にも先発した。ジョーンズ・ヘッドコーチは「最初の60分を互角に戦えば、最後の20分はいい形にできる」。最後に走り勝った南ア戦と同じような試合運びを思い描いている。　'),(246,'日本、3日にサモア戦＝8強へ望みつなげるか―ラグビーW杯','spo','　【ミルトンキーンズ（英国）時事】ラグビーのワールドカップ（W杯）イングランド大会で、1次リーグB組の日本は3日午後2時半（日本時間同10時半）から、英国のミルトンキーンズで勝ち点4で並ぶサモアとの第3戦に臨む。　　日本が敗れた場合は、直後に行われる南アフリカ（勝ち点7）対スコットランド（同10）の結果次第で、11日（日本時間12日）の米国戦を待たずに敗退が決まる可能性がある。目標の準々決勝進出へ望みをつなげるか、重要な一戦だ。　日本は初戦で優勝候補の南アフリカを倒す番狂わせを演じたが、2戦目でスコットランドに完敗した。同じく1勝1敗のサモアが得失点差で上回り、日本は4位にとどまっている。　世界ランキングは日本の12位に対し、サモアは11位。過去の対戦成績は日本の3勝11敗で、W杯では1999年大会で9―43と完敗した。　日本とサモアは2日、ミルトンキーンズの試合会場で最終調整。　'),(247,'カブス世界一への命運握るノーヒッター右腕・アリエッタ　後半戦は“無敵”','spo','　【ダッグアウトの裏側】後半戦は無敵。カブスの右腕、ジェーク・アリエッタ投手（２９）の快投が続いている。　「いろいろな数字や比較を耳にするけど、振り返るのはシーズン後でいい。今はチームのゴールに集中したい」　こうコメントしたのは９月２７日、同じナ・リーグ中地区のパイレーツ戦（シカゴ）だった。６回をパーフェクトに抑え、７回を１安打無失点。自身２本目の本塁打まで放ち、両リーグトップの２１勝目（６敗）を挙げた。　アリエッタはオリオールズから２０１３年７月にトレード移籍。メジャー６年目で才能を開花させた。身長１９３センチで、右打者方向に踏み出すクロスステップから９５マイル（約１５３キロ）前後の速球と４種類の変化球を繰り出す。　８月３０日のドジャース戦（ロサンゼルス）では今季６人目の無安打無得点試合を達成。オールスター戦後は１４試合に先発して１１勝１敗、防御率は０・８０。ブレーブスのクリス・メドレンが１２年にマークした大リーグ後半戦の防御率記録（０・９４）を更新する可能性もある。　カ軍の本拠地、リグリー・フィールドは打者有利の本拠地として知られている。アリエッタが１点台（９月３０日現在、１・８２）の防御率でシーズンを終えれば、１９２０年のグローバー・アレクサンダー（メジャー歴代３位の通算３７３勝を誇る殿堂入り投手）以来、球団史上９５年ぶりの快挙となる。　「１つ上のレベルの投手になってくれた。後半戦の投球は前例がない内容。ＭＶＰに値する」とカ軍のジョー・マドン監督。サイ・ヤング（最優秀投手）賞どころか、ＭＶＰに推している。　今季はナ・リーグ中地区から３球団がポストシーズンに進む。カ軍は２００８年以来の進出で、アリエッタは、ワイルドカードゲームでの先発が濃厚。１９０８年を最後に１世紀以上も世界一から遠ざかっているカ軍の命運を握っている。　（サンケイスポーツ担当部長・田代学）'),(248,'Ｇ大田は原監督の誤算？　最終決戦メンバーから外す非情の決断','spo','　残り３試合で奇跡の逆転優勝を目指すリーグ２位の巨人ベンチには、原辰徳監督（５７）の秘蔵っ子、大田泰示外野手（２５）の姿がない。　１日の横浜ＤｅＮＡ戦（横浜）が雨天中止。原監督は球場併設の室内練習場で、ドラフト１位ルーキーの岡本和真内野手（１９）に初めて打撃を教え込んだ。　熱のこもったマンツーマン指導は約１時間に及び、わずか４メートル先の正面からボールを上げるトス打撃も敢行。打ち方が悪ければ命に関わるが、指揮官は「中止になって時間があったしね。イロハのイくらいかな」と涼しい顔で語った。　原監督の決死の指導に岡本も「緊張はなかった。教えていただけるので、しっかり聞こうと思ってやりました。体が開くので、その矯正です」と落ち着いた口ぶり。８月末の１軍初昇格から１カ月余。チームが厳しい優勝争いを続ける中で殊勲打を放つなど、存在感を増し続けている。　一方で２００９年に東海大相模高からドラフト１位で入団以来、未来の主砲として期待を集めてきた大田は、９月２９日に２軍へ降格となった。　ヤクルトとの首位攻防戦となった同２７日（東京ドーム）では「６番・左翼」で出場。相手先発・石川を攻略するため、ベンチは「逆方向に強い打球を打て」と指示したが、ボールを呼び込めず引っ張り。「おいタイシ、どうした？」とあきれた原監督に３打席目で代打を送られた。　同２８日・阪神戦（甲子園）は途中出場。２点を追う９回２死二、三塁と一打同点の場面で、カウント２−０から藤浪の甘いカットボールを打ち損じ一ゴロ。最後の打者となりチームは優勝争いから後退した。打者有利のカウントで見せた窮屈な打撃に、指揮官は「地に足がついていない」と失望が大きく、最終決戦のメンバーから外す非情の決断に至った。　原監督にとって母校の後輩の伸び悩みは、１０年の長期政権でも大きな誤算の１つだろう。　（笹森倫）'),(249,'燕・川端“ガラスのプリンス”返上だ　超積極的な真中野球の象徴','spo','　セ・リーグは１日、予定されていた全３試合が爆弾低気圧の影響で中止となり、優勝マジックを「１」としていた首位・ヤクルトは阪神戦（神宮）が順延。２日の同カードに勝つか引き分けか、巨人が横浜ＤｅＮＡ戦（横浜）で負ければ２００１年以来１４年ぶりの優勝が決まる。　阪神戦の雨天中止が決まった午後３時４０分には、横浜ではまだＤｅＮＡｖｓ巨人戦の開催が模索されていた。　川端慎吾内野手（２７）は「とにかく早く優勝を決めたい。今からみんなで横浜へ行きましょう。ＤｅＮＡのユニホームを着て、連合チームでやりましょうよ」と笑わせた。仮に試合が開催されＤｅＮＡが巨人に勝てば、その時点でチームの優勝が決まるはずだったからだ。　今季は打率・３３７、１９２安打とリーグ２部門でトップ。職人芸のバットコントロールを誇る“安打製造機”は、ジョークもすべらなかった。　就任１年目で、２年連続最下位から奇跡的な躍進をみせているチームを演出する真中監督の野球を象徴する存在でもある。今季は専ら２番を打つが、送りバントはほとんどなく、犠打はわずか２。チーム全体でも今季１０２犠打はリーグ最少だ。　「真中監督には『自分を２番打者と思わなくていい』といわれています。『無死一塁でも普通に打って、併殺打でも気にしなくていい』と。１死二塁でも、進塁打を意識して無理に右方向へ引っ張ることはしません」　指揮官の超積極的思考が、プロ１０年目の開花を促したといえる。　市和歌山商高からプロ入り。当初から高い打撃技術を評価されたが、故障が多いのが玉にきず。不運なイメージを背負ったイケメンは“ガラスのプリンス”と呼ばれた。　しかし、昨年６月に結婚して食生活が改善されると、同年は初めて故障なくシーズンをまっとうし打率・３０５をマーク。今季は個人トレーナーと契約して体のケアに努め、全試合出場を続けている。３月には第１子の長男も誕生した。　自身の公私にわたる成長と、新指揮官の就任が絶好のタイミングで重なり、初めてのチームの優勝と個人タイトル獲得が現実になりつつある。　（宮脇広久）'),(250,'エビアン選手権のリディア・コ　バランスよいスイング生むＬ字ポジション','spo','　【勝者のワザ】メジャー大会の今季最終戦、エビアン選手権は、リディア・コの逆転優勝で幕を閉じた。最終日の前半はレクシー・トンプソンがリードしていたが、中盤からはコが８バーディーと猛ダッシュをかけ、６３の快スコアで逆転した。１８歳のコはＬＰＧＡツアー今季５勝目で、メジャー最年少優勝を果たした。　コの安定したゴルフを支えているのは、バランスのとれたスイングだ。バックスイングとフォロースルーが、左右対称になる、無理のない理想的な動きが正確なショットを生み出している。　左右対称スイングのキーポイントでコが大事にしていて、アマチュアにも参考になるのが“Ｌ字ポジション”。左腕とシャフト、右腕とシャフトの角度である。　バックスイングで左腕が地面と平行になったところで、その腕に対してシャフトは９０度になる。フォロースルーでは、逆に右腕が地面と水平になったところで、その右腕に対してシャフトは、やはり９０度になる。腕とシャフトがＬ字になることからＬ字ポジションと呼ばれる。　Ｌ字になるようにするには、腕のたたみとコッキングを欠かせない。バックスイングではクラブヘッドが右足つま先の延長線上を通過するあたりから右ヒジをたたみはじめ、併せて左親指を立てるようにしてコッキングも開始する。　実際にこの動きをやってみると、意外なほど早い段階で始動しなければならないことに気づくだろう。テークバック直後からＬ字ポジション作りをスタートさせないと、コのような形にはならない。これは、アーニー・エルスが実践してきたアーリー・コッキング動作と同じ方法だ。　フォロースルーでもボールを打ち抜いたら、すぐに左親指を立てるようにコックしていく。バックスイングとフォロースルーでＬ字ができると、スイングアークが安定するだけでなく、クラブヘッドを自然に走らせることができる。飛距離、方向性どちらの面でも有効な動きで、反復性も高くなる。　ハーフスイングの素振りを繰り返す練習が効果的だ。腕、手首を脱力させた状態で連続素振りを繰り返すことでクラブヘッドの走りを実感できる。この連続素振りは、軸を安定させることにもつながる。　■Ｌｙｄｉａ　Ｋｏ　１９９７年４月２４日、ソウル生まれ。国籍はニュージーランド。５歳で競技を始め、６歳で韓国からニュージーランドへ移住した。１２年１月に１４歳でオーストラリアのツアー大会を制し、同８月には米女子ツアー史上最年少の１５歳４カ月でカナダ女子オープン優勝。１３年に同大会２連覇を果たし、プロ転向。今年２月に史上最年少の１７歳で世界ランキング１位となった。米ツアー通算９勝。１６５センチ。'),(251,'辛口メディアから“金本阪神”ラブコール　週刊誌が熱を上げるワケ','spo','　阪神・和田豊監督（５３）が今季限りで退任することが９月３０日、球団から発表された。　この日、大阪市内で行われた球団の定例取締役会で、南信男球団社長が「（指揮官から）リーグ優勝を逃した責任を取り、今シーズンをもって退任したいとの申し出があった」と報告。これが了承された。　南社長は「（監督とは）８月頃から『昨季（２位）の成績を上回らなければいけない』と話した。（９月２６日に）広島で話をした際、監督は『優勝を逃したら（辞意を）申し出るつもりだった』とおっしゃっていた」と明かした。　後任には球団ＯＢの金本知憲氏（４７）が最有力候補にあがっている。坂井信也オーナーは「いえないことばかり。ちらっとニュアンスを伝えて書かれても困る」と明言を避けたが、近日中にも就任要請に動く可能性が出てきた。　その金本氏の動向を求めて、この日も兵庫県内の自宅周辺に多数の報道陣が詰めかけたが、特に熱心だったのが、週刊誌の記者たちだ。　某誌の編集部では和田監督の退任発表を受けて、企画会議で金本氏の新監督就任を想定。「ネタを集めよ！」と大号令をかけているという。　ある大手週刊誌関係者は「スター性、全国的な知名度もあり、各方面に影響力の大きい金本氏の監督就任が実現すれば、特集を組んで掲載したいのが本音。幸い、自宅近辺でも張り込み取材がしやすい環境なので、やりがいもあるしね」と闘志を燃やす。　さらに「彼と同世代の読者層が多い週刊誌という媒体だけに、密着取材でも十分に雑誌の注目度をアップできる。そっちの形式で企画案を出すのもいいかも」と話す。　筆の滑り方次第では、敵対関係になりかねない辛口メディアからの監督就任ラブコール。やはり、並みの指揮官候補者ではない。　（山戸英州）'),(252,'燕・真中監督の家庭でちょっとした異変','spo','　セ・リーグの優勝マジックを「１」としているヤクルトは１日、神宮球場での阪神戦が雨のため中止になりました。　歓喜の瞬間が迫り、にわかに増えた報道陣でごった返す神宮外苑の室内練習場で、汗を流すナインを見守った真中満監督（４４）が最近、家庭で起きたちょっとした異変について笑いながら明かしてくれました。　「最近さ、家で娘がオレに優しくてね。ほんのちょっと前までは邪険に扱われてたんだけどね」　真中家の長女・麻恵（まえ）さんはまだ８歳ながら、優勝という大目標に近づく父の置かれた環境をさとく感じたのか、ことあるごとに気遣いの言葉を掛けてくれるようになったとか。「微妙な緊張感が伝わっちゃったのかな」と照れくさそうに話す表情は、父親そのものでした。　室内練習場からクラブハウスに戻る際には、前に進むのも難しいほど多くのファンから「真中さん、頼むぞ！」「明日こそ優勝しよう！」と熱い声が。期待を一身に背負う指揮官にかかる重圧は、想像を絶するものがあります。１日も早く悲願を達成して、家でもゆっくりくつろいでほしいものです。　（運動部・片岡将）'),(253,'マー君、初シャンパンファイト　ヤンキース３年ぶりポストシーズン進出','spo','　■メジャー速報　１日（日本時間２日）　ヤンキースがレッドソックスを４−１で下し、ワイルドカード（ＷＣ）で３年ぶり５２回目のポストシーズン進出を決めた。球団通算１万勝の節目だった。田中将大投手（２６）は大リーグ移籍後、初のシャンパンファイトで歓喜の渦に加わった。　地区優勝をブルージェイズにさらわれたが、苦しみながらも６日（同７日）のＷＣゲームに駒を進めた。田中は前日９月３０日（同１日）のレッドソックス戦で５回４失点と精彩を欠いたが、ＷＣゲームでの先発は揺るがないようだ。　シャンパンでしみる目をこすりながら、「去年はこういうこともできなかった。昨日はふがいない投球をしたので次はビシッと行きたい」。　ニューヨークポスト紙は「攻撃の決定力不足や投手陣の不調で、ヤンキースはポストシーズンで芳しい結果を残せないだろう」と予想しており、ＷＣゲームで田中はエースとしての真価が問われることになる。'),(254,'フラアンジェリコ前走の勢い期待／スプリンターズＳ','spo','　フラアンジェリコ（牡７、斎藤）は角馬場で調整した。枠は週中に着けていたＧ１ゼッケンと同じ１４番。　鈴木助手は「初めての距離だし後方からしまいを生かす形になるでしょうから、枠は外でも気になりません。前走勝っている勢いがありますから」と力強い。'),(255,'サクラゴスペル２枠４番に前向き／スプリンターズＳ','spo','　サクラゴスペル（牡７、尾関）はウッドコースと坂路で調整された。　尾関師は「だいぶ気合が乗ってきたけど、それでも体は５００キロをキープしていていい状態。データを見ると１、２枠（４番）はあまり勝ってないみたいですが、ロスなく運べると思うので」と前向きだった。'),(256,'赤川らが戦力外＝プロ野球・ヤクルト','spo','　ヤクルトは2日、赤川克紀、七條祐樹、江村将也、大場達也、金伏ウーゴの5投手と川崎成晃外野手、育成の中根佑二、阿部健太両投手と来季の契約を結ばないと発表した。　'),(257,'上園ら戦力外＝プロ野球・楽天','spo','　楽天は2日、上園啓史、梅津智弘、藤江均、育成の高堀和也の各投手と、来季の契約を結ばないと発表した。　'),(258,'【NFL】【第4週プレビュー】ジャイアンツ対ビルズ、鍵はパスオフェンス','spo','　第3週でついに今シーズン初勝利を挙げたニューヨーク・ジャイアンツは現地4日、敵地でのバッファロー・ビルズ戦で連勝を目指す。　ジャイアンツは前週にNFC東地区ライバル対決となったワシントン・レッドスキンズ戦で勝利。2013年以降27試合で39INTを連発したクォーターバック（QB）イーライ・マニングは今季、開幕からパス108回でINTなしの成績。レッドスキンズ戦で先発QBとして通算100勝目を挙げた。ワイドレシーバー（WR）オデル・ベッカムとのホットラインで、NFL31位に低迷するビルズのパスディフェンスを崩したい。ただ、この試合での戦列復帰に自信をみせていたWRビクター・クルーズは練習でふくらはぎの故障を悪化させてしまい欠場が明らかになった。　今シーズンからビルズの先発QBを務めているタイロッド・テイラーはリーグ5位のレーティング116.1と好調。アーロン・ロジャース、トム・ブレイディを上回る、NFL4位のパス成功率74.4％を記録している。しかし2013年のリーディングラッシャーで今オフに加入したランニングバック（RB）ルショーン・マッコイ、プロ2年目のWRサミー・ワトキンスがけがをしており、もし欠場となれば攻撃は手薄となる。とはいえ、ジャイアンツのパスディフェンスはNFLワーストとなっており、テイラーにとって格好の餌食となるかもしれない。また、3試合連続でTDランを記録している新人RBカルロス・ウィリアムスのプレイにも注目だ。＜ニューヨーク・ジャイアンツ＞'),(259,'【NFL】【第4週プレビュー】今季初のロンドンゲームは、AFC東地区対決','spo','　現地3日に開催されるマイアミ・ドルフィンズとニューヨーク・ジェッツのAFC東地区対決は、今季最初のロンドンゲームとなる。ともに次週はバイウィークであり、ここで勝って良い流れのまま休養に入りたいところだ。　現在2勝1敗のジェッツは、前週フィラデルフィア・イーグルスに17対24で敗れ初黒星を喫した。守備陣は計231ヤード喪失と奮闘したが、計4ターンオーバーを献上したのが余りに痛かった。クォーターバック（QB）ライアン・フィッツパトリックは3インターセプトを献上すると、ランオフェンスも47ヤードと不発と攻撃陣が足を引っ張った。前週欠場した先発ランニングバック（RB）クリス・アイボリーが復帰予定のランオフェンスは、154ヤードを稼いだ開幕週以降は下降しており、ここで立て直したい。特にワイドレシーバー（WR）エリク・デッカーの2週連続欠場が濃厚なだけに、より地上戦で確実に前進しておきたいところだ。守備陣は、ダレル・レビス、アントニオ・クロマティの両コーナーバック（CB）を軸とした強力パスカバーで、唯今リーグ4位の喪失ヤードと申し分ない。　ドルフィンズは、前週バッファロー・ビルズに14対41で大敗を喫して連敗中。現在、特に問題となっているのは、オフにリーグ史上に残る高額契約でディフェンスタックル（DT）ダムコング・スーを獲得しながらリーグ31位の喪失ヤードとなっているラン守備だ。攻撃陣もQBライアン・タネヒルによるパスオフェンスは奮闘しているが、ランオフェンスはリーグ27位であり、攻守ともに地上戦の改善が求められている。ロンドンゲームが初めてのジェッツに対し、ドルフィンズは38対14で勝利した昨年のオークランド・レイダース戦に続いてと、この経験の差をいかしていきたい。＜マイアミ・ドルフィンズ＞'),(260,'【NFL】FGで明暗、レイブンズが劇的な追い上げでOT勝利','spo','　現地1日、第4週のサーズデーナイトフットボールが開催されボルティモア・レイブンズが敵地でピッツバーグ・スティーラーズと対戦。相手のFGミスに助けられ、第4Q終了間際に追いつくとオーバータイム（OT）にキッカー（K）ジャスティン・タッカーが値千金の52ヤードFGを決め23対20で熱戦を制した。これでレイブンズは１勝3敗、スティーラーズは2勝2敗となっている。　第1Q、レイブンズはFGで先制されるが、すぐにワイドレシーバー（WR）マイケル・カンパナーロの9ヤードTDランで勝ち越す。しかし、第2Q終盤に連続失点を喫し、7対13とリードを許して前半を終える。　後半に入ってもスティーラーズの優勢は続き、レイブンズは第3Q序盤にTDを決められて13点を追うことに。その後、3点差に詰め寄ったレイブンズだが、第4Q中盤に入るとオフェンスが2度の第4ダウンギャンブルに失敗と敗色濃厚となる。だが、ここでスティーラーズが残り約2分、約1分にそれぞれFG失敗とツキに恵まれると、残り7秒から42ヤードFGを決めて同点とする。　迎えたOT、互いに決め手を欠き得点をあげられないまま時間は過ぎるが、残り約5分、レイブンズはタッカーがロングFGを決め、待望の今季初勝利を挙げた。　レイブンズは、ランニングバック（RB）ジャスティン・フォーセットがラン27回150ヤードをマーク。この試合の前まで3試合合計でラン124ヤードと不調だった鬱憤を晴らす活躍だった。そしてQBジョー・フラッコがパス33回中20回成功、189ヤード、1TD、1INTを挙げると、Kタッカーがプレッシャーのかかる2本を含むFG3本中3本成功と、安定のキックで勝利の立役者となった。　スティーラーズは、試合終盤の連続FG失敗で追いつかれると、OTではこの点を考慮してか敵陣で2度の第4ダウンギャンブルを試みて両方ともに失敗。拙攻で勝てる試合を落としてしまった。QBマイケル・ビックは、パス26回中19回成功、124ヤード、1TDにラン9回33ヤード。RBレベオン・ベルはラン22回129ヤード、1TDを挙げている。＜ボルティモア・レイブンズ＞'),(261,'【NFL】【第4週プレビュー】イーグルス対レッドスキンズ、QBの活躍が必要','spo','　フィラデルフィア・イーグルスは現地4日、敵地でNFC東地区のライバル、ワシントン・レッドスキンズと激突。両チームともここまで先発クォーターバック（QB）の調子が上がっておらず、1勝2敗の成績となっている。　イーグルスのQBサム・ブラッドフォードは開幕2試合で5ターンオーバーを喫し、チームも連敗。第3週はニューヨーク・ジェッツを下し、1999年以来の開幕3連敗は免れたものの、ブラッドフォードはパス118ヤードにとどまった。ワイドレシーバー（WR）陣もドラフト全体20位指名の新人ネルソン・アゴラーを含め、ジョーダン・マシューズ以外に目立った数字を残している選手がいない。ランニングバック（RB）デマルコ・マレーはダラス・カウボーイズでプレイした昨シーズン、レッドスキンズとの2試合で合計ラン241ヤードを獲得。新天地でも同様の活躍で存在感を示したい。　レッドスキンズではNFL4年目のQBカーク・カズンズが先発を務めているが、開幕からの3試合で3TD、4INTと振るわない。しかし開幕戦でハムストリングを痛めたWRデショーン・ジャクソンが復帰すれば、大きな武器となる。開幕戦でラン121ヤードを獲得して以来、調子を落としているRBアルフレッド・モリスの復調にも期待がかかる。＜フィラデルフィア・イーグルス＞'),(262,'【NFL】【第4週プレビュー】レイダース、4年ぶりの公式戦3連勝なるか','spo','　現地4日、オークランド・レイダースが敵地でシカゴ・ベアーズと対戦する。レイダースは開幕黒星から巻き返して2勝1敗と白星を先行。第3週には2013年第11週以来となる敵地での勝利を飾るなど、若手主体のチームに勢いが出てきた。この一戦に勝てば4年ぶりのレギュラーシーズン3連勝。今後に弾みをつけるきっかけとしたい。　レイダースの3連勝は2011年シーズンの第10週から達成したのが最後。当時も3連勝目は敵地でのベアーズ戦と因縁めいたものがある。2011年は8勝8敗の勝率5割でシーズンを終えたが、それ以降はシーズン4勝が最高と低迷しており、序盤戦で3勝となればチーム復興の気運も高まろう。ここは決めたいところだ。第3週のクリーブランド・ブラウンズ戦では2年目のクォーターバック（QB）デレック・カーがパス314ヤード、2TD、INTなしで攻撃を主導。カーは連勝を決めた最近2戦合計でパス成功率6割超え、665ヤード獲得、5TD、1INT、レーティング107.1と非常に安定した内容を残している。ドラフト全体4位で獲得した新人ワイドレシーバー（WR）アマリ・クーパーは開幕から新人トップのレシーブ20回290ヤード（1TD）と期待通りの活躍を見せ、カーの安定に大きく貢献。3年目のランニングバック（RB）ラタビアス・マレーもブラウンズ戦でキャリアハイのラン139ヤードをマークするなど、開幕3戦平均99.5スクリメージヤードで司令塔を援護している。総喪失ヤードがリーグ最下位、総失点もリーグ28位と守備陣に多くを望めない現状、勝利は元気な若手攻撃陣の活躍に懸かっている。　ベアーズは開幕から重量級の相手が続いた不運もあり3連敗スタート。エースQBジェイ・カトラーを欠いた第3週は、リーグ最強クラスの守備を誇るシアトル・シーホークスが相手だったとはいえ完封負けを喫し、いかにも流れが悪い。そのシーホークス戦では代役のQBジミー・クラウセンがパス17回中9回成功、63ヤードと手も足も出ず。一転して最弱レベルのレイダース守備陣が相手なら内容改善もあり得るが、ハムストリングを痛めているカトラーの復帰を期待するしかない状況だ。エースRBマット・フォルテはシーホークス戦でラン20回74ヤードに終わったものの、クラウセンのパス成績を上回ったように孤軍奮闘の形。攻撃は引き続きフォルテが頼みになる。一方、第3週にラインバッカー（LB）パーネル・マクフィとディフェンスエンド（DE）ジャービス・ジェンキンスが各2サックを決めるなど、パス守備はリーグ6位の堅さを誇っている。好調なレイダースの空中戦を遮断し、守備から勝機を拡大していくことは可能だ。＜オークランド・レイダース＞'),(263,'【NFL】【第4週プレビュー】4連勝狙うパンサーズ、同地区バッカニアーズ戦','spo','　開幕3連勝と好調なカロライナ・パンサーズは現地4日、敵地でタンパベイ・バッカニアーズと対戦。開幕からの連勝キープを狙う。　パンサーズは第3週で同地区のニューオリンズ・セインツを撃破。唯一のスーパーボウル進出を果たした2003年以来となる開幕3連勝を飾った。クォーターバック（QB）キャム・ニュートンがパス315ヤード、2TDのほか、ランでも1TDを挙げる活躍をみせた。また、ベテランのタイトエンド（TE）グレッグ・オルセンがレシーブ134ヤード、ワイドレシーバー（WR）テッド・ジンJr.もレシーブ93ヤードと調子を上げてきている。守備陣では開幕戦で脳振とうを起こしたラインバッカー（LB）ルーク・キークリーが過去2試合を欠場。それでもディフェンスは相手の攻撃をNFL2位の平均16.0得点に抑えるなど奮闘している。ただ、ディフェンスエンド（DE）チャールズ・ジョンソンがハムストリングのけがで離脱したため、パンサーズはシカゴ・ベアーズとのトレードで、かつてシーズン22サックを記録したことがあるLBジャレッド・アレンを獲得した。　バッカニアーズはここまで1勝2敗。ドラフト全体1位指名の新人QBジェイミス・ウィンストンは開幕から3試合続けてパス200ヤード以上、さらに毎試合TDパスを記録しているが、パス成功率は52.2％とNFLワーストの数字となっている。また、チームもNFL29位タイの1試合平均16.3点に抑えられており、得点力不足は明らか。バッカニアーズはホームでは現在10連敗中で、パンサーズにも4連敗中。ウィンストンがパンサーズの強力ディフェンスを攻略できるかどうかが勝利への鍵となる。＜カロライナ・パンサーズ＞'),(264,'【NFL】肩に不安のQBラック、2日連続で練習制限','spo','　肩を痛めているインディアナポリス・コルツのクォーターバック（QB）アンドリュー・ラックが現地1日、前日に続いて練習メニューを制限。4日のジャクソンビル・ジャガーズ戦出場が微妙な状況が続いている。　先週のゲームで負傷したラックは1日の練習でパスを投げず。マット・ハッセルベックとアレックス・タニーの両控えQBの練習を見学していることが多かった。ただしチャック・パガーノHCはラックが軽傷であることを強調し、欠場しないことに「絶対の自信がある」としている。　ちなみにラックは2012年のドラフト全体1位指名を受けて同年の開幕戦で先発デビューして以来、1試合も欠場したことがない。また、試合前の故障者レポートに名前が載ったことすらない。＜インディアナポリス・コルツ＞'),(265,'【NFL】レイブンズのドラ1WRペリマン、デビューできずに今季絶望も','spo','　ボルティモア・レイブンズのドラフト1巡指名ワイドレシーバー（WR）ブレシャド・ペリマンが、デビューできないまま1年目のシーズンを棒に振る可能性が出てきた。　NFLメディアのイアン・ラポポート氏によると、ペリマンは現地9月27日の試合前ウォームアップでひざの内側側副じん帯を再び負傷。手術を受け、復帰の見通しが立たない状況だという。　これはオフェンス強化を狙ってドラフトに臨んだレイブンズにとって大きな痛手。2巡指名のタイトエンド（TE）マックス・ウィリアムスも現時点でレシーブ5回のみと期待に応えられておらず、誤算が続いている。＜ボルティモア・レイブンズ＞'),(266,'【NFL】ジャイアンツWRクルーズ、ビルズ戦での今季初出場かなわず','spo','　ニューヨーク・ジャイアンツのトム・コフリンHCは現地1日、足を痛めているワイドレシーバー（WR）ビクター・クルーズが4日のバッファロー・ビルズ戦を欠場すると発表した。　コフリンHCは、今季はまだ出場できていないクルーズの戦列復帰は見通しが立っていないこと、本人が明らかにフラストレーションをためていることなどを明かしている。　ファンが待ち望んでいたWRオデル・ベッカムとクルーズのコンビは当分実現しないもよう。しばらくはルーベン・ランドールとドウェイン・ハリスの両WRとベッカムによる3WRセットがメインになりそうだ。＜ニューヨーク・ジャイアンツ＞'),(267,'【NFL】史上最高のデビュー飾ったQBマリオタ、月間最優秀新人に選出','spo','　NFLは現地1日、9月の最優秀新人を発表。オフェンスではテネシー・タイタンズのクォーターバック（QB）マーカス・マリオタ、ディフェンスではバッファロー・ビルズのコーナーバック（CB）ロナルド・ダービーが選出された。　ドラフト全体2位指名だったマリオタは、3試合でいずれも新人トップのパス833ヤード、8TD、レーティング109.2をマーク。デビュー3試合での8TDパスはリーグ史上最多タイで、特にパス209ヤード、4TD、INTなしで42対14の勝利にチームを導いた開幕のタンパベイ・バッカニアーズ戦は、新人ではNFL史上初めてレーティング158.3を記録する最高のデビューを飾った。　2巡指名（全体50位）でビルズ入りしたダービーは、リーグ最多タイの2INTと単独トップの8パスディフェンスを挙げたほか、15タックルとマルチに活躍。ビルズの新人が2INT以上をマークしたのは、2009年のジャイルス・バード（9INT）とキャリー・ハリス（2INT）以来だった。＜NFL＞'),(268,'【NFL】月間MVPにDEウェアとCBノーマンが選出　ディフェンス部門','spo','　NFLは現地1日、9月の月間MVPを発表。ディフェンス部門では、AFCからデンバー・ブロンコスのラインバッカー（LB）デマーカス・ウェア、カロライナ・パンサーズのコーナーバック（CB）ジョシュ・ノーマンが選出された。　ウェアは3試合でAFC最多タイの3.5サック、10タックルをマークしてチームの3連勝に貢献。開幕3試合連続で1サック以上を挙げた今季唯一の選手となった。ウェアらの活躍で、ブロンコスはトータルディフェンス（1試合平均259ヤード喪失）、パス守備（同176.3ヤード）、ターンオーバー（+6）でリーグトップと鉄壁の守備を展開している。月間MVPは初選出。　ノーマンはリーグ最多の2INT、15タックルをマークしたほか、5パスディフェンス、1ファンブルフォース、1ファンブルリカバーと大活躍。開幕戦では30ヤードINTリターンTDを決めたほか、第3週のニューオリンズ・セインツ戦では試合残り約1分に、決まれば逆転TDとなるはずだったパスをエンドゾーンでインターセプトし、チームを3連勝に導いた。月間MVPはこちらも初選出。＜NFL＞'),(269,'【NFL】レッドスキンズ対イーグルス戦、大型ハリケーン接近も開催予定','spo','　大型ハリケーン「ホアキン」が米東部へ接近している影響が心配される現地4日のワシントン・レッドスキンズ対フィラデルフィア・イーグルス戦だが、1日の時点では予定どおり開催される見込みだ。　NFLのスポークスマンは、「天気予報をモニタリングし、両チームと意見交換していく」と発表。ホアキンが試合の行われるワシントンD.C.を含む米東海岸を直撃するかはまだ不明だが、『WeatherChannel』によると、その可能性は高まっているという。試合が延期されなければ、両チームの選手たちは豪雨などの悪天候でのゲームに備えなければならない。＜NFL＞'),(270,'【NFL】イーグルスRBマレー、練習フル参加も次戦出場はまだ未定','spo','　ハムストリングを負傷しているフィラデルフィア・イーグルスのランニングバック（RB）デマルコ・マレーが、現地1日の練習にフル参加した。なお4日のワシントン・レッドスキンズ戦に出場するかどうかはまだ不透明だ。　マレーは先週のニューヨーク・ジェッツ戦を負傷欠場。30日の練習は制限メニューだった。NFLメディアのアルバート・ブリアー氏によると、本人はここ数日より状態は上向いていると話すものの、レッドスキンズ戦出場については明言せず。ちなみにジェッツ戦欠場は「当日の朝に状態が良くなかったから」だという。　マレーを欠いたジェッツ戦のイーグルスは代役のRBライアン・マシューズがラン24回、108ヤードと活躍。マレーの出場可否に関わらず、今後も出番が増えることが予想される。＜フィラデルフィア・イーグルス＞'),(271,'【NFL】歴史的活躍のQBブレイディとWRジョーンズが月間MVP　オフェンス部門','spo','　NFLは現地1日、9月の月間MVPを発表。オフェンス部門では、AFCからニューイングランド・ペイトリオッツのクォーターバック（QB）トム・ブレイディ、NFCからはアトランタ・ファルコンズのワイドレシーバー（WR）フリオ・ジョーンズが選出された。　ブレイディは3試合でリーグ最多のパス1,112ヤード、9TDをマーク。INTゼロでレーティングを119.6とし、チームを開幕3連勝に導いた。3試合でパス96本成功はNFL史上最多で、全試合で2TDとレーティング105以上をマーク。特に2戦目のバッファロー・ビルズ戦ではパス466ヤード、3TDの大活躍だった。月間MVPは8回目の選出で、QBペイトン・マニング（ブロンコス）の最多記録に並んだ。　ジョーンズはレシーブ34回、440ヤード、4TDと、いずれもリーグ最多活躍でファルコンズの3連勝に貢献。特にレシーブ数は開幕3試合のリーグ歴代最多記録となった。また開幕3試合連続でレシーブ135ヤード以上も史上初の快挙だった。月間MVPは嬉しい初選出。＜NFL＞'),(272,'マジンプロスパー出走取り消し＝競馬スプリンターズS','spo','　日本中央競馬会は2日、第49回スプリンターズステークス（GI、4日、中山競馬場）で走る予定だったマジンプロスパー（牡8歳、栗東・中尾秀正きゅう舎）の出走取り消しを発表した。　右前脚に異常が認められ、深屈腱（しんくっけん）炎と診断された。レースは15頭立てで行われる。　重賞レースで3勝を挙げたマジンプロスパーは、このまま現役を引退する見込み。馬主は元プロ野球投手で米大リーグでも活躍した佐々木主浩氏。　'),(273,'相撲の魅力、五感で感じて＝4日に34代木村庄之助さん講演','spo','　2008年春場所まで大相撲の立行司として土俵を裁いた第34代木村庄之助の伊藤勝治さん（72）が4日、東京都墨田区の江戸東京博物館で大相撲をより楽しんでもらうための講演会を開く。　　映像を使った講話や、びん付け油の香りを楽しんだり元結に触れたりする時間も用意。伊藤さんは「相撲ファンはもちろん、初心者の方にも楽しめる内容を考えた。目だけでなく、鼻や手、耳で魅力を感じてほしい」。　入場料は無料。講演は3回行い、各回先着100人まで入場できる。　'),(274,'日比野菜緒 ツアー初の決勝進出果たす＜女子テニス＞','spo','女子テニスツアーのタシケント・オープン（ウズベキスタン/タシケント、ハード）は2日、シングルス準決勝が行われ、世界ランク117位の日比野菜緒（日本）が元世界ランク32位のB・ヨバノフスキ（セルビア）に6-3，6-4のストレートで勝利してツアー初の決勝進出を果たした。日比野菜緒がツアー初4強この試合の第1セット、日比野は先にブレークに成功すると試合の流れを掴み、このセットを先取。その後、第2セットでは左右にボールを散らしてヨバノフスキを追い込み、ロングラリーを制した日比野が第10ゲームでこのセット2度目のブレークに成功して勝利した。決勝では、E・ロディナ（ロシア）とD・ヴェキッチ（クロアチア）の勝者と対戦する。日比野は今大会、1回戦でダブルスペアのA・カリニナ（ウクライナ）を下し、2回戦ではA・サスノビッチ（ベラルーシ）の棄権により不戦勝。準々決勝では予選勝者のK・コズロバ（ウクライナ）を下しての勝ち上がり。いずれもストレートで勝利しており、今大会は1セットも落としていない。一方、敗れた世界ランク106位のヨバノフスキはキャリア通算2勝をあげており、昨年のウィンブルドン2回戦ではV・アザレンカ（ベラルーシ）に勝利している。今大会の準々決勝では第1シードのAn・ベック（ドイツ）を逆転で下しての勝ち上がりだった。'),(275,'ナダルとジョコビッチ、タイの伝統衣装で首相官邸を訪問','spo','【AFP＝時事】男子テニスのラファエル・ナダル（RafaelNadal、スペイン）とノバク・ジョコビッチ（NovakDjokovic、セルビア）が2日、タイの首都バンコク（Bangkok）で行われるエキシビションマッチを前に、伝統衣装に身を包んで同国のプラユット・チャンオーチャー（PrayutChan-O-Cha）暫定首相を訪問した。【翻訳編集】AFPBBNews【写真10枚】ラケットをプレゼントするナダルとジョコビッチなど'),(276,'ニホンピロアワーズ復調気配／シリウスＳ','spo','　Ｇ１馬ニホンピロアワーズ（牡８、大橋）が復調気配だ。この日は雄大な馬体を揺らしてＢコースを周回。　大橋師は「前回の休み明けは牧場から帰ってきた時から体が減ってたけど、今回はフックラしてるし、１０キロぐらい増えてるのでは。いい状態で出せると思う。持ってる力を出してくれれば」と復権を期待していた。'),(277,'ナムラビクター得意舞台でＶ争い／シリウスＳ','spo','　昨年２着のナムラビクター（牡６、福島）は気難しさが消えつつある。　福島師は「中間は（調教で）ごねるところを見せてないし、追い切りも集中して走れてる。腹袋があるから太って見えるけど仕上がっている。阪神２０００メートルも実績があるから」と自信をのぞかせる。この日も坂路４ハロン７０秒９でおとなしく調整を終えた。'),(278,'ミッキーアイル勝ち運ある13番／スプリンターズＳ','spo','　ミッキーアイル（牡４、音無）は過去１０年で３勝の１３番枠をゲットした。平井助手は「いい感じですね。内に速い馬がいるし、状況に応じて走れる」と歓迎。　休み明けは２戦２勝と、久々でも力を発揮できる。同助手は「ひと追いごとに良くなった」と能力に全幅の信頼を置く。'),(279,'ティーハーフ最後入れの大外歓迎／スプリンターズＳ','spo','　ティーハーフ（牡５、西浦）は大外１６番枠。西浦師は落胆の表情かと思いきや、「（ゲートに）最後入れだし、かえっていいかも」と受け入れた。　この日は坂路を１本。「調教はしっかりできた。いい感じ。道中でペースが流れてくれれば」と師。差し馬向きの展開を望んだ。'),(280,'ハクサンムーン真ん中からハナ奪う／スプリンターズＳ','spo','　ハクサンムーン（牡６、西園）は真ん中の８番枠。隣に同型アクティブミノルがいるが、ハナ宣言は変わらない。　酒井騎手は「今回はハナに行く。そこにはこだわりたい」とライバル陣営をけん制した。この日は角馬場でリラックスした走りを見せ、最後の調整を終えた。'),(281,'「サモア戦はW杯でもっとも大切な試合」。ジャパン、最強メンバーでいざ。','spo','「W杯でもっとも大切な試合です。我々は最強チームを構成することができました」　10月3日のサモア戦出場メンバー発表会見で、エディー・ジョーンズHCはそう切り出した。　大会前のジョージア戦でタックルに行った衝撃で退場したNO8龍コリニアシホラニが大会初の先発。負傷でスコットランド戦を欠場したSO小野晃征、南ア戦翌日に魚に噛まれるアクシデントに遭ったWTB山田章仁も戻ってきた。【ラグビーW杯2015】ラグビーリパブリック特設サイト　ただし、予選プールは3試合目。誰もが万全のコンディションというわけではない。アマナキ・レレィ・マフィも日々よくなってはいるが、「後半30分間の出場となるでしょう」（ジョーンズHC）。SH田中も負傷でこの2日、練習しただけ。「彼は身体が小さいから練習量も少なくていいのです」。指揮官は詳細を尋ねる報道陣を煙に巻いた。「3試合目となれば、完璧なコンディションの選手はごくわずか。メンタルの強さで乗り越えなければ。この23名はメンタルの強さで戦ってくれると思います」　会見中ジョーンズHCの口から何度も出た単語は「スマート（賢く）」。　サモアはの3番センサス・ジョンストンは190cm、135kgの巨漢。3列には2試合の出場停止処分のあけたFLケーン・トンプソンはじめサイズある選手を揃えた。SOトゥシ・ピシ、FBティム・ナナイウィリアムズは卓越した個人技を誇る。「賢くスクラムを組む、ラインアウトもそう。ナナイウイリアムズは1人で止めるのでなく2人、3人と行く。すべて賢く行わなくては」　　リーチ　マイケル主将も簡潔に決意を語った。「ものすごくデカい相手に一番やらないといけないことは、身体を張ること。自分を犠牲にして止める。それをしないとやられてしまう」　南太平洋の勇者・サモアは小細工の効く相手ではない。心は熱く、頭はクールに。10月3日、ミルトンキーンズのスタジアムmk。日本代表全員の勇気と知恵が試される。「フィジカル＆スマートなラグビーをする。それを80分継続すれば勝てる。できなければ違う結果になるでしょう」（ジョーンズHC）（文・森本優子）'),(282,'フランス3連勝で8強入りほぼ確実に　カナダ善戦するも金星には届かず','spo','　前回のラグビーワールドカップで準優勝だったフランス代表が、2015年英国大会での準々決勝進出をほぼ確実にした。10月1日にミルトンキーンズのスタジアムmkでカナダ代表に41-18で勝利。ボーナスポイント（1試合で4トライ以上した場合、7点差以内で敗れた場合にそれぞれ1点が与えられる）も獲得し、3勝0敗の勝点14でプールDの首位に立った。　同組では、現在、1勝1敗で勝点4のイタリア代表と、2勝0敗で勝点10のアイルランド代表、そしてフランス代表の3チームが最終的に勝点14で並ぶ可能性はあるが（勝点が同じ場合、当該チーム対戦で勝った方が上位。それでも並んだ場合は総得失点差で順位を決定）、イタリアとの直接対決を制しているフランスは数字的にかなり優位な立場にあり、8強入りは濃厚となった。　フランスは快勝ではなかった。格下のカナダが17点ビハインドから巻き返し、ワールドカップ3回目出場のDTH・ファンデルメルヴァ（WTB）の勝負強い走りやHOアーロン・カーペンターのパワフル突進で5点差に迫った。再び差は開くがその後もPGで加点し、後半18分までは24-18と接戦に。しかし、フランスが終盤にフォワード勝負とバックス展開で2トライを重ね、粘るカナダを振り切った。　敗れたカナダのキアラン・クローリーヘッドコーチは「チームのパフォーマンスを誇りに思う。フランスに6点差にまで迫ったが、基本的なミスをおかしてしまった。トップレベルのチームを相手にしてはいけないこと。結果は残念だが、後半途中まで接戦したことには満足している」とコメント。　一方、勝ったフランスのフィリップ・サンタンドレヘッドコーチは、「次のアイルランド戦に向けて準備をする。我々のターゲットはグループを1位通過することだ」と語った。'),(283,'＜ゴルフ＞“兵役法違反問題”べ・サンムン「軍隊に行き、成長した姿をお見せする」','spo','ベ・サンムン（29）が軍入隊を契機にさらに成長した姿を見せると誓った。　べ・サンムンは2日午前、京畿道（キョンギド）にある韓国プロゴルフ協会（KPGA)にて公式記者会見を開き、兵役法違反で問題を巻き起こしたことについて口を開いた。　べ・サンムンは「軍入隊によるキャリア断絶の負担がなくはなかった。毎年目標があり、これを叶えるために努力してきた。しかし今は心を空にして戻ってきて、もっと上手くできるという自信を繰り返し味わっている」と述べた。　2005年徴兵検査で2級現役兵入営対象判定を受けたべ・サンムンは、2011年1月20日から昨年12月31日まで、兵役法第70条1項などにより、数回にわたり「短期国外旅行」を理由に国外旅行許可を受け、PGA（米国プロゴルフ）ツアーで活動してきた。　その後、べ・サンムンは28歳まで国内の学校に在学しているという理由で入隊を延期。しかし昨年、国外旅行期間延長申請が受け入れられず、2014年12月31日に国外旅行許可期間が満了した。　べ・サンムンはことし1月31日までに帰国し、兵役義務を履行しなければならなかったが、これに応じなかった。べ・サンムンは裁判所に行政訴訟を起こしたが、敗訴すると自主入隊の意思を明らかにした。プレジデンツカップ参加のため帰国したべ・サンムンは先月30日、警察へ行き兵役法違反の疑いについて認めた。　べ・サンムンは「警察調査に誠実に臨んで、長い時間はかからなかった。どんな心情で訴訟を起こし、定められた期間に韓国に帰国しなかった点など、その理由についても話した」と説明した。Copyrights(C)News1wowkorea.jp'),(284,'増渕、鵜久森ら戦力外＝プロ野球・日本ハム','spo','　日本ハムは2日、増渕竜義投手、鵜久森淳志外野手、河野秀数投手、斉藤勝投手と来季の契約を結ばないと発表した。　'),(285,'5年前の再現! ロッテが本拠でCS進出を決める','spo','『クライマックスシリーズ(CS)』進出争いが激しいのは、セ・リーグだけではない。パ・リーグも『CS』最後のひと枠を競う3位攻防戦が熾烈を極めている。10月1日・日本ハム戦で、涌井秀章が投げれば7回3安打1失点、打てば10得点でロッテが4連勝し、1か月ぶりに3位浮上を果たしたのだ。1か月前、ソフトバンクが『CS』出場両リーグで一番乗りを決めた9月6日、ロッテは西武との3連戦で3タテを食らい、57勝61敗1分と3位・西武に2ゲーム差を付けられていた。その後10試合で4勝6敗、そのままズルズル成績を下げると思われたが、ロッテは踏みとどまった。9月21日からの4連勝、ひとつ黒星を挟んで、再び4連勝を果たし、ついに西武を逆転したのだ。ロッテは5試合を残し、69勝68敗1分。西武は69勝69敗5分でレギュラーシーズンを終えた。ロッテは残り5試合で2勝すれば、『CS』出場を果たす。ロッテが71勝71敗1分でシーズンを終え勝率で並んだとしても、西武戦で13勝11敗1分と勝ち越しているのが決め手となるのだ。3位からの逆襲と言えば、2010年『CS』を思い出すロッテファンも多いだろう。優勝はソフトバンク、2位はゲーム差なしの西武、3位は2.5ゲーム差離されたロッテという順位でペナントレースを終えた。1位と2位の勝率差はわずかに2厘。『CS』でソフトバンク×西武の決着戦が予想される中、ファーストステージで2試合連続の延長戦を制し、ロッテが西武を撃破。ファイナルステージで初戦こそロッテが取るも、その後2連敗を喫し、ソフトバンクがアドバンテージの1勝を含め、王手をかける。だが崖っぷちに追い詰められたロッテが3連勝し、『日本シリーズ』出場を決めたのだった。『日本シリーズ』でもロッテの勢いは止まらなかった。セ・リーグを制し、順当に『CS』を勝ち上がった中日を、4勝2敗1分で振り切り、史上初の3位からの日本一を達成した。西村徳文監督就任1年目のことである。5年前の下克上よ、再び。そのためには残り5試合で2勝が必要だ。ロッテは10月2日(金)・3日(土)にQVCマリンフィールドに楽天を迎え、10月4日(日)・5日(月)には同じくQVCで日本ハムと対峙する。10月6日(火)に敵地に乗り込み、楽天と最終戦を行う。55勝80敗3分で最下位に沈む楽天には直接対決で11勝11敗と五分だが、9月以降は4勝1敗、現在3連勝中だ。9ゲーム差離されている2位・日本ハムには10勝13敗と負け越しが決定したが、9月以降は4勝2敗、2連勝中と盛り返している。たとえ、2勝3敗と負け越しても、『CS』出場は達成できる。5試合のうち4試合をホームで戦えるのは何よりも心強い。QVCマリンフィールドでプレーボールを迎える10月2日(金)・3日(土)・楽天戦、4日(日)・5日(月)・日本ハム戦のチケットは発売中。『CS』出場へクリンチナンバー2としたロッテを後押ししたい。'),(286,'亜大が勝ち点1＝東都大学野球','spo','　東都大学野球秋季リーグ戦第5週第4日は2日、神宮球場で3回戦1試合が行われ、亜大が駒大を2―1で破り、勝ち点1とした。　　亜大は五回に藤岡（4年、岡山理大付）の二塁打で先制し、八回は板山（4年、成立学園）が適時打。八回途中まで無失点の石塚（4年、玉野光南）が今季3勝目を挙げた。　'),(287,'日本はカナダに敗れて5-8位戦へ [ジュニアフェド杯／女子テニス]','spo','「ジュニアフェドカップ決勝大会（女子16才以下国別対抗戦）」（スペイン・マドリッド／9月29日〜10月4日）の3日目。日本は予選リーグ・グループBの最終戦で第4シードのカナダに0-3で敗れて決勝トーナメント進出はならなかった。　グループ2位の日本は5-8位トーナメントに回り、初戦でグループAを2位で通過した第5シードのオーストラリアと対戦する。　日本はアジア／オセアニア予選（オーストラリア・シェパートン／4月8〜13日）で3位となり、2年連続決勝大会に進出。昨年の大会では5位入賞を果たしている。ジュニアフェド杯女子日本代表監督◎中山芳徳選手◎宮本愛弓（志津テニスクラブ）、本玉真唯（日出高校）、坂田季美佳（山梨学院大学附属高校）予選リーグ第3戦結果【グループA】○チェコ[1]（3勝）2-1●オーストラリア[5]（2勝1敗）○アルゼンチン（1勝2敗）2-1●オランダ（3敗）＜グループA・順位＞1位チェコ（3勝）2位オーストラリア（2勝1敗）3位アルゼンチン（1勝2敗）4位オランダ（3敗）【グループB】○カナダ[4]（3勝）3-0●日本（2勝1敗）S2○BiancaANDREESCU6-26-2●本玉S1○CharlotteROBILLARD-MILLETTE6-26-3●坂田D○ANDREESCU／ROBILLARD-MILLETTE6-36-1●宮本／坂田○イギリス[7]（1勝2敗）2-1●コロンビア（3敗）＜グループB・順位＞1位カナダ（3勝）2位日本（2勝1敗）3位イギリス（1勝2敗）4位コロンビア（3敗）【グループC】○ロシア[3]（3勝）3-0●ブラジル[8]（1勝2敗）●台湾（3敗）0-3○イタリア（2勝1敗）＜グループC・順位＞1位ロシア（3勝）2位イタリア（2勝1敗）3位ブラジル（1勝2敗）4位台湾（3敗）【グループD】○アメリカ[2]（3勝）3-0●スペイン[6]（2勝1敗）○ニュージーランド（1勝2敗）2-1●エジプト（3敗）＜グループD・順位＞1位アメリカ（3勝）2位スペイン（2勝1敗）3位ニュージーランド（1勝2敗）4位エジプト（3敗）※[　]数字はシード順位（テニスマガジン／TennisMagazine）'),(288,'日本がアメリカを倒して決勝T進出 [ジュニアデビス杯／男子テニス]','spo','「ジュニアデビスカップ決勝大会（男子16才以下国別対抗戦）」（スペイン・マドリッド／9月29日〜10月4日）の3日目。第8シードの日本は予選リーグ・グループCの最終戦で第3シードのアメリカを3-0で破り、3戦全勝のグループ首位で決勝トーナメント進出を果たした。　日本は決勝トーナメントの初戦で、グループDを1位で通過した第5シードのドイツと対戦する。　日本はアジア／オセアニア予選（オーストラリア・シェパートン／4月8〜13日）で準優勝となり、6年連続で決勝大会に進出。昨年の大会では4位入賞を果たしている。ジュニアデ杯男子日本代表監督◎岩本功選手◎堀江亨（関スポーツ塾・T）、田中優之介（秀明英光高校）、清水悠太（西宮甲英高）予選リーグ第3戦結果【グループA】○カナダ[1]（3勝）3-0●チェコ[7]（2勝1敗）●香港（3敗）1-2○ポーランド（1勝2敗）＜グループA・順位＞1位カナダ（3勝）2位チェコ（2勝1敗）3位ポーランド（1勝2敗）4位香港（3敗）【グループB】○ロシア[4]（3勝）2-1●アルゼンチン[6]（2勝1敗）○台湾（1勝2敗）2-1●スウェーデン（3敗）＜グループB・順位＞1位ロシア（3勝）2位アルゼンチン（2勝1敗）3位台湾（1勝2敗）4位スウェーデン（3敗）【グループC】●アメリカ[3]（2勝1敗）0-3○日本[8]（3勝）S2●PatrickKYPSON2-66-01-6○田中S1●VasilKIRKOV6-7(4)4-6○堀江D●KYPSON／KIRKOV6-7(5)4-6○清水／田中○ブラジル（1勝2敗）2-1●スペイン（3敗）＜グループC・順位＞1位日本（3勝）2位アメリカ（2勝1敗）3位ブラジル（1勝2敗）4位スペイン（3敗）【グループD】●オーストラリア[2]（2勝1敗）1-2○ドイツ[5]（3勝）○コロンビア（1勝2敗）3-0●南アフリカ（3敗）＜グループD・順位＞1位ドイツ（3勝）2位オーストラリア（2勝1敗）3位コロンビア（1勝2敗）4位南アフリカ（3敗）※[　]数字はシード順位（テニスマガジン／TennisMagazine）'),(289,'目指せ五郎丸キック　４日、関西大学ラグビーリーグで催し','spo','　Ｈ型のゴールポストへ楕円（だえん）球を蹴り込む気分を味わってみませんか？ラグビーのワールドカップ（Ｗ杯）イングランド大会で五郎丸歩選手（ヤマハ発動機）のゴールキックが注目されているのを受け、京都府ラグビー協会は４日、京都市左京区の宝が池球技場で行われる関西大学リーグの試合前に体験イベント「ねらって！ゴールキック?君もゴロー丸！」を実施する。　Ｗ杯優勝２度を誇る南アフリカを破った１次リーグ初戦で、五郎丸選手はペナルティーゴール（３点）を５本、トライ後のゴール（２点）を２本成功させ、日本の大金星に貢献。キックの前に腰をかがめ、両手を顔の前で合わせて集中力を高める「おがみポーズ」が話題を呼んでいる。　盛り上がるＷ杯を競技普及の絶好機と考えた同協会は「五郎丸選手と同じ気分を味わい、ラグビーをより身近に感じてもらえる機会になれば」と急きょイベントを企画した。プレー経験の有無や年齢、性別を問わず参加できる。この日の試合に登場する京都産業大や同志社大、立命館大の選手による指導でゴールキックを体験し、その後にコンテストも行う。　見事ゴールキックを成功させたり、五郎丸選手になりきったキックを見せるなど優秀なプレーを披露した参加者５人程度に、同選手が使用しているのと同タイプのキックティー（ボールを置く台）をプレゼントする。参加費１００円（保険料相当額）。午前９時１５分から同球技場のメーンスタンド西端で参加を受け付け、９時３０分から１時間ほど行う。雨天中止。'),(290,'真央完全復帰へトリプルアクセル跳んだ　上下黒の練習着で「蝶々夫人」を披露','spo','　フィギュアスケートのジャパンオープン前日練習が２日、埼玉スーパーアリーナで行われた。　約１年の休養を経て現役続行を明言し、復帰戦に臨む女子の浅田真央（２５）＝中京大＝は、上下黒の練習着でリンクへ登場。ＦＳの「蝶々夫人」を披露した。“代名詞”のトリプルアクセルは、曲をかけた練習を含め３度挑戦し、３度とも着氷。完全復帰へ向け、ジャンプも好調だ。'),(291,'Jrフェド杯 カナダに力及ばず、3敗喫す＜ジュニアテニス＞','spo','テニスの国別対抗戦ジュニアフェドカップ（スペイン/マドリッド）16歳以下は1日、グループBの日本は本玉真唯（関東/S.ONEグリーンテニスクラブ）、坂田季美佳（関東/山梨学院大学附高）、宮本愛弓（関東/志津TC）がいずれもストレート負けを喫し第4シードのカナダに通算0勝3敗で敗れた。日本2勝目、Jrフェド杯この試合、シングルス第1試合には今年の全日本ジュニアテニス選手権16歳以下で優勝の本玉真唯が登場。B・アンドレエスクと対戦し2-6，2-6のストレートで敗れた。続くシングルス第2試合では、同じく今年の全日本ジュニア準優勝の坂田季美佳がC・ボリラード=ミレッテに2-6，3-6のストレート負け。ダブルスは宮本愛弓/坂田季美佳組で挑むも、B・アンドレエスク/C・ボリラード=ミレッテ組に3-6，1-6のストレートで敗れて日本は3戦全敗となった。対戦したカナダは、日本に勝利したことでグループ全勝となった。組み合わせは、以下の通り。【イギリス戦】・シングルス第1試合　本玉真唯○-×A・コリンズ・シングルス第2試合　坂田季美佳×-○K・スワン・ダブルス　坂田季美佳/宮本愛弓組○-×JA・バレイジ/A・コリンズ組【コロンビア戦】・シングルス第1試合　本玉真唯○-×S・ムネラ・シングルス第2試合　宮本愛弓×-○E・アランゴ・ダブルス　宮本愛弓/坂田季美佳組○-×E・アランゴ/S・ムネラ組【カナダ戦】・シングルス第1試合　本玉真唯×-○B・アンドレエスク・シングルス第2試合　坂田季美佳×-○C・ボリラード=ミレッテ・ダブルス　宮本愛弓/坂田季美佳組×-○B・アンドレエスク/C・ボリラード=ミレッテ組'),(292,'どのようなトレーニングをしたら錦織圭選手のようになれるのか？（2）','spo','第2回の今回もMLBマイナーチーム、横浜DeNAベイスターズのトレーナーを務めたPassionSportsTraining代表、N’sMethodスポーツメディカル＆トレーニングコーチの武井敦彦トレーナーの解説より。どのようなトレーニングをしたら錦織圭選手のようになれるのか？（1）〜ジュニア時代からの計画されたトレーニングの重要性〜“フットワークをジュニア時代から強化したいが、現状ではラダー後に、テニス練習に移行しているが、あまり試合では目立った成果が見られないが、どのようなフットワークトレーニング方法があるのか？“テニスに必要なフットワークとは？テニスの動きは、70%は横方向の動きであると言われています。ネットアプローチや、後ろに下げられた時は、前後方向にも動く必要もありますが、平均移動距離は約4mで、この範囲で主に横の動きが行われているのが現状です。1ポイント辺り平均約4回もの方向転換が行われ、3-5セットマッチでは約300-1000回とも言われています。そこで、只スピードが速いだけではなく、加速と減速を機敏に繰り返す事の出来る能力が必要不可欠であります。また、1ポイントの平均時間は約6-10秒とされていますので、こちらもトレーニングの際に指針となる数字になります。このように、試合中に必要なフットワークの背景を理解することが、計画的なトレーニングに向けて大事になります。フットワークトレーニング〜一歩目を早くする〜テニスは狭い範囲で、しかもある程度決められた距離を素早く加速と減速を繰り返すスポーツですが、人間が最大の加速スピードを獲得するためには、約20m必要だと言われています。しかし、テニスはベースラインからネットまでの距離が11.89mですので、トップスピードを得ることは不可能です。そこで、スタート時の一歩目の速さが重要になるわけです。パワーポジションフットワークで重要な一歩目を早くする為には、8つの要素を習得することが必要になります。正しいポジション所謂“パワーポジション”で準備出来るかどうか。この姿勢では、股関節に上半身の荷重が行われ、上下肢のバランスが整っている。低い重心先ほどのパワーポジションになる際に、重心を低くすることが重要になります。動き出すときは、足からのパワー発揮が重要になるので、安定した低い重心が鍵になります。上下肢の使い方基本的には腕の振りは肩甲骨中心となり股関節の回旋と共に動きます。　肘の角度は約90度、足裏では母指球を中心に地面を蹴り、体の傾きは約45〜10°が理想的と言われています。体幹の強さ体幹については、様々な強化方法がありますが、体幹が安定することにより、頭蓋位置の安定から情報伝達の向上、そして足からのパワー向上が見られるので、運動連鎖も効率よく獲得出来ます。ストレングス最大限の力を発揮出来る能力になります。15〜16歳前後から本格的にトレーニングを始めることが求められます。パワー短期間に力を作り出せる能力ですが、プライオメトリックなどのトレーニングはやはり15歳以上が効果を期待出来ます。しかし、小学生などでも、縄跳びなどで、地面からの力である“地面反力”を感じるトレーニングを行うことも可能です。反応時間テニス選手は相手の打球に対して、0.2秒以内に反応することが求められています。そこで、重要になるのが、臀部、ハムストリング、そしてふくらはぎ部分の効率的な使い方になります。予測相手の動き、癖を判断することも求められますが、やはり情報は目から入ってきますので、スポーツビジョンと言われている総合的な動体視力や静止視力が必要になってきます。フットワークトレーニング〜3つのステップ〜テニスにおけるフットワークの背景、一歩目を早くする方法を身に着けたら、次は実際にコート上で躍動感溢れる動きをする為のトレーニングが求められます。以下3つのステップがありますので、参照して頂ければと思います。基本的なフットワークトレーニングラダーや、ミニハードル、階段、そして坂道ダッシュなどは、この部類に入ります。やはり、正しく体全体を使い、“走る動作”の獲得が行われないままテニスの動きをすることは、英単語が分からないのに、英作文を書くようなものです。まずはここが最初のステップになります。準テニスに即したフットワークトレーニング基本的な走動作を獲得したら、次にテニスに必要な動きをトレーニングする必要があります。例えば、スパイダードリルというものがありますが、5方向に加速、原則を繰り返すので、まさに準テニスに即したトレーニングとなります。スパイダードリルスパイダードリルセンターマークからスタートし、各ポイント、(1）ベースライン×右側シングルサイドライン、（2）サービスライン×右側シングルサイドライン、（3）ライン、（4）サービスライン×左側シングルサイドライン、（5）ベースライン×左側シングルサイドライン)にあるボールをセンターマークにセットしているラケットに1球ずつ右回りで置く。スタートから最後のボールを置いた時点でストップウォッチを止める。テニスに即したフットワークトレーニングこちらのドリルは、テニスコーチとのコミュニケーションが鍵になります。上記の説明した体勢や考え方を理解した上で、実際にボールを打球しながら、フットワーク技術を獲得する事が必要になります。このようにテニスのフットワークトレーニングを行う際に、テニスで使われる背景を理解し、段階的にトレーニングを積むことにより、より効率的、効果的なトレーニングが行われ、結果的に“テニスに必要なフットワーク”獲得が可能になります。ただ闇雲に、ラダーや坂道ダッシュを行うよりも、指導者自身が理解した上で行えば、選手にとっても納得のいくものになると思いますので、是非試して頂ければと思います。'),(293,'代表候補のトライアウト実施へ＝女子野球W杯','spo','　全日本女子野球連盟は2日、韓国で来年開催される第7回女子ワールドカップ（W杯）に臨む代表候補を選考するトライアウトを12月5、6の両日実施すると発表した。　同連盟のホームページから申請用紙をダウンロードして応募する。　'),(294,'日本勢2組が白星発進＝ビーチバレー','spo','　ビーチバレーのアジア女子選手権は1日、香港で1次リーグが始まり、B組の西堀健実、溝江明香組（トヨタ自動車）はマカオペアを、D組の石井美樹（山崎総建）村上めぐみ（オーイング）組は台湾ペアをともに2―0で下し、初戦を白星で飾った。　　1次リーグは24ペアが8組に分かれて総当たり戦を行い、各組上位2ペアが決勝トーナメントに進む。　'),(295,'レーベンズが今季初勝利＝NFL','spo','　【ロサンゼルス時事】米ナショナル・フットボールリーグ（NFL）は1日、第4週の1試合が行われ、レーベンズがスティーラーズを延長の末に23―20で破り、4戦目で今季初勝利を挙げた。　RBフォーセットがランで150ヤードを獲得した。スティーラーズは2勝2敗。　'),(296,'村上大介にＹＯＳＨＩＫＩパワー　フィギュアジャパンＯＰへ','spo','　フィギュアスケートのジャパンオープン前日練習が２日、埼玉スーパーアリーナで行われた。　男子の村上大介（２４）は今季、フリーでＹＯＳＨＩＫＩ（Ｘ　ＪＡＰＡＮ）の「Ａｎｎｉｖｅｒｓａｒｙ」を熱演する。　夏に本人と対面した村上は、「美しい男性だった。肌がきれいで、オーラもバリバリ。背が高くて、しゃべりにくかった」と興奮気味で振り返った。「ＹＯＳＨＩＫＩさんのファンもいて、プレッシャーは倍になったけど、ＹＯＳＨＩＫＩさんに感動してほしい」とシーズンへ向け、完成度を高めてきた。　今季の目標はグランプリファイナル出場。「ジャパンオープンではノーミスの演技がしたい」。ＹＯＳＨＩＫＩの「パワーをもらった」という村上が、純白のリンクを“紅”に染める。'),(297,'＜バスケットボール＞中国メディア、“韓国チーム弁当事件”を報道','spo','バスケットボール代表チームの劣悪な環境は今や外国取材陣の間でも話題となっている。　キム・ドングァン監督率いる男子バスケットボール代表チームは1日午後、中国にておこなわれた2015アジア男子バスケットボール選手権8強戦で、“アジアチャンピオン”イランに62-75と完敗した。2016年リオ五輪進出に失敗した韓国は2日、インドと5〜8位決定戦をおこなう。　韓国選手団は大会序盤、若い選手たちが手洗いで洗濯をした。ホテルの洗濯費用があまりに高かったためだ。その後、現地の洗濯業者を紹介された代表チームは、洗濯問題を解決した。また、選手たちはホテルで提供された中国料理が口に合わず、苦労した。選手団は近くの韓国食堂から試合当日、1日1食を配達してもらい、食事問題を解決している。　中国のスポーツ新聞オンラインメディアは去る29日「異常だ！　韓国チームの失敗、湖南料理のせいにする」というタイトルの記事を掲載。韓国チームがカタールに敗戦したのをめぐり、料理を言い訳にしているという内容だ。同メディアは韓国メディアの報道を引用して「韓国チームは中国料理が口に合わないとして、韓国料理の弁当を注文して食べている」と付け加えた。また、宿泊所が提供する中国料理の写真まで掲載した。　同メディアは、選手団ホテルの厨房長のインタビューまで掲載し「中国料理は辛く、しょっぱくない」とし料理に全く問題がないと抗弁している。料理に異議を提起する韓国人が「異常だ」という主張である。韓国人の味覚に中国料理が合わないということは考慮していない。　中国人の大会関係者は「韓国チームをおとしめるための悪意的な報道だ。ほとんどの中国人は、そのように思っていない」とし「韓国チームが弁当を注文して食べるのを見ると、中国料理が気に入らない様子だ。外国取材陣もホテルで提供する中国料理に対して不満が多い」とし、韓国チームが誤解を受けることを心配した。Copyrights(C)OSENwowkorea.jp'),(298,'ナダルがジョコビッチを「素晴らしいシーズンだった」と讃える [男子テニス]','spo','　ラファエル・ナダル（スペイン）は今季全米で2度目の優勝を果たしたライバルのノバク・ジョコビッチ（セルビア）について、人としても「素晴らしいシーズンだった」と讃えた。10月2日、タイでジョコビッチとナダルがエキシビションマッチを開催「BacktoThailand」と題された、タイ・バンコクで開催される両者によるエキシビションマッチのチケットはソールドアウト。金曜日に予定されているイベントは8月17日にバンコクで起きた爆弾テロで20名が死亡した事件のあとの安全性をアピールするためのものでもある。　両者が並んで行った記者会見で、ナダルは全仏オープンとモンテカルロの大会でジョコビッチに敗れたリベンジを狙っているのかと聞かれると、「いや、まったく」と笑いながら答えている。「明日勝ったところで、それはリベンジにはならないからね」。「これはエキシビションマッチだ」とナダルが付け加えると、ジョコビッチは笑顔を見せながら、「僕たちの目的はまずいいプレーを見せること。それで僕たちや、見に来てくれたみなさんに楽しんでもらうことだ」と話している。　ナダルはジョコビッチへの賛辞を惜しまず続けた。「ノバクは素晴らしいシーズンを実現した。全米オープンのあとに彼にメールしたんだけど、今日また公的な場所で改めて言いたい。彼はシーズンを通じて素晴らしかった」とナダル。「メンタルの強さ、そして彼が見せたテニスのレベルにはなかなか追いつけそうにない」。　ジョコビッチは静かにその賛辞を聞きながら、バンコクのファンに「いいショーをお見せしたいと思う」と話している。　ジョコビッチとナダルはツアーレベルの試合で43度対戦していて、ナダルが23勝しているが、今季はジョコビッチがナダルが得意とするクレーで2勝を挙げるなどしている。　金曜日の試合を前に、ジョコビッチとナダルは最大級のVIP扱いを受け、プラユット・チャンオチャ首相のエスコートで王宮を訪れている。　ジョコビッチがタイを訪れたのは2008年以来で、タイ・オープンの決勝でジョーウィルフライ・ツォンガ（フランス）に敗れている。また、ナダルは2010年以来のタイで、同じく準決勝で敗れていた。(C)AP（テニスデイリー／THETENNISDAILY）Photo:MONTE-CARLO，MONACO-APRIL18:NovakDjokovicofSerbiaiscongratulatedbyRafaerlNadalofSpaininthesemifinalsduringdaysevenoftheMonteCarloRolexMasterstennisattheMonte-CarloSportingClubonApril18，2015inMonte-Carlo，Monaco.(PhotobyJulianFinney/GettyImages)'),(299,'ラグビー試合前のハカ、「嫌なら自分も踊りを」と専門家','spo','【AFP＝時事】ラグビー界で何世代にもわたって人々を悩ませてきた問題がある──ニュージーランド代表チームが試合前に行う、足を踏み鳴らし胸を叩くダンス「ハカ（Haka）」に対して、どう対応すればいいのか、という難問だ。【写真】オールブラックスの力強いハカ　オールブラックス（AllBlacks、ニュージーランド代表の愛称）が1905年に始めたこの儀式に、おじけづいていないことを相手チームが示そうとした結果、いくつもの名場面が誕生した。　名シーンとして有名なのは1989年のランズダウン・ロード（LansdowneRoad）スタジアムで、アイルランド代表チームがオールブラックスに向かって前進し、主将同士が至近距離でにらみあいになった場面だ。また、1991年のラグビーW杯準決勝、オーストラリア代表のデビッド・キャンピージ（DavidCampese）はニュージーランドのハカをあからさまに無視、試合はオーストラリアがニュージーランドを下した。　最近では、2011年の決勝で、V字の陣形を組んだフランス代表チームがハカを踊るオールブラックスに向かって前進していった場面が名高い。フランスチームは罰金を科されたが、評論家らは、協会当局がハカへの「冒とく」行為に対して神経質になりすぎていると非難した。　ハカへの正式な対応方法は存在しないようだが、ニュージーランド先住民マオリ（Maori）の文化に詳しい専門家によると、伝統的な対抗方法は「自分もハカを踊る」ことだという。「Haka:DanceofaNoblePeople（ハカ：高潔な人々の踊り）」の著者、ティモティ・カレトゥ（TimotiKaretu）教授は「ハカへの対応はハカをやり返すことだ」と語る。「相手が何を言っているか聞き、同じようなやり方で対応をする。ニュージーランドのセカンダリースクール（日本の中学・高校）のラグビーチームはハカに対してハカで応じる。これまでずっとそのように行われてきた。マオリの伝統だ」'),(300,'ミシャラクが記録更新のフランス、8強一番乗り ラグビーW杯','spo','【AFP＝時事】ラグビーW杯イングランド大会（RugbyWorldCup2015）は1日、プールDの試合が行われ、フランス代表は41-18でカナダ代表を下し、決勝トーナメント進出一番乗りを果たした。【写真】トライを狙うフランスのフォファナ（その他全5枚）　フランスは、今月33歳を迎えるSOフレデリック・ミシャラク（FredericMichalak）がこの試合で14得点を挙げ、同国の歴代最多得点記録を更新した。ミシャラクは、前記録保持者のティエリ・ラクロワ（ThierryLacroix）が持つ通算124得点を12点更新した。　ミシャラクはまた、英国のヘンリー王子（PrinceHarry）も含めたスタジアムMK（StadiumMK）の最多記録となる2万8145人が詰めかけたこの試合で、マン・オブ・ザ・マッチに選ばれた。　フランスは、17-0としながら一時は5点差まで詰め寄られるなど会心の勝利とはいかなかったが、予選プールの最終戦となる11日のアイルランド戦で首位通過を決めれば、準々決勝での激突が見込まれるニュージーランド代表との対戦を回避できる。　プールDでは、4日にイタリア戦を控えるアイルランドが2戦全勝としている。【翻訳編集】AFPBBNews');
